(1, '<h1>第一次找實習務必要破除的3大迷思｜實習學長姐經驗談</h1>', '<p>第一次找實習的人，總是會有這幾種迷思……<br>實習就是要找有興趣的  => 你幻想中有興趣的工作實際上可能一樣<br>實習正要找知名企業  => 實習內容、工作方式是不是你想要的才是重點<br>實習就是要靠自己努力的找 => 妥善利用源，不要傻傻埋頭苦幹 </p><p>1. 實習就是要找有興趣的<br>你有實際做過「你認為的」有興趣的工作或實習嗎？還是只是因為周遭朋友都做這類的實習、聽別人對於這個工作的描述、或是因為在學校學感覺這個很有趣，就認為這是我「有興趣的」呢？</p><p>有些人工作的滿足感、動力來自「做自己喜歡做的事」，有些人來自「做自己擅長做的事」、有些人來自「做有意義的事」、有些人則來自「做可以得到很多錢的事」。如果你今天做著你有興趣但不擅長的事，而你不了解其實你的工作的動力來自完成目標的成就感時，當因能力不在此而無法持續達成目標，那股熱情可能很快就消失殆盡了。 </p><p> 2. 實習就是要找知名企業<br>不可否認，能進到知名企業實習，確實可以獲得一個閃亮的名聲。但是進比較沒沒無聞的小企業甚至是新創企業，就比較不能學到東西嗎？不一定喔！以新創企業來說，因為員工少、公司組織比較扁平，可能可以接觸到更多策略面的決策思維、甚至是直接參與正式的公司業務。反之，大公司組織規模比較大，你可能不會直接的接觸公司業務，比較是學習的角色，完成Mentor交辦的任務。重要的是…..實習內容 & 工作方式是不是你想要的！如果你的學經歷真的不比別人漂亮，整天做著白日夢想要進大公司，那就真的只能一直待業中了。 </p><p>3. 實習就是要靠自己努力的找啊！<br>先回想一下，學校寄來的信，你是不是頭也不回的直接把他刪掉啊！其實學校不定時的也會丟出相關的資訊。大家身邊其實有很多資源可以利用，但往往都只是埋頭苦幹，努力的搜職缺、努力的修自己的履歷、努力的準備面試，用對方法事半功倍啊！</p>', 'articleImage1', 5),
(2, '<h1>2022 工程師求職管道彙整：只用人力銀行找工作？工程師，你可能錯過很多好職缺</h1>', '<p>身為一名工程師，你都怎麼找工作，又是從哪裡找工作呢？打開人力銀行的網站，大量投遞履歷就結束了嗎？</p><p>其實，一股腦地往人力銀行投遞履歷，並不是找到工程師職缺的最佳解。如果你正從人力銀行成千上百個工作職務中猶豫，不曉得到底該投哪個而煩惱，或者找到你的工作你不喜歡、你喜歡的工作又不找你，也許該試著想想，作為工程師，你是否通過正確的渠道找工作？</p><p>傳統企業和大公司找工程師人才，主要會透過四種通道：人力銀行、獵人頭公司、展會人脈交流、網路社群。</p><p>1. 人力銀行</p><p>是的，人力銀行仍是傳統企業在找工程師的主要管道，不過竹科人資表示，從 104 看履歷，因為量極大，常常有很多搞不清楚狀況的求職者寄信來，雖然數量高，但媒合成功的職缺比例其實不如其他的求職管道順利。她也指出，雖有少數顧問、總經理職缺，但一般來說人力銀行媒合到的還是資歷偏淺的求職者，大約 5 年工作經驗以下。</p><p>因此，身為一位工作經驗在 5 年內的工程師，的確可以多在人力銀行這個求職管道佈局，但建議搭配 PTT Tech-Job 板服用，因為工程師的職缺太多，同樣的工程師職缺 Title 卻可能是完全不同的工作內容，要讓求職的職缺符合想像，還是要多徵求社群經驗。</p><p>人資們也建議工程師從人力銀行找工作，履歷上的工作經歷要能具體量化，因為工程師的戰績是很明顯的，一年寫幾個專利、懂不懂製程、材料，都要清楚寫在履歷上，找工作時才能脫穎而出。</p><p>2. 獵人頭公司</p><p>一般在業界工作 8 年，即被視為資深工程師，這時候會主動找來的求職管道主要就是獵頭公司。竹科人資表示，產業界 Top 3 的公司 HR 和獵頭公司多有交流，獵頭都會試圖拿到各公司的組織層級狀況，幾個部、幾個課、幾個 function area 都在他們掌握中。當對手公司開出工程師職缺，馬上就會找上門。</p><p>由於獵頭公司是靠交易抽成運作的，通常拿一位求職者薪資的 10%~20%，所以主管職、高薪族群比較會被獵頭這個求職管道鎖定，工程師、技術人才的職缺也是其中之一。要被獵頭挖角沒別的，一定是靠工作實力，再來可耕耘的部分就是下一個重點，多參加展覽和研討會累積人脈。</p><p>3. 展會人脈交流</p><p>其實科技業工程師的圈子很小，平常靠展覽與研討會都會接觸到。而展會不只可以讓工程師在同行水平流動，也往往有跳到上下游工作的機會。例如研發工程師對應到供應商，要設計一個新產品時要有密切接觸才能拿到好的用料，久了混熟就會互相舉薦，往供應商或客戶端跳的案例很多。</p><p>所以如果看準自己在產業鏈的位置沒有發展性，不妨多在展會與上下游廠商建立關係，很容易透過內推的方式輕鬆跳入理想的工程師職位，也不需和人力銀行的眾多工程師求職者打泥巴仗。</p><p>4. 網路社群</p><p>對大公司來說，如果要從網路社群找工程師人才，多半會透過 LinkedIn，尤其是搜尋歐美、東南亞、日本、新加坡等國外的技術人才。因此也建議工程師們，就算不是立即要找工作，平時若有空也可以多經營自己的 LinkedIn 帳號。</p><p>對科技業人資來說，在 LinkedIn 上看得到每個人的真實帳號，如果有工程師大神幫你抬轎，會比起人力銀行附加的推薦信更有可信度。</p><p>新創公司的工程師職缺，除了基本的人力銀行之外，就業媒合平台、網路社群和各新創公司官網也都是適合搜尋工程師職缺的渠道。</p><p>如果你是透過新型態的求職管道應徵工程師職缺，記得就盡量別附人力銀行的制式履歷，尤其是注重思路靈活的新創公司，想看到的求職信和傳統企業當然有差別。記得花心思針對各家公司的工程師職缺需求撰寫履歷，並且有實際的工作記錄證明自己是個人才，才可能獲得面試的機會，以及有較高的薪資談判空間。</p>', 'articleImage2', 4),
(3, '<h1>RWD比較好還是AWD?</h1>', '<p>沒有RWD、AWD的網站已經走入歷史</p><p>沒有RWD或AWD的網站到底會怎樣？先講結論，網站流量會暴跌，RWD跟AWD就是行動網站，而現在用行動裝置上網的比例超過80%，而且Google於2020年9月「正式執行」以行動網站為排名依據，簡單來說沒有手機版的網站等於宣告死刑，無法被搜尋的網站有什麼用？沒有RWD的網站請趕快改版，RWD、AWD都不是很新的技術了，已經是成熟的技術，而且套版網站費用沒有很高，趕快改版才是當務之急。</p><p>RWD (響應式網頁設計)是甚麼?</p><p>RWD (響應式網頁設計)：可以自動將網站顯示於各種不同裝置，包含桌機、手機、平板，根據不一樣的銀幕大小設計友善的閱讀介面，較叫做「RWD」。RWD 常用閱讀解析度：電腦版的寬度：至少1024px以上 ，平板裝置寬度720px ~ 1024px之間 ，手機裝置寬度：320px ~ 720px之間，當網站出現不同寬度時，RWD (響應式網站)就會讀取「同一個CSS樣式」，自動顯示不一樣的排列方式，請點擊看下方的影片您就了解RWD的變化運作方式，如果網站是AWD設計的，是不會這樣變化的，所以移動視窗是沒辦法看出是AWD的網站。</p><p>AWD (自適應式網頁設計)是甚麼?</p><p>AWD也是一種「自適應式的」網頁設計，AWD跟RWD存在一樣的目的，都是為了要在桌機、平板、手機，不同裝置下都能顯示最佳畫面，RWD是隨著視窗大小縮小、放大，RWD「讀取同一個CSS」可以看上面的影片，但AWD不會隨著視窗「即時」放大放小，AWD會自己判斷裝置大小的程式，然後讀取「不同的CSS」，但可以達成一樣的效果。</p><p>RWD與AWD有什麼不一樣？</p><p>RWD(響應式網頁設計)在桌機、手機內容幾乎是完全一樣，AWD網站內容則可以一樣或不一樣，特別是可以針對手機的內容做細部簡化，減少不必要的圖文內容，提高手機網站效率。響應式網站(RWD)如果內容很多，RWD使用相同的CSS，使用圖文、效果會完整呈現在手機上，手機跑起來相對會慢一點。AWD使用不同的CSS，所以手機可以呈現不一樣的內容，手機因為有優化圖文，所以相對會快一些，但因為AWD需要製作多版本以後再整合，所以後續的資料管理比較麻煩，開發成本也會比較高。</p><p>RWD、AWD該怎麼選擇?</p><p>像MOMO、PCHOME、博客來就是內容超級多的網站，大部分都不會是RWD(響應式網頁設計)的網站，通常都是AWD設計的網站，甚至是傳統的兩個不同網址的網站，大型購物網站比較適合AWD，AWD可以針對手機版做更有效的配置與使用者體驗(UX)，企業網站、小型購物網站就比較適合RWD，像是Shopline就是RWD購物網站，RWD的網站好管理，內容不到爆量多的網站建議使用RWD。</p><p>用Google Search Console審查RWD</p><p>要怎麼檢視網站的目前資料是一致的呢？可以用Google Search Console(GSC)審查網址。Google於2020年9月正式以行動版作為搜尋收錄與排名的基準，我們必須製作手機版網站，RWD跟AWD都是手機版的網站設計，每個版本的網站資料必須一致，包含「網站內容」、「中繼資料(Meta Data)」、「結構化資料(Structured Data)」，在網站資料一致上，RWD(響應式網站)是最佳方法，GSC測試之後可以知道目前的響應式網站內容、中繼資料、結構化資料是否一樣，以Google排名規則來看，RWD優於AWD。</p>', 'articleImage3', 3),
(4, '<h1>職場》打工面試不馬虎！介紹衣服、考英文關關過</h1>', '<p>不少新鮮人在求學期間選擇打工，一方面是為了賺取額外收入，一方面也可及早累積社會經驗，不過即便並非正職工作，打工的面試過程，其實不如外界想像得這般簡單，有名網友就將應徵INDITEX集團的心得，分享在1111人力銀行「面試經驗暨工作甘苦談」，提供正在尋求兼職機會的在校生參考。</p><p>這位網友在大學一年級時，應徵了INDITEX集團的兼職工作，該集團旗下共有ZARA、PULL&BEAR、Bershka等知名品牌，相當特別的是，面試的時候並不會特別針對哪個品牌，而是等面試結束後，由公司統一分發。從投遞履歷到接獲錄取通知，中間僅有1次現場面試，當天流程可分為團體面試、個人面試2部分。</p><p>首先是團體面試，當天包含該網友，在場共有3位面試者。第1關是自我介紹，面試官會先離開房間，請3位面試者互相自我介紹，等面試官進來後，再請他們輪流介紹彼此。第2關則會抽2張牌，1張是模特兒的照片，1張是英文句子，前者須形容模特兒身上的衣服，並舉出1名經常穿著類似風格的公眾人物，後者則須先唸出那句英文，再說出它的中文意思。</p><p>團體面試的第3關，幾乎是每次面試的必考題，也就是對於公司的認識。在這關中，面試官會請面試者說出自己知道關於INDITEX集團的1件事，該網友認為這並不困難，只要事前爬文、做好功課，就會有很多事可以分享。至於最後1關，則是個人面試，同樣相當輕鬆，面試官僅提出2項問題「為什麼想應徵」、「有什麼問題想詢問」就結束了這次面試。</p><p>1111人力銀行發言人黃若薇表示，每逢寒暑假期間，許多學生都會尋求打工機會，面對兼職旺季，除了精進自身能力之外，還可透過「面試經驗暨工作甘苦談」，參考前人準備心得與經驗分享，進而快速掌握面試技巧，提高錄取率。</p>', 'articleImage4', 1),
(5, '<h1>大學生別打工？網友：不打工哪知道自己多雷！學生時期她靠這方法存了200萬！</h1>', '<p>大學時代究竟該不該打工？近日有位女大生在Dcard上提出對大學生打工的見解，引起不少討論，她認為如果經濟許可，大學時期要應好好把握最後的學生時光，或是培養第二專長等，不要為一點小錢失去回憶和青春，她以自身為例，因為沒錢所以大學四年都在打工，只能選錢很少的工作機會，因此必須身兼二職才能賺更多錢。 </p><p>度過四年身心俱疲的大學生活的悲苦心聲，馬上引起很多過來人共鳴，有網友說每次看到這種貼文，一定都是有打工的，但那些不愁吃喝、有閒錢的學生，有多少會去栽培原PO說的第二專長？而且出了社會雇主根本不在乎你的打工經驗、「為了錢打工不建議，為了經驗打工是可以考慮（不影響課業等）」、「可以寒暑假打工就好」但也多人抱持正向肯定的觀點認為，「就是不想一直跟父母拿錢才打工啊」、「打工是一種體驗，掙點錢學著獨立、做事、為人」、「一定要打一次工 才知道自己有多雷」、「不能一直花父母辛苦錢吧！」</p><p>原PO解釋她為何要這麼努力打工攢錢？因為她沒有人能依靠、很害怕。她爸爸愛賭、媽媽漠視，讓她很不能理解這些不負責任的父母。根據金融聯合徵信中心的統計，截至今年4月，全台有84 萬人揹負學生貸款，學貸總金額超過1,760億，平均每個背負學貸的人要償還20.9萬元，還沒畢業就先背債，龐大壓力讓學生族群不得不趁著暑假空檔加把勁打工，賺取平日的零用金與學費，減輕就學期間的經濟壓力。</p><p>根據調查顯示，打工的學生平均每個月要工作90.7個小時，一個月可以賺進13,798元，換算下來平均時薪152元，和基本工資相差不大，可以看出大多數的兼差打工職缺因為專業門檻低，薪資自然不具備競爭力。雖然平均時薪不算高，但卻有超過4成8的學生認為半工半讀可以帶來正面影響，只有1成2的學生認為半工半讀有負面影響，而打工主要的幫助包括學到學校沒教的事(47.4%)、學到待人處事(47.0%)、減少家庭經濟負擔(44.9%)與減少生活壓力(27.9%)，8 成 6 的打工學生預估可以存錢，平均一個月可以存下 7,014 元。 </p>\r\n<p>究竟學生時期該不該打工其實見仁見智，但建議學生打工還是要留意職場陷阱 及是否會遇到黑心雇主。19歲的小紅，從高中畢業就開始打工兼職，除了打工學習職場經驗，身上也背負學貸壓力。 </p><p>目前是大一學生，同時為商場銷售人員，因為就讀影音科系，書籍、材料、各種器材設備都需要費用，是一個相較燒錢的科系，才念一年就已經有12萬的學貸要負擔，加上生活費，必須督促自己提前有工作收入及提升工作經驗。 </p><p>談起打工經驗她也曾遇到黑心雇主，記得當初應徵兼職打工，本來面試談妥是時薪制，每月工作時數約185小時，算一算每月採時薪制應該會27K左右的薪水，但到了發薪日，卻發現公司以正職最低薪台幣23,100元計算，小紅向主管反應，卻收到敷衍回應，叫她不要理會好好工作，薪資部分公司會計算，公司少的4650元，小紅自認工讀身份也不好說什麼，於是只好自認倒楣。</p><p>1111 人力銀行公共事務部暨職涯發展中心總經理李大華建議，學生兼職打工在報到之前要先確認是雇主否有依法投保勞健保，同時談定薪資，因為打工兼職會配合淡旺日排班，打工的學生也要詳實記錄工時，避免請領薪水時發現薪資短少卻提不出證據，求償無門，為了避免落入非法集團的陷阱，在發現企業有違法行為時切記保護自己，同時保存證據主動向主管機關檢舉，避免更多人受害。 </p><p>但也有大學時期就靠著投資理財，輕鬆賺到人生第一桶金的人。有「時間管理達人」之稱的陳怡彣，早在大學時期，同時兼職做了好幾份工作及當家教，存到她人生的第一個100萬，有了第一桶金的成功經驗，讓她有了動力及自信，就讀研究所時又設下存第二桶金的目標，只用了一年的時間，就存到第二個100萬。 </p>\r\n<p>談到陳怡彣的投資理財史，起源於在她15、16歲時，因父母面臨離異，她心想，若自己有存款，即使父母離異，她也能一肩扛起照料弟妹的責任。因此在高中時期，雖然每月只有3,000元零用錢，陳怡彣逼自己至少每月要存1,000元，然而扣除交通費與白天餐費後所剩不多，最後她只能採取「晚餐吃白飯配胡椒鹽」的省錢方式；10個月後，她存到人生中第一個1萬元，也激勵她往存錢的道路上前進。 </p><p>上大學後她設定考取台大研究所與存到100萬元，她開始做財務規劃目標，只要有打工機會都不拒絕，打工及上課她做好完善的時間管理，期間她持續存錢計畫。她試算，以工作時薪75元，若想要存到100萬元，每天平均要工作9小時，這對還是學生的她來說根本不可能，於是她先將打工的收入全都存入帳戶，每個月固定只領5,000元生活費。</p><p>有目標還不夠，還要有實際的執行計劃，她將100萬元細分成4年，並設定一、二年級時每個月至少存1萬元，三、四年級則提高到每個月存3萬元，如此一來，4年後擁有100萬夢想就能實現了。</p><p>如願錄取台大研究所後，由於大學累積的家教工作經驗與能力，讓陳怡彣身價幾乎是以2倍提升，於是她再次設定2年存下100萬元的目標，並且靠著自律與毅力，再度順利達標。 </p><p>回顧大學與研究所的6年時間，陳怡彣將生活計劃區分為3大塊：學校、家教、工讀，將近2千多個日子裡幾乎不曾請假缺席。而她成功存錢的關鍵，在於清楚設定目標，擬定可行計劃，並且有紀律的執行。</p><p>對於想存錢卻沒理財經驗，陳怡彣建議，要先分辨生活中哪些是真的需要，哪些只是慾望，才能規劃存錢目標與支出預算，當時她先存了35萬～40萬元的緊急預備金，多餘的金錢才用來投資。 </p><p>李大華建議，除了賺取生活費之外，打工兼職可以幫助學生累積進入社會的經驗值，與其專注於薪資，更應該重視的是經驗的累積，選擇與興趣相關聯，或多元學習為長久之後的職涯鋪路，工讀經驗看似短暫，卻是未來進入社會的墊腳石，展現積極學習的態度，無論在人脈、技術能力上都能得到豐富的收獲。</p>', 'articleImage5', 2),
(6, '<h1>我的興趣成就我的專長</h1>', '<p>我是吳鎮添Timmy，來自香港，曾在新加坡、日本、台灣三地旅居，目前就讀都市計畫與空間資訊學系碩士班一年級。過去的工作經歷，讓我感受到土地規劃與空間資訊應用的重要性，所以在選擇進修時希望涉獵相關領域，不斷地搜尋適合自己學習的管道，最終找到逢甲大學都市計畫與空間資訊學系。我在2017年報讀逢甲大學都市計畫與空間資訊學系，並於同年9月加入成為逢甲大學的一員。</p><p>大學四年的學習生涯中，我學會多種專業與跨領域技能，除了基本的都市土地規劃與地理資訊系統應用外，還有三維模型建置、空拍機實務應用、程式語言等。同時積極融入台灣生活，回饋學校與社會，參與校內招生服務隊、外語中心工讀等，並每年開辦鑽研空間資訊應用自主學習課程，輔導學弟妹學習最新的知識，加強應用實作能力。</p><p>假期停課不停學</p><p>回顧四年的大學生活，大一上學期初是適應期，修習都市計畫的專業課程，漸漸對學系有更深入的了解；寒假期間跟著人文社會學院-庶民文化研究中心陳介英老師深入南投魚池，走訪咖啡農的辛酸與甘苦。</p><p>寒假除了走訪南投外，更參加中鼎教育基金會所舉辦的「2018探索台灣120h」，同年暑假參與都資系的「日本金澤、京都和大阪的移地教學」，這兩個活動讓我對永續發展及都市計畫有更深入的了解。</p><p>從日本回來後，我和幾位同學加入都資系與資工系共同開設的PBL課程開發，各有不同領域(三維模型、程式設計與空間資訊)專長我們，以結合虛擬實景與物聯網技術為目標，打造以「校內導覽」為主題的互動式體驗，並在108年的科技與創意研討會發表成果，榮獲第一名。</p><p>受到都資系日本移地教學與中鼎教育基金會活動啟發，參加校內PBL課程，獲108年科技與創意研討會，發表成果第一名</p><p>製作課程教材，榮獲師長肯定</p><p>同年，進行坐標校正、適宜性分析、繪製都市計畫圖、製作三維城市模型及動畫等領域的研究；自行搜集網路資料的過程不易，遇到困難點就向系上師長和學長姊請教，成功改進相關軟體的傳統操作流程，並製作成教材，在師長鼓勵下，帶領同學一同完成專題實作。</p><p>從一竅不通到熟練應用，進而研發出便捷的進階技巧，鑽研、攻克新的知識點，使我得到很大的成就感；和全體同學們共同完成一學年的課程，並且在結束當下得到老師肯定，更是莫大的鼓舞。</p><p>學以致用，屢獲殊榮</p><p>除了基礎課業以外，每年也都會積極參與不同的研討會和比賽。從研討會中了解學術領域流行的研究方向、業界關心的議題及最新的技術發展；透過參加各種競賽發揮所學，在逢甲大學四年學習當中，先後獲得「第五屆全國大專院校暨高中職StoryMap校園競賽 - 大專組第三名」、「中華空間資訊學會109年學生實務專題競賽-優等獎」、「第六屆全國大專院校暨高中職StoryMap校園競賽 - 大專組第五名」、「2020國土測繪圖資GIS專題應用競賽-佳作」等獎項。參賽主題從最初的「臺中市中區城市導覽故事」、「青銀共居選址適宜性分析」，到進階的「雲林高鐵站造成環境變遷」及「臺中捷運合理性評估」，在老師的指導下在比賽中獲得優異成績，活學活用。</p><p>產學雙長，具有豐富工作經驗的職場新鮮人</p><p>在學習跨領域的同時，掌握嶄新的專業知識點，點燃我對新事物的學習熱忱。在大二短短一年間內，學習並熟練掌握土地使用計畫、交通計畫、環境分析、空間資訊等專業技能。大二下學期開始與班上同學共同承接校外的工作專案，為西堤工程顧問有限公司辦理中科台中園區生態社區認證（EEWH-EC）推動計畫的實地現況調查與繪圖工作。</p><p>就讀大三時，加入都資系徐逸祥副教授的研究團隊，學習衛星影像處理及影像辨識等技術，透過航遙測的各種方法找出不同的參數，進行大面積農作物分類等相關應用。</p><p>同年暑假，我進入長豐工程顧問有限公司擔任實習生，協助辦理都市計畫通盤檢討及國土計畫鄉村規劃等專案。實際經歷工作生涯，擁有實戰經驗後，了解自己仍需再精進學習的部分，充分利用大四最後一年時間，補足還不擅長的專業領域，繼續累積知識與技術。</p><p>來自香港的我，雖然人生地不熟，但有幸得到師長們、學伴和各位學長姊的照顧，在大學生活的四年裡，走遍臺灣各地、曾經跨過山和大海，參加了各種不同的活動、比賽，譜寫了繽紛精采的大學詩篇。逢甲大學的學習讓我把興趣變成專業，相信你也可以在這裡找到與你趣味相投的機會，利用逢甲大學豐富的產學資源，為自己的大學生涯譜出一片新天地。</p>', 'articleImage6', 5),
(7, '<h1>【打工度假】美國打工後，我在路上慢慢找回被遺忘的勇氣</h1>', '<p>大三升大四的那年夏天，我人生中第一次一個人旅行，就是去中國北京，主要是去參加一個青年創業競賽的營隊。</p><p>結束後我決定一個人在當地停留幾天，從來沒想過這趟旅程會改變我如此多，只是對於當時的我來說，害怕和恐懼更勝一切。直到在青旅遇到一個來自大連、才 17 歲的女孩，她自信地和陌生的我攀談。她告訴我，她一個人來北京旅行一個月，只為了看她最喜歡的舞台劇。筆記本一攤開，行事曆上記滿時間、地點，那都是她安排的舞台劇行程，遇到沒有舞台劇欣賞的那天，她就會自己去散散步。我問她，「不用去上學嗎？」。「世界還這麼大，趁著年輕多出去看看嘛！難道咱們還怕沒東西好學習的嗎？」她豪氣地回答，當時實在被她的霸氣震懾住了，才 17 歲的她這樣對 21 歲的我說。要問我是甚麼時候下定決心要出國去看看的，就是這個時刻了！</p><p>打工度假的第 16 個選擇──美國</p><p>去美國打工度假，是一個很特別的選擇，全世界總共有 15 個國家開放讓台灣人申請打工度假（Working Holiday）簽證，美國卻不在這 15 個國家之中。美國是以「身份」作為分水嶺，而不是「年齡」，只要你還是學生，想要每年暑假去都可以申請。相對地如果你沒有升學打算，那麼畢業的那年，就會是最後一次機會。不同於其他 15 國，是拿了工作簽之後再到當地找工作，美國是先確定你拿到工作 offer 後，他才會發 J1 簽證給你，但在台灣實在很難在沒有美國親友幫助個情況下，就找到美國的工作，所以這個部分通常都會找代辦公司代勞，美國打工的代辦簽證費，也是所有國家裡最貴的，雖然省去了風險高又麻煩的部分，但通常出發之前，也已經花費了在台灣打工好幾個月的薪水。身為學生的我們，也許口袋不是很深，但有一顆勇於挑戰未知、勇氣十足的心。以後多的是機會賺錢，但年輕時的異國生活經驗，再多錢也換不來。</p><p>爭取你想要的生活</p><p>我找到了一份在飯店打掃的工作，飯店坐落在美國中北部威斯康辛州（Wisconsin）一個叫 德爾斯（Dells）的小鎮上，還是在 down town 最熱鬧的大街上。本來對打工度假抱有的美好幻想，在工作開始後就破滅殆盡了。不但時薪低（一小時8塊美金）、房租高（一周 100 塊），還被安排住在地下室。工作內容是打掃房間和維護飯店環境，又累又無趣，無時無刻我都在懊悔為什麼要來這裡。</p><p>不過，會來美國打工度假的傢伙都不是「省油的燈」，我和朋友抵達的第二天晚上，就和同房來自四川的室友們商討怎麼要求改善工作待遇。隔天我們立刻找了負責管理飯店的經理 Mark來談條件，說明我們覺得時薪太低、房租太高，希望他能有所調整。最後 Mark 也答應了我們的條件，房租改為一周 70 塊、時薪調漲為一小時 9 塊，本來會是一個仙杜瑞拉的劇情，被我們扭轉成勵志的故事。不過出國闖蕩，就是應該拿出勇氣學會和不同的人溝通、為自己爭取，不是嗎？</p><p>Dells 的奇幻旅程教我的，你是在生活還是「過日子」？</p><p>起初真的覺得這一切很糟，花了很多錢來到異國工作，也存不到甚麼錢，工作內容以打掃為主，似乎也沒學到甚麼。但生活是自己定義出來的，在習慣工作強度後，我們開始會安排休假日的旅行或是下班後的活動，下班一起買東西煮晚餐、看電影，或去打打保齡球、迷你高爾夫，偶爾去酒吧喝一杯，放假去州立公園散步，或是去樂園玩；某次還跟 Mark 請一天假，和室友租車出去玩，甚至還一時興起，決定當天來回遠在 5 小時車程遠的芝加哥，只因為想看大名鼎鼎的雲門（Cloud Gate）一眼。</p><p>Dells 小鎮裡的房子，樓高都不會超過三層，在這樣鄉下的地區待了兩個多月，再來到五光十色的大城市，真的有種「劉姥姥進大觀園」的感覺。在這裡的生活因著這些日常小事，開始變得有趣多彩了起來。「過日子」和「生活」，聽起來像兩件差不多的事，其實在意義上卻是有一段的落差，在美國生活的這段時間，帶給我的最大收穫就是，學會享受生活，而不只是過日子。</p><p>Dells 的奇幻旅程於我而言，就像是荻野千尋不小心闖進了湯婆婆的湯屋一樣，遇到的每個人都像是白龍琥珀川那樣注定好的。</p><p>離開 Dells 的幾天前，經理的太太 Rachel 在車上問我，在美國的這段日子我有沒有什麼改變？我說 ，這裡的生活於我而言，就是一段特別的經驗，其實並沒有特別改變什麼。而事實上異國生活，只是不同文化、不同生活方式經驗生命的過程，一樣去愛和被愛，一樣去學習、去交換，一樣必須道別，僅此而已。</p><p>不要期望經歷了這段日子後，你會改變甚麼。萬一，你其實已經是最好的樣子了呢？</p><p>在旅途中找回被日常遺忘的自己</p><p>工作結束後，我展開了為期一個月的旅行，在芝加哥 96 樓的酒吧，看盡絕美夜景；在阿拉斯加追逐極光，還在等極光的山丘上，與蘇格蘭獵人邂逅；走過波士頓的自由之路，像是能讀懂美國獨立過程中的所有辛酸；在紐約，登上自由女神的王冠，走上布魯克林大橋，參觀遍各大博物館，也看了百老匯的音樂劇，走在中央公園和時代廣場，就好像走進了電影場景之中。</p><p>然而，最讓我覺得舒心的時刻，反而是那些漫無目的地在街頭上的散步。總覺得那才是最接近城市原始面貌的時候。這次一個月時間，隨我自由自在安排、隨心所欲的亂晃，以前總是覺得出門旅行，一定要看些厲害的觀光景點。但是在經歷這樣沒有目的性、完全從心的旅行後，才體悟到在哪裡打卡都不是重點，心情和心態才是，旅行的意義不在於你去了哪裡、經歷了什麼、走了多遠，而是在於往自己的心走近了多少。</p></p>人是一種很奇妙的動物，越長大、獲得的東西越多，似乎越容易偏離自己的本質，忘記自己從何而來、想要什麼、自己究竟是誰。透過這樣的出走，竟在這些陌生的風景中，透過不停的自我相處、對談，一點一點地發現全新的自己，就在旅途中慢慢地被尋找回來，在這樣的過程中，可以感受到自己慢慢與最初的靈魂貼合，找回初心，並且重新聽見心裡的聲音，是一段沉浸式的奇幻旅程。</p><p>旅程結束後，最終還是會回歸日常，但這些經歷會轉換成精神，存在於生活中的每個思考、心情、價值與視角裡，接受生活的原始面貌，並懂得全然享受，就是這段旅程教會我最重要的事。</p>', 'articleImage7', 4),
(8, '<h1>曾受排擠、當過黑工，「一切不舒適的經驗造就今日的我」──專訪 FunNow 資深國際市場開發經理 Charlene Kuo<h1>', '<p>在 Jumpstart Global 的其中一堂課，講師問了她一個問題：「Charlene，你覺得自己的成就動機是什麼？」想了許久後， Charlene 突然發現，原來現在做的工作，已經是自己十分習慣與擅長的事，但成就感只有簽單回來後的短暫喜悅。經過不斷地摸索和反省，Charlene 才了解到原來自身的成就動機在於「開拓」與「實踐」。</p><p>從小喜歡跳舞的 Charlene，高中時參加熱舞社，到澳洲念書時也加入 Hip Hop Society ，認識來自各國的舞者。因為對舞蹈的熱愛，她還曾遠赴韓國申請擔任演藝圈的「練習生」，每天進行長達 15 小時的訓練跟語言學習。不過她最後還是放下了演藝夢，回到澳洲完成學業。</p><p>在澳洲雪梨大學的最後一年，Charlene 申請了澳洲與泰國兩國聯合招募的學生義工團 ATYAP，加入從全澳洲選拔的 32 名大學生，前往泰國東北部進行英語教學。當時 Charlene 是整團中唯一非澳洲籍的學生，這也成為她大學生涯中頗為自豪的經歷。</p><p>單看上面兩段敘述，部分讀者可能會認為 Charlene 是個家庭資源豐富、一路支持她追求夢想的幸運兒。事實上卻不然：從小就十分獨立自主的她，自學生時代起就懂得為自己決定、為自己負責。</p><p>隻身赴澳留學遭排擠，自籌學費「打過黑工」</p><p>不同於許多海外的大學部留學生，都是從高中畢業後「無縫接軌」。Charlene 是在台灣的大學升大二時，才毅然決定準備留學考試前往澳洲。</p><p>20 歲那年，Charlene 成功拿到澳洲雪梨大學的入學證明，拖著一個 30 公斤重的行李箱，隻身從北半球飛向南半球──9 個小時之後降落在 Kingsford Smith Airport，於海關提領了進入當時想像中「世界大熔爐」的門票。</p><p>原本期待能夠就此展開嶄新的人生，等待她的卻是一場場難以想像的挑戰</p><p>例如，有次 Charlene 選修到一堂國際政經相關的課程，全班只有她是亞裔──不同於研究所較多外籍生，當時雪梨大學部的課程大多是本地人。那堂課需要三人一組分組，分組過程中初來乍到的 Charlene 卻落單了──原本她想班上的人數剛好能 3 人整除，應該不管怎麼樣都有組別；想不到最後兩個白人學生竟直接對老師說，她們兩人一組就好，排斥 Charlene 的加入。那天是 Charlene 第一次感受到因自己身為「外來者」遭受的差別待遇，回到宿舍不禁難過的落下眼淚。</p><p>在澳洲，國際學生的學費甚至部分生活費，要繳的錢是當地人的好幾倍：一堂課的學費是澳洲學生的 4 倍，連搭公車也要多繳一倍的車錢。Charlene 因此很早就開始在中國城的麵店「打黑工」，還記得那時候工資一小時澳幣 10 元，遠遠低於一般正常工資。</p><p>後來經由朋友介紹，她跑去雪梨市政府車站地下街的馬卡龍店，每天製作和銷售上百個馬卡龍。工作同樣非常勞累，但薪水總算比較合理。</p><p>此外，由於市政府車站附近是澳洲各大企業的聚集地，因此接待的客人也從之前的幾乎「全華人」，轉變成大多都講英文的顧客。漸漸地她也習慣不只是在學校說英文，在日常生活跟所有人的應對上，都很自然地說起英文。</p><p>大學畢業之後，Charlene 沒有馬上回台灣，而是選擇留在澳洲當地找工作，又待了 3 年。擔任過婚禮策劃師，隨後進入一間行銷企劃公司擔任 project manager，經手各個品牌的活動和企劃專案，慢慢擴大自己在海外的人脈圈以及生活圈。</p><p>回台從事高薪工作，卻決定再次跨出舒適圈</p><p>回到台灣後，Charlene 憑藉著在澳洲時累積的經驗和跨文化溝通能力，應徵上位於 Taipei 101 大樓的新加坡商廣告行銷公司，領著十分優渥的薪水，每週跟不同國家的人線上開會，過程中也累積了許多經驗。</p><p>在台灣找到了一個令人稱羨的「舒適圈」，她卻不以此為滿足，再次踏上向外探索的道路──有次在因緣際會下，Charlene 加入了 Jumpstart Global ， 一個以「爲企業培育具備創新創業精神的領袖」為願景的非營利組織。在半年的學習過程中，她遇見同世代各個產業優秀的人才，也培養許多關鍵競爭能力。但更重要的是，她因此重新尋回自己的「初衷」：</p><p>有一天，其中一堂課的講師問了她一個問題：「Charlene，你覺得自己的成就動機是什麼？」想了許久後， Charlene 突然發現，原來現在做的工作，已經是自己十分習慣與擅長的事，但成就感除了簽單回來後的短暫喜悅，好像就沒有其他的來源。</p><p>經過不斷地摸索和反省，Charlene 才了解到原來自身的成就動機在於「開拓」與「實踐」。</p><p>再次踏上旅途，拓點馬來西亞</p><p>於是，Charlene 再次跨出舒適圈，加入了新創公司 FunNow，並自願前往馬來西亞拓點。在馬來西亞，要學會如何在馬來人、華人和印度人之間做生意，要尊重不同宗教之間的差異，並適應其延伸出來的各種規範──從最基本的宣傳 party 活動海報上不能放酒，選餐廳的區別上要注意有沒有 Halal （清真認證），到每年的齋戒月，對馬來同事的生活作息影響⋯⋯等等。</p><p>不論在工作或生活上，一切都不像之前在澳洲時如此無拘無束，也成為她初到馬來西亞開拓市場時最不適應的地方。在澳洲時固然辛苦，但其宗教規範和種族意識並沒有像馬來西亞如此深入生活之中。這樣的挑戰，在原本就已十分艱難的拓點任務上，又加上了必須先克服的關卡。</p><p>外國生活民情不同，也曾讓她鬧出不少笑話，一次 Charlene 問同事：「誰要一起去唱 KTV？」結果竟然讓大家都被嚇著了，問道：「你真的要去 KTV ？你是指卡拉ok（Karaoke）吧？」Charlene 當時心想，「卡拉ok」不是那種伯伯阿姨才會去的、類似「那卡西」那樣的娛樂場所嗎？結果發現原來在馬來西亞，跟台灣是「相反」的──馬來西亞人口中的「KTV」，指的是類似酒店有人作陪的地方，年輕人都去卡拉 ok ！</p><p>在難題之中，不斷鞭策自己進步</p><p>在看似光鮮亮麗的跨國工作背後，長期伴隨著 Charlene 的是孤獨感、自我懷疑，和無止盡的焦慮。當然，也帶來不斷撞牆後的成長與蛻變。</p><p>Charlene 深信：「熱情可以幫助你起步，但只有使命感才會讓你繼續前進。」並且以此一步一步地突破難關。</p><p>Charlene 認為：「了解自己擅長什麼很重要，要知道在拼搏的路上，自己要拿什麼贏別人？」工作崗位百百種，產業也百百種，要找出那個自己最擅長的武器，先利用這個武器為自己打開第一道門。</p><p>舉例來說，她認為自己最擅長的領域是商務開發（BD）。這需要面對很多不同面向的挑戰，除了 BD，還要了解行銷、了解夥伴關係、了解財務。公司在組織 launcher 團隊時，也會盡量在團隊內安排不同面向有專精的團員。但如果她沒有 highlight 出自己 BD 的強項，而是表現出什麼都會一點的樣子，或許就沒有這個機會加入團隊。</p><p>但開了門之後，更重要的是「不斷鞭策自己更進步」：Charlene 相信很多人都會有跟自己當初一樣的不安，也會有不敢做出決定的時候，但如果你現在正處在一個瓶頸，或是不清楚自己要往哪裡走，記得提醒自己：「當你做了一個決定，背後需要有所付出或犧牲，請相信那是公平且必須的──這個決定沒有對或錯，它只是一個很難的決定而已。」</p><p>「等到走了一段困難的路後再回頭看，會發現你已不是原來的自己──你會有新的難題，也會有不斷進化的自己。」</p>', 'articleImage8', 3),
(9, '<h1>【人物專訪——耿上翎】</h1>', '<p>遠遠看到上翎，她背著白色的，會被歸為文青風的質感帆布包，捲著一頭黑色的浪漫長髮。她擁有剛剛好的可愛身高，走路的時候身體會像貓兒一樣輕輕躍過，猶如她最愛的米克斯，「米克斯的環境適應力很強，又看起來很可愛。」她笑著說。</p><p>野花咖啡廳</p><p>初看到一個外表這麼柔軟、溫和的女生，你會訝異她竟然有如此獨立堅強的內心。休學期間，她隻身一人去了花蓮，和朋友開了一間咖啡廳，並命名為「野花」，舉凡沖咖啡、店內雜務、與客人交談等，所有事物她都一手包辦。但上翎不是為了開咖啡廳而休學，「我覺得那樣滿危險的。」她承認，在臺北開咖啡廳的資本額很高，除非自己真的有能力負擔，不然其實很難。談起當初休學的原因，她很大方的說：「那時候因為經濟考量，沒辦法負擔自己的學費和房租，也沒有在學校找到自己想要的，心情不是很開心，所以就想說乾脆休學去工作。」大學以來就幾乎經濟獨立的她，毅然決然決定離開學校，休學兩年。</p><p>休學初期，上翎先接了家教、攝影工作，還在法式甜點店當過主廚助手。後來因緣際會下，在花蓮的朋友有了開咖啡廳的念頭，她就把之前戶頭裡存的幾萬塊領出來。「東西弄一弄，而且花蓮房租也便宜，就決定住下，在那裡開了咖啡廳。」她說的輕鬆，但其實這是一個多麽大膽又冒險的決定，她卻很勇敢的做了。</p><p>溝通與對話</p><p>上翎平時相當關注公共事務，女性主義、性別平權都是她關注的議題。「花蓮環境很好，可是當地人比較保守，所以我希望可以開啟群眾對話，了解他們的想法。」所以她決定在咖啡廳裡辦講座，請了網路人氣粉專「哲學哲學雞蛋糕」的老闆朱家安、國文老師，同時也是今年平權公投的發起人陳茻、音樂人克里夫，還有提倡公平貿易的點亮咖啡。「我之前在臺北的咖啡廳也聽了很多講座，覺得受益良多，所以希望帶給花蓮的人們一樣的東西。」她的眼睛澄澈透明，閃閃發亮的說。</p>\r\n\r\n<p>至於當初如何跟家人溝通休學的選擇，上翎自認很幸運。「從小以來，他們一直都很尊重我。也因為我經濟獨立，所以他們也都不會說什麼。他們也覺得，時代改變很快，以前的情況和未來會差很多，所以沒有規定我生活一定要怎麼樣才會比較不辛苦，很鼓勵我去嘗試。」</p><p>改變與成長</p><p>休學的經歷帶給了上翎很多改變。自己開店之後，接觸人群讓她變得更加開朗。「那時候我遇到的客人很多都還是我現在的朋友，他們現在也都在做一些性別運動，甚至比我現在能做到的事情還多。」她說。</p><p> 但也因為休學，讓上翎意識到她有多喜歡學校。過去大一的時候，她都只去上第一個星期的課，但現在她再也不缺課，而且都坐在第一排聽講。休學那時候開店很忙，忙得她沒有時間讀書，重返學校後，遇到一些喜歡的教授，還會告訴她可以再往哪個領域發現新的東西。「我覺得這個東西就是平常在社會上有點難得到的，在社會上，很難剛好和有很多豐富知識的人當到朋友，可是在學校，教授就是有義務要教你東西，所以我還滿喜歡學校的。」在學校，可能不交作業、偶爾翹個課，都沒有太大的影響，但是上班不一樣，排好哪個時間要上班就一定得去，沒有隨心所欲放假的權利。休學讓她感受到，有一層學生的身份可以保護自己其實很幸福，因為這個社會對學生永遠都有一份寬容。</p><p>有始有終</p><p>採訪到最後，上翎聊起她現在的生活。「雖然我現在很忙，在上學也在工作，但是每天早上都會堅持為自己沖一杯咖啡，就是我覺得總要有一點時間，留給自己喜歡的事情，那天才會靜下來，才可以再很忙碌的開始。如果一直很忙，就會瘋掉，不知道自己在幹嘛，對這世界就不會那麼溫柔了。」她語氣堅定的說。這也許就像上翎所喜歡的女性主義和攝影，她一直認真對待這些自己喜歡的事物，溫柔又堅持的做出了成績。</p><p>談話過程中，我感覺到一些矛盾和不突兀的融合不斷在她身上出現。她是一位容易親近的鄰家女孩，卻又同時展現高貴的優雅；是有力量的、勇敢的女性，卻又沒有高昂的氣焰；她身上有那麼多足以展現的才華，又帶給人樸實、純真的感覺；可以一起談學術性的知識，卻又可以在裡頭加上可愛的幽默感。這就是耿上翎，這樣的一個女孩。</p><p>她告訴、也教會我們，不管怎樣的生活，都要為自己負責，走到盡頭，有始有終。</p>', 'articleImage9', 1),
(10, '<h1>超越鍵盤記者，鄉民女神主播的誕生</h1>', '<p>PTT文化興盛，成為許多學生及年輕族群殺時間的休閒活動，各式各樣新奇的事件更成為茶餘飯後的發燒話題。</p><p>若您也是ptt鄉民的一份子，您或許不會不認識這個帳號:email5566，她是目前就讀台大新聞所，也同時在三立新聞台擔任主播的楊伊湄。</p><p>南部的bbs文化興盛，來自高雄的楊伊湄自國中畢業就開始成為PTT的愛好者，至今已使用了十一年。</p><p>「沒有ptt就沒有現在的我。」楊伊湄認為PTT是一個汲取知識非常方便、快速的管道。大學時期即開始尋找打工機會，從Promote Girl一路到廣為人知的展場主持人，依靠的都是PTT豐富的資訊，甚至也因為這些打工經歷誤打誤撞進入演藝圈。</p><p>然而進入演藝圈不到一百天，便深覺這樣的環境不適合自己的個性，毅然決然開始了準備研究所的路。在閉關準備研究所的期間，PTT仍然是楊依湄獲取應試資源的重要來源。最後成功同時錄取五間名校傳播系所，並選擇進入台大新聞所就讀。而她同時也接到三立新聞台工作通知，開啟了新聞媒體生涯。</p><p>成為新聞人之後，PTT與她的關聯更是密不可分了。有別於其他駐站記者總是徘徊於八卦版，楊伊湄任何版都不放過，軍事、醫藥、地方版、甚至是一些較為冷門的看版都是她發掘新聞的來源。「我是一個求知慾很旺盛的人，總是很怕有什麼消息被我遺漏了。」</p><p>熱情的她不僅僅是潛水瀏覽，也常常發文、回文與網友互動，她也笑著說：「我這個人的個性就是不吐不快。」</p><p>身為一位有名氣的公眾人物、亦是媒體人，讓楊依湄的身分比其他記者更為特別。也因為在演藝圈時期曾是受訪者，在採訪上她更能將心比心，以熱情關心、打動受訪者，先給連絡方式，並給受訪者不洩漏個資、不偏頗報導的拍胸脯保證，這些技巧與特質總是讓她搶下許多漂亮的獨家。</p><p>那麼電視新聞媒體這份工作帶給她最大的挑戰是什麼？楊依湄表示，這份工作每天最基本的工作時數長達十一小時，快速、高壓的環境常讓人喘不過氣，要在短時間內報導平衡、正確、客觀的新聞更是一大挑戰。「不能只是從網上抄新聞。即使時間短暫仍要細膩處理、冷靜判斷，不被網路上的一面之詞誤導」</p><p>她堅持這樣的原則，帶著微笑及最初的熱情完成每日的工作。即使是全職主播，又同時是全職研究生的她，更每天幾乎忙的不可開交，儘管如此，仍期許自己做到最好，繼續在新聞傳播業的道路上前進！</p>', 'articleImage10', 2),
(11, '<h1>第一次找實習務必要破除的3大迷思｜實習學長姐經驗談</h1>', '<p>第一次找實習的人，總是會有這幾種迷思……<br>實習就是要找有興趣的  => 你幻想中有興趣的工作實際上可能一樣<br>實習正要找知名企業  => 實習內容、工作方式是不是你想要的才是重點<br>實習就是要靠自己努力的找 => 妥善利用源，不要傻傻埋頭苦</p> <p>1. 實習就是要找有興趣的 </p><p>你有實際做過「你認為的」有興趣的工作或實習嗎？ 還是只是因為周遭朋友都做這類的實習、聽別人對於這個工作的描述、或是因為在學校學感覺這個很有趣，就認為這是我「有興趣的」呢？有些人工作的滿足感、動力來自「做自己喜歡做的事」，有些人來自「做自己擅長做的事」、有些人來自「做有意義的事」、有些人則來自「做可以得到很多錢的事」。如果你今天做著你有興趣但不擅長的事，而你不了解其實你的工作的動力來自完成目標的成就感時，當因能力不在此而無法持續達成目標，那股熱情可能很快就消失殆盡了。</p> <p> 2. 實習就是要找知名企業</p><p>不可否認，能進到知名企業實習，確實可以獲得一個閃亮的名聲。但是進比較沒沒無聞的小企業甚至是新創企業，就比較不能學到東西嗎？不一定喔！以新創企業來說，因為員工少、公司組織比較扁平，可能可以接觸到更多策略面的決策思維、甚至是直接參與正式的公司業務。反之，大公司組織規模比較大，你可能不會直接的接觸公司業務，比較是學習的角色，完成Mentor交辦的任務。重要的是…..實習內容 & 工作方式是不是你想要的！如果你的學經歷真的不比別人漂亮，整天做著白日夢想要進大公司，那就真的只能一直待業中了。 </p><p> 3. 實習就是要靠自己努力的找啊！</p><p>先回想一下，學校寄來的信，你是不是頭也不回的直接把他刪掉啊！其實學校不定時的也會丟出相關的資訊。大家身邊其實有很多資源可以利用，但往往都只是埋頭苦幹，努力的搜職缺、努力的修自己的履歷、努力的準備面試，用對方法事半功倍啊！ </p>', 'articleImage11', 5),
(12, '<h1>大學生，你為什麼實習？找實習前一定要問自己的三個問題</h1>\r\n\r\n', '<p>問題一、短期實習還是長期實習？</p><p>短期實習通常安排在寒、暑假，長期實習則多以一年為期。由於公司經常要求實習生一週內能有兩到三天進辦公室，若你自認開學後無法抽出足夠的時間，就可以考慮短期的寒暑期實習；又或者你想多方嘗試不同領域的工作，也可透過短期實習一探究竟。如果你審視自己的課表後，認為每週抽出兩、三天進辦公室不是件難事，就可以考慮長期實習。長期實習的好處在於，你能有足夠的時間摸索並持續增進工作表現，觀察職場生態，研究上司的思考模式。</p><p>問題二、大公司還是小公司？</p><p>在大公司裡，各部門之間有明確的分工、穩定的制度，你可以在所屬部門內接受專業的職務訓練，接觸到最新的產業趨勢，但在大公司內若想輪調部門、針對公司決策表達個人意見，可能比較困難。而小公司、剛起步的新創產業組織較為扁平，也沒有明確的制度規範，員工經常需要跨部門支援，工作時間較長；但小公司的自由程度相對較高，實習生的意見也可能直接傳達到決策者耳裡，實習生較有機會看見自己對公司的影響力。</p><p>問題三、可以申請與本科系不相關的實習嗎？</p><p>實習是進入職場前的試金石，若你對未來想應徵的職位有明確想法，可以直接找該職務的實習職缺，提早了解產業動態。如果你感興趣的產業與現在就讀的科系無關，更建議你及早申請實習，趁著公司對實習生的科系門檻要求較低，先累積實務經驗，對畢業後的求職多少有幫助。\r\n要注意的是，「有興趣」不代表你能適應這份工作，到相關領域實習，或許能戳破你的粉紅泡泡；認清現實，再另尋他路，未嘗不是件好事。</p><p>找到實習，別忘了調整心態</p><p>大部分學生都把「實習」當成「實作學習」，認為學校教的課程太過理論，實習能夠學到更多接軌職場的實務能力，這樣的想法固然沒錯。但筆者認為，你更應該試著為公司「創造價值」，思考自己可以怎麼運用學校所學來協助公司業務？你可能會覺得，「我只是一個小小的實習生，怎麼可能為公司帶來影響？」，其實，影響力不分大小，即便你做的是瑣碎、重複性高的工作，你也能想辦法提高效率、用更短的時間完成工作，並且做得更好；這不僅提升部門的效率，也創造出自己在職場上的價值，最後內化為自己的專長與人格特質。\r\n實習前若能端正心態，不要光想著「我是來學習的」，而是想辦法「幫助公司進步」，最後的成長都會回饋到自己身上。打工賺的薪水可能比實習還多，那實習的意義是？</p><p>1. 打破你的自以為是</p><p>查看人力銀行開出的職缺，徵才條件不外乎是細心、獨立作業、具抗壓性⋯⋯，乍聽之下好像不難；但當你進入職場，如果上司要你回覆客戶一封簡單的信件，你會注意稱謂及措辭口吻嗎？如果公司臨時交辦的業務，是你過去從未接觸的領域，你能夠在期限之內達成目標，並且符合公司的期待嗎？職場上所謂的「工作態度」說起來很簡單，做起來卻不容易，如果你不曾實際透過實習檢視自己的工作態度，未來在求職面試時，說得再口沫橫飛，都只是吹噓。</p><p>2.  發覺能力上的不足，及早補救</p><p>透過實習，你能提早發現職場與學校的差異，或許是學用落差，也可能是過去被你視為「沒有用」的理論課程，在職場上其實非常重要，卻被你當成廢課睡掉了。擁有學生身份，你還有機會在實習之後，回到學校加強自己的不足之處。</p><p>3. 跳脫學校同溫層，學習不同的思維模式</p><p>平時在學校所接觸到的人，大多年齡相仿，想法與思考方式也相近，但在實習中，你的主管、同事不僅來自不同背景，還有豐富的工作經驗，你會看見不一樣的思維模式及態度。多多觀察，與前輩們聊聊天，說不定會打破你以往的價值觀、開拓新視野。</p>', 'articleImage12', 4),
(13, '<h1>企業實習對大學生來說，是一種觀看社會與成長學習的方式</h1>', '<p>實習工作能為大學生帶來什麼？<br>如果你是大學生，那肯定在不斷思考，繁忙的課業之餘，或是投入社團玩樂的同時，到底要不要撥出時間投入實習工作，在討論這個問題之前，可以嘗試從「實習能為你帶來什麼？」來思考。</p><p>產業結構思考：建構產業的關係脈絡<br>產業的名詞在學生時期是個很模糊的觀念，甚至對各大產業的輪廓了解甚少，在實習工作中，就有機會因為客戶關係的多樣性，開始理解產業生態在整個社會扮演的關係，一份實習工作，可以讓你對未來想去的產業產生想像與想法，讓自己對於任何事情產生更多選擇的機會。</p><p>工作意義思考：釐清工作的社會關係<br>你如果是學生的身份，周遭大部分的事物，多半圍繞在相較單純的人文環境，不會有太多的責任和義務需要絕對的承擔，工讀的機會，也偏向勞動性與重複性較高的工作，在這樣的環境下，學生較難理解工作，在社會人士的生活中扮演什麼角色？一份實習工作，能讓學生逐漸透視社會上的種種，不管是關於「社交場合的寒暄」、「公司部門的組成」還是「工作流程的理解」，都是學生能透過實習，了解「到底什麼是工作？」的捷徑。</p><p>工作定位思考：想清楚自己的角色定位<br>不斷的嘗試與接受失敗是實習過程中，最需要學習的經驗，你有機會在一個崗位上，觀看整個組織的運作形式，也有辦法請教與詢問各部門的工作者問題，這時就能逐步探索自己的定位到底是什麼？</p><p>工作能力藍圖：出社會之前該具備的能力<br>當你了解部分的產業樣貌，細探過了什麼是適合自己的，什麼是自己還能做的，就可以錨定某項工作，開始發展屬於自己的職涯技能。做為學生的身份，時常無法將知識進行應用，甚至忽略可以實作的能力，透過實習工作，迅速掌握應用的技巧，建立自己的知識藍圖，逐步規劃自己下一步的學習節奏。</p><p>實習工作有哪一些種類？<br>實習工作其實非常多樣，可以從科系開始劃分，三類組的（醫學、護理等）、二類組的（理、工學院）、一類組的（文、法、商），每一個實習工作都有不同的性質與類型，護理師的實習與動態設計的實習，會有截然不同的申請方式與工作要務，不過縱觀上述的產業內容，大致可分為三類型的實習工作「商業行政類的」、「技術設計類的」與「技藝經驗類的」，以下分別進行說明。</p><p>商業行政管理類<br>這類的工作基本上，是相較多數人會從事的職業類別，工作內容可以從營運、行銷、財務、人資、業務等進行延伸，由於這類的工作在前期有許多瑣碎的事物需要處理，公司企業就可能雇用實習生來進行協助，不過也需要單看公司的用人策略，才能分析該公司對於實習工作的重視程度。</p><p>工程設計技術類<br>這類工作多半具備作品集的特性，可以從過往學習的知識來解決一項問題或創造一個作品，最直接的方式就是透過作品集呈現自己的能力，其中可以是一個影像、圖像、裝置或網頁等，藉由完整的作品，讓工作者了解工作特性。</p><p>工作技藝經驗類<br>操作型經驗類的工作，可以像是一個廚師、醫生、護士或是特定領域的工程師，任務內容以經驗導向為重，通常可以藉由自己處理過哪些困境的經驗，來證明自己的能力。</p><p>實習工作到底可以去哪裡找？<br>每一個企業通常都有偏好的職缺投放管道與策略，不管目前是 104 人力銀行、Cakeresume 還是 LinkedIn，了解各家公司的職缺投放管道，可以讓你更快掌握實習工作的申請。</p><p>104 人力銀行<br>台灣現況職缺資料庫最大、涵蓋產業別最廣的人力銀行。藉由 104 人力銀行申請實習職缺時，需要特別注意客製化經歷的部分，可以透過各式不同的連結備註，協助公司了解自己的過往經驗。</p><p>CakeResume<br>前瞻科技產業相較會注重的職缺推播管道，知名的軟體、硬體科技公司如 Amazon, NVIDIA, PicCollage 等都使用 CakeResume 招募新世代人才。CakeResume 為線上履歷平台有相較彈性的履歷模板，可以多元的呈現工作經歷。</p><p>LinkedIn<br>工作人士的社交平台，大部分的外商公司，蠻常藉由該平台招聘職缺，同時也可以藉由此項平台連結不同的商業關係，來讓不同的人認識你，創造更多被動的職涯機會。</p><p>沒有工作經驗該如何準備實習申請？<br>如果沒有任何工作經驗，該如何申請實習工作呢？這是一個「蛋生雞、雞生蛋」的問題，不是一個絕對的因果關係，需要思考的是超越問題本身的解方。「如果沒有工作經驗，我該如何準備呢？」這反而會是一個相較合適的思考點，在眾多實習工作當中所羅列的基本要求，該如何透過既有的資源學習，進而產生經驗讓自己有機會爭取下一個位置與機會，就譬如：資料分析需要會寫 code（e.g. Python），那就必須思考如何透過最小單位完成資料分析訓練？如果是行銷活動，則需要會文案、企劃、美編、廣告投放等技能，那又該如何具備？實習申請的過程，以整個流程來看，具體而言分為「計劃擬定」、「準備技能」和「統整經歷」等三項內容，在依據這些脈絡，就可以從一個沒經驗的菜鳥，成為一個有經驗的實習能手。</p>', 'articleImage13', 3),
(14, '<h1>實習履歷怎麼寫？３技巧、４步驟，秀出你的真實力</h1>', '<p>同樣都是履歷，實習履歷和求職履歷究竟有何不同？求職履歷的存在，是讓公司可以透過求職者的工作經歷，了解對方在職場上累積的實力與成就。而實習履歷對應的多半是在學生，這群人沒有正式工作經驗，無從比較相關成就，因此公司更看重的，往往是應徵者對於實習工作的熱情，以及希望有哪些收穫。換句話說，實習履歷的準備關鍵，首重如何展現你的「學習能力」和「態度」。</p><p>寫實習履歷前，先問自己這3個問題</p><p>每份實習都需投注大量的時間成本，因此，決定申請前，應該先問過自己以下3個關鍵問題，除了可以更清楚自己的申請動機，也能作為實習履歷的撰寫基礎。</p><p>Q1：我為何要申請這家公司？我跟這家公司（或這份實習）有何關聯性？</p><p>不少人申請實習工作是出於「興趣」。但切記，「興趣」可以作為申請動機，但卻無法證明你可以勝任這份實習職務。因此，最好附上歷年的社團經驗、求學歷程，來證明自己的潛力，以及對這份實習的熱情。例如，當你應徵的是「活動企畫」的實習工作，就可以附上曾任系學會活動部長的資歷，並簡述自己如何在舉辦各式活動中，發現自己熱愛這類型工作，以及曾寫下哪些好成績。接下來，你可以從個人經驗出發，進一步說明為何選擇這份職務。你可以說明看見企業哪些優勢、或是令你欣賞的地方，而這些特質要串聯你的個人優勢。例如，「我觀察到這家公司除了在綠電交易市場上表現亮眼外，團隊力求創新、開放的組織文化也令我嚮往」。「我曾經在學校課程中，研發出新型的作業系統，相信我的經驗能為公司效力。」</p><p>Q2：這份實習可以帶給我什麼收穫？</p><p>「學習」是實習最重要的目的，在實習履歷中，你應該凸顯個人的學習計畫，明確訂定實習結束預計達成的目標。例如：擁有可應用的網路行銷技巧、累積獨立提案能力、認識10個業界前輩等。擬定完整的實習計畫，有助於加深面試官對你的認識，也能確保你是「有備而來」，而非亂槍打鳥。此外，在擬定學習計畫的過程中，也有助於讓你檢視自己是否適合且真正需要這份實習工作。</p><p>Q3：透過實習，我能對公司貢獻什麼？</p><p>在撰寫實習履歷時，最好同時呈現學習計畫之於個人及公司的意義。像是規定自己認識10個業界前輩，等同幫公司拓展人脈；而精進個人的網路行銷技巧，則代表可以為公司爭取更大的曝光。完成上述3個問題後，即可開始著手寫下你的實習履歷。</p><p>依照4步驟，寫出吸睛履歷非難事</p><p>根據各大企業人資專家的建議，撰寫實習履歷，可以依循以下4個步驟。</p><p>Step 1：「有用的」經歷，勝過職稱和頭銜</p><p>放在實習履歷上的活動經歷，是否愈多愈好？事實上，用經歷或頭銜來塞滿實習履歷，是許多企業不樂見的情況。許多人對此可能感到詫異，但其實原因很簡單──跟實習內容無關的資料，缺少參考價值。舉例來說，你應徵資料工程師的實習職缺，實習履歷上寫的卻是「志工服務社社長」、「學生會活動部長」，恐怕會讓面試的主管一頭霧水。因為這些擔任「領導者」的經歷看似輝煌，但實際上跟實習內容毫無關聯。也就是說，公司無法藉此了解，你對資料科學的認識有多少、你會哪些程式語言等，要靠此加分就有限。所以，與其洋洋灑灑列出一串頭銜，不如改填參與過的資料科學競賽、程式語言課程等，更能說服主管。即使競賽並非第一名、課程成績不是最高分，只要表現不錯，也可以作為你對此領域具備熱情的佐證。</p><p>Step 2：過於久遠的資歷，參考價值低</p><p>有些人害怕實習履歷空蕩蕩，會選擇將國高中、甚至國小的經歷也寫上去。然而，在實習履歷上，強調過於久遠的資歷，恐怕會讓企業人資認為，近年缺乏更優秀的表現，因此，建議在撰寫實習履歷時，應該以大學時期的重要資歷為主。不過，若在高中就有特殊經驗（例如全國型的競賽成果等），可以補上。但若是國中以下的久遠回憶，就先別寫了。</p><p>Step 3：版面格式簡潔，避免過於花俏</p><p>實習履歷都要美美的，才能抓住人資的眼球嗎？適當的排版設計，確實能讓公司耳目一新。不過實習履歷仍應秉持「簡約」為原則，過多裝飾，反倒容易失焦。</p><p>排版時，應掌握「2要」及「2不」：<br>❶要分段、要沉穩：線條分割區塊、以穩重的藍黑色為主要色調。<br>❷不花俏、不混淆：履歷不是美術設計大賽，五顏六色，會讓人資不知道該看哪裡，因此，設計上勿過度花俏。<br>此外，花過多心思在美編，還不如充實內容。</p><p>Step 4：下對關鍵字，讓人記住你</p><p>撰寫實習履歷就好比記錄你現階段的人生摘要，比起長篇大論，濃縮又精華的破題，更能讓人眼睛為之一亮。而為自己的履歷下關鍵字，是破題的好方法。你可以用Hashtag（#）的概念，試著為自己下一些關鍵字，且盡量不要使用泛泛的詞彙，像積極、表現優異等，應該用更具體的詞彙來形容，像是「書卷獎」、「國際競賽第二名」等。下關鍵字不只能讓人一秒快速抓住重點，也可以讓你的實習履歷更聚焦。當企業需要特殊專長的人才，而你的能力恰好符合，將更容易出線。簡而言之，撰寫實習履歷的要領，在於展現「我有哪些潛力」。充分展現你的學習能力與態度，才有機會脫穎而出。</p>', 'articleImage14', 1),
(15, '<h1>【台灣微軟實習記】主修文學，卻跨入科技業！公司告訴我「錯中學」──我真的能犯錯嗎？</h1>', '<p>進入台灣微軟實習已經快 7 個月了，回想當初，每天埋首在宿舍自習室裡，不是在修改自己的履歷，就是安排線上自學，學習 Excel 各項函數以及樞紐分析。對一位主修文學的文組生來說，想進入微軟實習是和周圍同儕不太一樣的方向，我要如何確定自己的選擇是對的？要怎麼讓這段準備申請實習的日子不會白費？在半年後的今天，我有了初步的解答，明白跨出舒適圈是困難的，但最重要的是願意嘗試，也想透過這篇文章與讀者分享我的實習心得。</p><p>剛跨入科技業的小菜鳥</p><p>對於原本的我而言，最理想的工作狀態是能學以致用──如果對大學所學的專業有高度興趣，且剛好未來的工作領域和就讀科系有高度相關，那麼便可將書本上的知識應用在職涯。當時的我認為校園是個舒適圈，因此跨校參加了外校社團、舉辦國際學術論壇，認為自己在大學生涯已經很努力地探索自我，心想：這樣應該就夠了吧？然而，人生根本沒有這麼多「剛好」，我在找實習的過程中發現，除非堅持只專注在自己既有領域打轉，抑或在所學的專業中足夠頂尖、優秀，否則「多樣化學習」已是必然趨勢，很難除了本科專業以外，什麼都不碰。</p><p>除了所屬部門，也可自由選擇專案</p><p>在微軟實習，我被分配到的部門是採購部門，另外也被安排支援客戶諮詢部門，這兩個部門的工作以文書處理為主，因此在大量使用 Microsoft 365 的應用程式之後，我的文書技巧確實有所成長。\r\n然而微軟實習更特別的地方在於，除了部門的工作，實習生可以自由選擇參加其他專案。我選擇參加了 Social Media Team 負責的「臉書專案」，因此有機會學習電商平台宣傳、文案撰寫、文案製圖；並透過參與推廣實習計畫的「校園分享會」，認識到一個比一個還要厲害的隊友，拓展了人脈。對我來說，在微軟實習最大的收穫，除了有取之不竭的學習資源，最重要的是實習生們來自不同科系、背景，透過彼此交流合作，其實也是另一種學習和拓展視野的路徑。</p><p>Mentor 帶給我的啟發</p><p>身為人文學院學生的我，對於自己和周圍同學正在從事的領域不同，會感到焦慮、充滿不確定性，因此時常覺得徬徨。內心知道自己其實並不適合現讀的科系，但又沒有勇氣以重考的方式再給自己一次機會，在這樣的擺盪之中，我對於如何尋找就業出路時常充滿憂慮。當周圍的人對於課堂上老師講解的文本，發表出獨到的見解並受到肯定時，我只能寫出不怎麼樣的作品，內心焦慮著自己是不是沒有文學造詣；當身邊的同學對於散文、小說、新詩等文類創作充滿熱忱，我卻正煩惱自己的 Excel 函數寫不出來，這亦讓我深刻感覺到，自己所在乎的事情與所處的學習環境沒有共鳴。在台灣微軟，我很慶幸能遇到我的 Mentor，她減少了我跨出舒適圈的「不舒適感」。Linda 從傳播領域畢業後，到航空業擔任空服員，再前往快銷產業工作，現在則來到科技業擔任 HR 人資長。她的經歷相當特別，也鼓勵我，就算手邊在做的事情和所學領域沒有太大關聯性，也要試著不去討厭，畢竟人生充滿未知數，不要給自己設限太多，未知的挑戰總能帶來未知的可能。在台灣微軟實習的這半年，我對於跨出舒適圈有了更多一層的想法：透過參加公司的各項專案，學習到領域之外的社群行銷手法；了解到外商公司不變的真理就是變；為了要跟上快速的腳步，即使面臨未知，仍要抱持願意嘗試的態度著手──這些實踐的作為，減緩了我跨出舒適圈的陣痛。</p><p>外商不變的真理就是「變」？</p><p>對我來說，錄取了許多人夢寐以求的外商公司，等於是對自己努力準備面試的一種肯定，然而真正的挑戰，是在正式實習後才開始。回想當初，我對於外商公司有許多不切實際的憧憬和想像：溝通都要用英文、工作環境輕鬆、公司有外國人、談話內容中多了許多英文單字？在進入公司之後，真正體會到的則是「步調快」這件事情。剛到職時，我有時覺得主管的指令反覆、變化迅速，於是鼓起勇氣和主管溝通，得到這句回應：「在外商公司──尤其微軟又身為科技業龍頭，很多決策不可能下達之後就不改變，因為外商公司不變的真理就是變。」這句話徹底讓我清醒，原來光是站在實習生的角度看事情，還不夠全面。過去我往往只看到任務的表面，但缺乏經驗與洞察力；後來的我，則學會有意識地洞悉任務背後可能的發展以及解套方式。當我站在主管的角度換位思考，才發覺在大環境的快速變動之下，也許指令發出以後又有了更好的解決方法，也因此必須改變原先方針，但目的皆是為了讓公司更好。</p><p>「不要把自己當實習生看待」</p><p>在學生時期，我們常常因為犯錯而被處罰，因此養成了做事情要盡善盡美，間接習慣「報喜不報憂」。然而實習的時候，不管是例常工作、臨時被指派的任務，抑或參加的專案等工作機會，都可能發生計畫之外意想不到的失誤，過程中也許會有很多出錯的機會、做得不夠好的地方，因此，面對挫折除了必須排遣壓力，抱持著成長性思維（註），才可以在錯誤中不畏懼並且驅動自己，更有動力補強不足之處，從犯錯中學習、從學習中成長。在實習計畫最一開始，一位從實習轉正的學長曾和我們分享，擔任實習生應該抱持的態度是「不要把自己當實習生看待」，當時我心想：如果我們不把自己當實習生，那要把自己當什麼？\r\n原來，學長的想法是這樣的：「在主管交付的工作中，許多實習生如果遇到瓶頸，會有『因為自己是實習生，所以不會做是應該的』的心態；然而，不論是主管、正職，還是實習生，遇到困難時應該皆要主動求助，而不是受到身份的限制，就認為自己沒有完成是理所當然。」</p><p>做中學，錯中學──我真的能犯錯嗎？</p><p>在台灣微軟實習，另一個讓我印象深刻的文化是「不害怕實習生犯錯」。還記得剛換部門時，第一次與主管互動，他教了我許多身為部門助理該做的事，例如：訂會議室、部門開銷報帳流程等，我一直都記得他提到的：「如果遇到不會的就問我，反正教久了、做久了，妳就會了，但過程中記得要做筆記。」</p><p>實習生們（當然包含我自己）在面對困難的時候，第一時間除了慌張之外，接下來會對「提問」這件事抱持著遲疑的心態，開始揣測如果詢問主管，會不會被嫌笨？自己不會的這個問題，是否其實很簡單？然而，過於解讀未發生的事情其實並無助於解決問題，如果時間一拖長，反而會使問題如雪球般越滾越大，因此在微軟，「做中學，錯中學」不只是口號，對我來說是真實被實踐的精神。在實習的工作當中，我也受到許多實戰經驗豐富的主管提點，進而理解洞察力的重要性，以及思考配套措施的必要；在與主管的相處方面，一味地站在自己的角度思考，並不會幫助事情進展得更加順暢，如果能換位思考，不僅態度會更加圓融，對於事情解決的效率也能有所提升。再者，實習生擁有犯錯的權利是我學到的寶貴一課──在微軟，面對任務不僅要學、要做，在手足無措時更要積極尋求協助，犯錯的當下也要第一時間告知，讓大家一起想出解決方法，並且從失誤的經驗中學習。</p>', 'articleImage15', 2),
(16, '<h1>實習求職前必看五大重點，讓你找到理想職位</h1>', '<p>在開始投遞實習履歷之前，你應該要做好什麼準備呢？什麼樣的準備能夠減少失敗的機率？</p><p>實習的確是一個連結學院與社會的絕佳管道，是從理論進到實務的過程。實習所帶來的幫助，像是夠拓展你的人脈、能夠熟悉某個產業、能夠面對新的挑戰等等，這些好處在不同文章中都曾被反覆提及。實習的管道、產業也越來越多元，人力銀行、FB社團、企業自己的官網等等，提供各式各樣的機會。</p><p>1. 收集實習資訊，奪得先機</p><p>a. 新興人力銀行<br>當你想到實習，第一個想到的管道是什麼？恐怕依然是1111、104等人力銀行，但隨著現代人越來越依賴不同的社群管道，甚至需要建立自己的品牌時，他們的實習職缺乃至於計畫，很可能就不會放在這些傳統人力銀行上。有些新興的人力銀行，如CakeResume、Yourator都是可以參考的網站。<br>b. FB社團<br>不同管道諸如實習透視鏡、校園社團等等臉書的社團，可能就會有不少實習職缺在寒暑假之前出現，在這些社團中找職缺的好處之一，是你知道發文者是誰，因此你可以與他互動、問他問題、打聽相關的情報。再者，在這些臉書社團看到的職缺，其敘述往往都會比在人力銀行網站上詳細，能夠讓你更了解這份實習的工作內容以及職缺要求。<br>c. 職位研究<br>在研究不同企業的類似職缺時，可以認真觀察這些這些職缺的要求與工作內容，這除了可以避免你投錯職缺跑錯棚（例如企業是要找社群行銷，結果你的專業是內容行銷，卻向他投遞履歷），也可以讓你了解這個職位的核心需求為何，讓你在撰寫履歷的過程中可以更加扣緊這些要求去陳述你的個人特質與經驗。記得，一但你看準一家公司，請你務必立刻準備好你的履歷，立刻投遞，不要想著手邊事情還很多所以要慢慢修改，機會往往是不等人的，許多企業一但找到自己要的人，就不再進行面試流程，因此越早投遞履歷，你所得到的優勢也越大。</p><p>2. 盤點自己的人脈</p><p>a. 幫你獲取實習資訊<br>盤點人脈並不等於隨便攀關係，而是這些人脈有時能夠提供你絕佳的實習機會。企業找實習生的季節，約莫是寒暑假前兩個月（某些大型企業可能會把時辰拉得更久，在學期一開始就徵人的也有可能），這時仔細關注學長姐的臉書，很有可能會看到正在實習的學長姐轉發企業徵才的訊息。在求職時若有相關人脈，儘管不會是一定錄取的保證，但可以先向學長姐打聽企業的風格，她工作的經歷，近一步得到該企業的職場文化、環境、工時等比較難搜尋到的資訊，讓你在投遞履歷之前，可以更仔細地篩選企業，而不會像一個無頭蒼蠅在求職網中不停打轉。<br>b. 協助檢查履歷<br>另一個重要的人脈，是你能夠放心交付你的履歷讓他檢查的朋友，在投遞履歷之前，可以先請他們簡單給出建議，看自己的履歷是否在排版、內容上有需要刪減調整的空間。有時候，只是稍微改動履歷的色調、經歷與學歷的位置，就能夠達到意料之外的效果。事關實習，就不要再害羞了！</p><p>3. 你的經歷能不能說服人</p><p>a. 隨時更新履歷<br>\r\n在你寫履歷的過程中，請先退一步思考自己有沒有夠的經歷，如果經歷不足，企業也很難了解你的能力是否有達到他們的預期。隨時更新自己的履歷，這樣在更新的過程中，自己也可以檢視目前走的方向是否與你的目標有著具體的關聯，並思考日後如何調整才能更加接近你的目標。<br>b. 確實累積經歷<br>如果還沒有足夠的相關經驗，第一步往往可以先從學校的系院學院、社團開始。學生社團百百種，許多學生社團也對於學生的身份控管也並不嚴格，如果自己的學校社團資源不多，不妨向外尋找，多多嘗試。社團能訓練的絕對不只是團隊合作的能力，舉例而言，在宣傳、推廣活動的時候，就會考驗到行銷的能力；系學會、社團的宣傳圖片設計，也能培養設計圖片的能力。這些社團的加入門檻通常不高，但會碰到的問題與需要提供的解決方式往往很實際，因此會是極好的鍛鍊經驗的機會。</p><p>4. 企業資訊研究</p><p>在開始寫履歷之前，先問問自己，你對這家企業了解多少？很多人以為，這些準備從寄出履歷之後再開始就好。但若在開始找實習、撰寫或調整自己的履歷之前，就先針對該企業進行基本的研究，能夠幫助你寫出一份該企業「專用」的履歷，讓對方對你的印象更加深刻。可以研究的主題，包括企業的背景、企業所處的產業、與他們的競爭品牌等等。另外，查找這些資料時，可能也會找到其他實習生或是正職的面試過程，參考他們的面試過程，也能幫助你了解該企業對於人才的態度及要求，不但能讓你在投遞履歷的最一開始，就有亮眼的表現，也可以協助你評估這家企業是否與你的理念相同。在投遞履歷之前對該企業進行一定程度的研究，也能幫助你豐富你的履歷。像是在履歷中呈現你認為若你爭取到這個職位，你會如何協助企業改善你所發現的某個問題，提出實際的解決方式。比起基本的自傳、經歷、作品集，若履歷能呈現與一般人不同的內容，不僅能讓企業感受到你的用心，也能讓企業一下子就記住你。</p><p>5. 調整心態，找尋自己的職涯機會</p><p>實習是一種嘗試，在過程中你可以了解這個產業是不是如你所了解與想像的，在過程中可能會有幻想破滅的時候，也可能會遭遇很不愉快的實習過程，甚至很不愉快的求職過程。但實習從來都不是為了要圓滿你預期而存在的，在實習的過程中，你需要真正地為自己負責，為你的工作內容負責，學習職場上的相處甚至必須學習商業思維。正因為實習會碰到的內容如此豐富，所以調整好自己的心態，讓自己保持開闊的心胸與堅強的心臟，去面對每一次的挑戰，並且去多方嘗試。每一次的嘗試，即便你可能沒辦法立刻找到自己最喜歡的、最舒適的環境，但在過程中至少可以明白自己不那麼喜歡什麼，藉由刪去法在未來找到最適合自己的那條道路，在未來開創屬於自己的職涯。實習的過程中，可能會有不適應的時候，也可能會因為需要學校實習兩邊兼顧，因此感到疲倦的時候。但在實習的過程中，遇到Mentor的幫助，或者遭遇許許多多有趣的人，被意料之外的人所肯定，都會是旅程中很重要的寶物。</p>', 'articleImage16', 5),
(17, '<h1>出國實習哪裡找？精選 7 大實習求職平台，海外實習工作任你選！</h1>', '<p>想到國外實習，開啟自己的國際職涯，但不知道要從哪裡開始找嗎？也不知道哪裡找得到吸引人的實習工作機會嗎？\r\n我們盤點了 7 大實習求職平台，有提供給國際學生的實習工作職缺，也有工讀旅遊、志工的工作機會，想讓自己的職涯故事更豐富，就千萬不要錯過！</p><p>1. 全球最大學生領導非營利組織： AIESEC <br>應該有很多人在學校時就知道 AIESEC，AIESEC 是全球最大的學生領導的非營利組織，有超過 87 個國家組成，提供學生國際志工、實習與工作的機會，也經常是許多企業尋找國際人才的管道！</p><p>2.海外正職、實習工作和志工機會通通有：Idealist<br>網站上有來自全球的正職工作、實習工作職缺與志工機會，只要在搜尋欄上輸入所在地、技能相關的關鍵字，就可以跑出所有符合條件的工作選項。</p><p>3. 技術領域的海外實習工作：IAESTE<br>IAESTE （International Association For The Exchange Of Students For Technical Experience）主要提供兩個面向的海外實習工作，一種是給想到其他國家去實習的美國學生；另一種則是給想到美國去實習的國際學生。IAESTE 的實習工作職缺遍佈全球超過 30 個國家，主要會專注在工程、數據科學、數學、物理及建築等等技術領域，大部分的海外實習工作會是一學期以上，或 8-12 週的暑期實習工作。</p><p>4. 橫跨歐洲、亞洲、大洋洲的實習求職平台：IES<br>\r\nIES （Institute For The International Education Of Students ）提供的實習工作機會涵蓋非常多領域，包含商管、藝術設計、教育、行銷、法律與政治等等，海外實習工作的地點從倫敦、巴黎、羅馬到上海、雪梨都有，實習時間也分成暑期和學期制兩種，選擇非常多。</p><p>5. 六大國際城市的實習工作機會：CIEE<br>CIEE 全名是國際教育交流協會，主要提供美國、加拿大、香港及德國的實習工作職缺，尤其會在洛杉磯、紐約、溫哥華、柏林等大城市進行實習計畫，實習產業包含新創、行銷、工程、藝術、金融等等，還會協助修改實習的英文履歷、模擬英文面試及安排實習期間的當地住宿等服務。除了實習工作的職缺，CIEE 也提供紐西蘭、以色列、西班牙的海外志工計畫。</p><p>6. 從海外實習工作、海外志工到海外交流參訪什麼都有：Skyline<br>Skyline 提供了許多國際間的交流服務，像是海外的實習工作計畫、志工計畫、交流參訪以及獎助學金都有，只要在搜尋欄位設定地區、費用和時間長短的條件，就會跑出選項了。實際測試過後，發現選擇真的滿多的，海外實習工作的機會在美洲、歐洲、大洋洲等地區都很豐富，也有線上遠端實習工作的選擇。</p><p>7. 橫跨南美、南非、歐洲、亞洲到大洋洲的實習工作：CONNECT 123<br>如果你心中理想的海外實習工作地點是在阿根廷、巴賽隆納、都柏林、南非或雪梨，而且對公共衛生、教育、經濟、商管、醫藥與人權等領域有興趣，不妨參考這個網站上提供的實習工作機會。</p>', 'articleImage17', 4),
(18, '<h1>轉大人練習題｜海外實習能刷履歷？關鍵是你有沒有「本事」</h1>', '<p>「國際移動力」在近幾年一直是熱門的人才關鍵字，在思考人生規劃時，我們開始會把「海外機會」列入考慮。每年只要接近寒暑假，「出國深造」便成為熱門話題，隨著畢業季的到來，也讓更多人開始思考：除了在台找工作或念研究所，我們還能擁有哪些第三選擇？</p><p>在這樣的趨勢下，很多學生開始選擇利用假期或者 Gap Year 的時間參與海外實習計畫，累積國際經驗。對海外打拼有興趣的你，或許已經看過很多海外經驗分享文，有的人寫工作環境的新鮮事和挑戰，有的人察覺，海外競爭力遠超乎我們的想像，各個都寫得天花亂墜又吸引人，卻還是無法真正驅動你。背後的原因，是因為你開始思考：海外實習，真的值得我去嗎？</p><p>此篇轉大人練習題短訪了曾去過印度半年實習的 Chuk、東南亞實習的 Tina、中國暑期實習的 Au，以他們的真實經驗，歸納出多角度的思考面向，提供給正在躊躇的你。</p><p>1. 用最短時間，踏上彈力最好的「職涯跳板」<br>\r\n許多學生相準海外實習的原因，是認為在找工作時能為履歷、面試大加分。剛從印度實習半年回國的 Chuk 表示切身有感，在出國前他也曾在台找工作，大學社團經歷豐富的他，頻頻碰壁；從印度回台灣後，竟在短短兩個禮拜內他得到了兩個 Offer 。他認為，海外的經驗使他的履歷容易脫穎而出，面試時也能讓面試官感受到他是一個有故事的人。相較於半年前找工作時，他現在更加認識自己，而能有底氣展現長處。</p><p>2. 不需再考照，經歷證明了你的語言能力<br>\r\nChuk 在短訪中緊接著強調，海外實習的經驗其實也等同於證明了你的語言能力（華語地區實習除外）。他說：「比起一張證明你很會考試的語言檢定成績，海外實習更證明你可以應用外語了解業務需求、解決問題與多元溝通。」\r\n然而，海外實習不是過了外國墨水，就為自己鍍上了金。它只是為我們開啟了一扇門，走進門後，是否能用自己較陌生的一面工作，並從中發現潛能，便是各憑本事發揮。若在實習過程中，缺乏有意識地提升自我覺察，或練習與不舒適感磨合，即使去再遠的國家實習，也都將是枉然。</p><p>3.拓展視野，踏實體驗何謂「跨文化」<br>有些人會認為，海外實習難以建立人脈，然而，Chuk 有另一種觀點。他發現，實習使我們有機會深度認識不同的工作文化和生活型態，而這是一般旅遊難以達到的。回台工作後，他也仍與印度的同事保持交流，了解當地市場脈動。同時，他建議想要在實習結束後尋找當地機會者，或者到其他跨國公司高就，擁有當地人脈能帶來極大的助力，包括語言溝通及就業市場認識，都能夠以最少的成本獲得最有效率的資訊。</p><p>讓你評估：</p><p>1.申請流程：等待機會，還是浪費時間？<br>許多人被海外實習的推力吸引後，一股腦地找了各種管道投遞履歷。有些人會透過媒合平台（如：AIESEC、CIEE、Skyline）申請，有些人則會自主投遞履歷（大多為歐洲地區的公司）。事實上，想要申請到適合自己的海外實習並不如想像中容易。曾去過東南亞實習的 Tina ，在畢業前夕曾想再次擁有海外實習的經驗，卻因為花費了大量的流程等待時間，最後作罷。Tina 表示，從找到適合自己職缺，到申請結果公布，中間的流程拉很長且難以預估，對於一個剛畢業正在找工作的人來說，等待是非常掙扎的，有時甚至難以聯繫到公司窗口，便陷入更多地焦慮。因此，若已有打算申請海外實習的學生，建議及早準備，將投遞時間拉長，便能降低申請時的焦慮感。同時，也能給自己更多餘裕去嘗試其他機會，即使最終沒有成功錄取海外實習，也仍然有更好的選擇。</p><p>2.升遷機制：你真的是受栽培的人才嗎？<br>Tina 也緊接著說，若是重視升遷機制或人才培訓體系的求職者，相對不適合海外實習。因海外實習大多為 3 個月～1 年的工作，約娉結束後多半難以繼續待在當地（依照地區有所不同，有些為工作簽證手續繁複，有些則是市場難度高），即使真的在國外工作了，很可能發生的是，感受到了文化衝擊，但沒有高速的工作能力成長，反而錯失自己還年輕、應受栽培的黃金期。\r\n對此，我們同時也問了 Chuk，他表示，海外實習確實不會有升遷的保障，不然就會是海外工作，不會是實習。能否留在該國繼續工作，更多的還是要看個人能力。他說：「在國外實習的公司、認識的人，都會對未來留在該國有幫助。但真正的問題是：你真的有留在該國的價值嗎？」</p><p>伴隨阻力：</p><p>1. 生活費用：付出的成本能養活自己嗎？<br>利用暑假時間前往中國實習的 Au ，在歸國後她深刻的體悟是：你有足夠的錢買一個海外的經歷嗎？以海外短期實習而言，多半不會支薪，因此出國實習一趟還需考量當地的生活費用、住宿費用⋯⋯等是否可以負擔，或者，是否有補助可以申請。她表示，當時光是要支付短短兩個月在國外的生活費和房租費，幾乎就花光大半的大學積蓄。若有考慮海外實習的讀者，強烈推薦多關注補助資訊，如：教育部、青年發展署等機關。</p><p>2. 學習點弱：自掏腰包，運氣差就都在打雜？<br>Au 同時也在分享中提及，許多中國的實習在大公司裡，真正要學到東西、提升能力其實非常困難。有些人幸運遇到好主管，能相對擁有好一點的經驗，然而大多數想要增進自己或體驗不同工作內容，需要加倍的努力與主動觀察。</p><p>3.適應能力：在異地長期獨自打拼的考驗<br>在短訪三位受訪者時，不約而同地提及去海外實習具備「文化適應能力」很重要。無論是在工作或生活，都是一再挑戰自己是否能彈性應變溝通隔閡以及文化衝擊。Chuk 也補充，想去海外生活，要與家人溝通長期不在台灣，甚至過年過節無法返台等情況。若沒有以上的困難，在異地獨自打拼，是練習與孤獨相處的好機會。</p><p>用故事，證明自己</p><p>總結與三位受訪者的短訪，我們發現海外實習確實能為在學生或剛畢業的求職者帶來許多紅利，無論是讓履歷更亮眼，也是前進跨國公司工作的跳板，在找工作時也容易脫穎而出。但在光環背後，也伴隨了時間、金錢成本的考量，以及個人能力、職涯規劃的權衡。\r\n三位受訪者也提及，有些工作不會因為有過海外經驗而加分，不同的職場重視的人才條件有所不同。因此，當我們更深入地去探討時，真正重要的可能不是擁有海外經驗與否，而是「你能否有找到適合自己的說故事方式」。因此，希望藉由以上的經驗分享，為正在摸索自己適合哪一種經驗的你，歸結出更全面、可思考推力與阻力的方向。</p>', 'articleImage18', 3),
(19, '<h1>吊車尾進科大 他靠海外實習經歷錄取台大研究所</h1>', '<p>自小以開汽車修理廠為目標的王意程，對學習不如對汽車感興趣，以倒數的排名進入明志科大，但為了出國實習，他不僅提升專業技能，也下苦功學英文，最終成功赴美實習。透過這段海外經歷以及不斷累積的專業能力，他一舉錄取台大等六校研究所。<p><p>德國哲學家尼采曾說：「人因夢想而偉大。」夢想讓現正就讀台灣大學應用力學所一年級的王意程，從成績萬年墊底的國中生，成為錄取六校研究所的搶手新生。回首為達成目標而完全沒參加社團與課外活動的在學歲月，他說，「時間花在哪裡，成就就在哪裡。」<p><p>王意程自述國中時的學習狀況不太好，對學習也不如對汽車感興趣，因此會考放榜後，他決定以開汽車修理廠為目標，進入桃園永平工商汽車科就讀。他不僅長年保持班排第一、參加全國太陽能車競賽等活動，還自薦到汽車修理廠實習，學習引擎維修，累積深厚的維修技能。<p><p>高職三年打磨了王意程的專業技術，但在納入學術科目的統測這關，他的成績卻不盡理想，以幾乎倒數的排名進入明志科技大學機械工程系車輛組。他說選擇明志，是因學校重視產學合作，「明志的大三學生都要到企業實習，還有海外名額，因此我決定以出國實習為目標，到明志努力看看。」<p><p>亮眼經歷 奪海外實習門票<p><p>自覺能力差，王意程一入學就卯足全力追進度，大一參加全國汽車修護技能競賽，不僅需準備現場操作的術科，還需準備全英文筆試的學科，最後拿下北區初賽第13名。備賽過程提升了他的專業技能、與隊友合作溝通的技巧，以及英語能力。隨後王意程持續累積參賽經歷，加上陸續取得的交通部汽車技工證照等，都為達成出國實習的目標打下好基礎。<p><p>因此大三時，王意程拿出優異成績，申請前往台塑美國公司德州廠實習一年。廠商提供機械系的名額不多，且書審與面試都要用英語進行。王意程先向老師蒐集歷屆主管的面試問題，並換位思考面試官期望獲得的答案，反覆練習自我介紹、琢磨用詞與發音。<p><p>重塑方向 找到電動車目標<p><p>但錄取只是過路點，在成為德州廠Engineering Center Design Team的實習生後，考驗才正式開始。王意程除了要自行打理生活、面對全新的工作領域，還會碰上溝通考驗。雖然歷經面試時的密集訓練，但母語者的快語速、不同國籍同事的口音、沒聽過的字彙，都讓他難以在第一時間融入當地生活。<p><p>因此，王意程決定先從語言開始克服。「如果語言不順利，同事就沒辦法交代你工作，工作上會有很多問題。」為此，他習慣準備幾個聊天話題，比如各自的興趣與周末的戶外活動安排，並提前查詢相關單字與片語，隔天抓緊用餐、工作時間和同事聊天。<p><p>美國實習生活不僅幫王意程一舉錄取台大等六校研究所，也讓他找到未來的發展方向。「我看到很多在美國念書、工作的學長姐，他們的專業能力、語言表達等都很厲害，讓我確立碩班畢業後到美國進修、前往谷歌或特斯拉等大公司工作的目標。」<p><p>目前在台大做鋰離子電池的研究，王意程打算繼續赴美攻讀資訊工程等，除了精進專業能力，平時也不忘利用通勤等零碎時間背單字，或聽Podcast、YouTube英文頻道。「在台灣比較缺乏聽和說的訓練，若能多花時間聽英文，聽力自然會變好。」<p><p>從前的汽車修理廠夢想，經歷多年打磨，已茁壯成邁向國際的電動車目標。王意程說，「經歷每個時期，想法都會改變，思考方向也會不一樣。」他勉勵學弟妹若找不到方向，可先到高中探索興趣、替一般科目打下基礎；若有明確目標，就能前往高職培養一技之長，也別忘準備好語文能力。綜觀自己的實習經驗，他歸納出職場成功的三大必備條件，一是專業力，二是簡報力，三就是語言力。「英語好，對未來升學或就業都很重要。」<p>', 'articleImage19', 1),
(20, '<h1>教室外的國際競爭力》大學生夯海外實習 累積學用並重的技能</h1>', '<p>與全球人才競爭的時代已經來臨！根據行政院主計總處統計，2016年台灣國人赴海外工作的人數達72.8萬，相較5年前增加4.7萬，這股海外求職的需求也向下延伸至大學校園。為了讓自己在畢業前就做好求職的準備，許多大學生在學期間參與各種海外計畫，尤其以「海外實習」更是近幾年的新趨勢。\r\n因此教育部也順應趨勢，自2007年開始推出「學海計畫」補助案，11年來已選送3萬多人出國，包括專業實習的「學海築夢」計畫，以及增設的新南向國家實習計畫「新南向學海築夢」，補助款包含來回機票以及比例不等的生活費，依照各學校的方案不同而有所差異。</p><p>技職體系最積極 海外實習比例高</p><p>目前，台灣逾60所大學提供海外實習計畫，其中技職體系的比例又比一般大學為高，像是各科技大學、餐旅大學、護理技術學院等等，原因是技職體系原先就重視實習計畫，幾乎都會將實習列為必修學分，甚至推「三明治學習法(Sandwich Courses)」，規定在學期間必須有半年至1年的實習教學，讓學生學用並重，也可以在實務過程中理解自己欠缺的知識或技能，再回到學校補足能力。在這樣的制度下，技職體系推動海外實習計畫的空間更大，更容易結合學校自身與業界的人脈連結，讓學生在跨國集團或台灣企業的海外分布實習。常見的包括旅館、餐飲科系前往國際飯店集團海外實習，如萬豪酒店、日本西武集團等等；商管科系前往台灣企業的東南亞分公司實習，如寶成集團等，使得台灣學生參與海外實習計畫的人數逐年增加。學生若要在學期間尋找海外實習計畫，可以大略分為「學校管道」、「自己尋找」兩大方向，而學校管道又可以細分為「研修實習」、「海外實習」兩種。以下分項介紹：</p><p>1.學校管道參與研修實習計畫：等同於參與一項半工半讀的課程，學校會與海外姊妹校簽訂合約，將學生送往該姊妹校，並在姊妹校就讀數月不等的課程，再由姊妹校提供當地實習機會。此計畫通常需要支付海外學費，實習期間給付薪資。台灣目前各大學的姊妹校分布普遍廣泛，從大家熟悉的美加、日本、新加坡等地之外，也有不少分布於歐洲，如英國、芬蘭、瑞士，增加了學生實習單位的多元性。</p><p>2.學校管道參與海外實習：由學校與企業單位簽訂合約，提供學生前往海外的實習機會。實習期間，企業會給付實習薪資。</p><p>3.學生自行投遞實習申請：若學生有特定想參與的實習單位、職務，也可以自行準備相關資料投遞至該公司，以自身能力爭取機會，或是透過人脈介紹至該公司。不過要注意的是，如果實習是學校的必修學分，必須要先跟學校確認是否認可自己尋找的實習內容，同時，也要自行處理海外簽證，較為麻煩。</p><p>雖然海外實習相較於一般實習手續繁雜許多，但是也挑戰著學生的各項適應力，如果通過了這段時間的多元文化考驗，回台灣後便能經驗大增，比起其他同學更具備了獨特的優勢。</p><p>國際力加實戰力具備雙重優勢</p><p>海外實習計畫同時結合了「國際移動力」與「實習經驗」兩項優勢，比起單純的交換學生或海外參訪更增加了實務經驗，讓學生提早進入職場，並且體驗海外多元文化下的工作體驗；同時，海外實習也多了一筆實習工資，讓學生可以在有收入的情況下參與計畫，減少開銷上的壓力。當學生在完成了海外實習計畫後，不僅可在履歷上大大突出，增添一筆經歷，也成為未來求職面試時能加以發揮的題材，包括曾經在國外與不同背景文化的人在專業領域上共事，無論是語言能力、適應力、解決問題能力等，都會是多數企業雇主欣賞的能力特質。</p>', 'articleImage20', 2),
(21, '<h1>2022 工程師求職管道彙整：只用人力銀行找工作？工程師，你可能錯過很多好職缺</h1>', '<p>身為一名工程師，你都怎麼找工作，又是從哪裡找工作呢？打開人力銀行的網站，大量投遞履歷就結束了嗎？</p><p>其實，一股腦地往人力銀行投遞履歷，並不是找到工程師職缺的最佳解。如果你正從人力銀行成千上百個工作職務中猶豫，不曉得到底該投哪個而煩惱，或者找到你的工作你不喜歡、你喜歡的工作又不找你，也許該試著想想，作為工程師，你是否通過正確的渠道找工作？</p><p>傳統企業和大公司找工程師人才，主要會透過四種通道：人力銀行、獵人頭公司、展會人脈交流、網路社群。</p><p>1. 人力銀行</p><p>是的，人力銀行仍是傳統企業在找工程師的主要管道，不過竹科人資表示，從 104 看履歷，因為量極大，常常有很多搞不清楚狀況的求職者寄信來，雖然數量高，但媒合成功的職缺比例其實不如其他的求職管道順利。她也指出，雖有少數顧問、總經理職缺，但一般來說人力銀行媒合到的還是資歷偏淺的求職者，大約 5 年工作經驗以下。</p><p>因此，身為一位工作經驗在 5 年內的工程師，的確可以多在人力銀行這個求職管道佈局，但建議搭配 PTT Tech-Job 板服用，因為工程師的職缺太多，同樣的工程師職缺 Title 卻可能是完全不同的工作內容，要讓求職的職缺符合想像，還是要多徵求社群經驗。</p><p>人資們也建議工程師從人力銀行找工作，履歷上的工作經歷要能具體量化，因為工程師的戰績是很明顯的，一年寫幾個專利、懂不懂製程、材料，都要清楚寫在履歷上，找工作時才能脫穎而出。</p><p>2. 獵人頭公司</p><p>一般在業界工作 8 年，即被視為資深工程師，這時候會主動找來的求職管道主要就是獵頭公司。竹科人資表示，產業界 Top 3 的公司 HR 和獵頭公司多有交流，獵頭都會試圖拿到各公司的組織層級狀況，幾個部、幾個課、幾個 function area 都在他們掌握中。當對手公司開出工程師職缺，馬上就會找上門。</p><p>由於獵頭公司是靠交易抽成運作的，通常拿一位求職者薪資的 10%~20%，所以主管職、高薪族群比較會被獵頭這個求職管道鎖定，工程師、技術人才的職缺也是其中之一。要被獵頭挖角沒別的，一定是靠工作實力，再來可耕耘的部分就是下一個重點，多參加展覽和研討會累積人脈。</p><p>3. 展會人脈交流</p><p>其實科技業工程師的圈子很小，平常靠展覽與研討會都會接觸到。而展會不只可以讓工程師在同行水平流動，也往往有跳到上下游工作的機會。例如研發工程師對應到供應商，要設計一個新產品時要有密切接觸才能拿到好的用料，久了混熟就會互相舉薦，往供應商或客戶端跳的案例很多。</p><p>所以如果看準自己在產業鏈的位置沒有發展性，不妨多在展會與上下游廠商建立關係，很容易透過內推的方式輕鬆跳入理想的工程師職位，也不需和人力銀行的眾多工程師求職者打泥巴仗。</p><p>4. 網路社群</p><p>對大公司來說，如果要從網路社群找工程師人才，多半會透過 LinkedIn，尤其是搜尋歐美、東南亞、日本、新加坡等國外的技術人才。因此也建議工程師們，就算不是立即要找工作，平時若有空也可以多經營自己的 LinkedIn 帳號。</p><p>對科技業人資來說，在 LinkedIn 上看得到每個人的真實帳號，如果有工程師大神幫你抬轎，會比起人力銀行附加的推薦信更有可信度。</p><p>新創公司的工程師職缺，除了基本的人力銀行之外，就業媒合平台、網路社群和各新創公司官網也都是適合搜尋工程師職缺的渠道。</p><p>如果你是透過新型態的求職管道應徵工程師職缺，記得就盡量別附人力銀行的制式履歷，尤其是注重思路靈活的新創公司，想看到的求職信和傳統企業當然有差別。記得花心思針對各家公司的工程師職缺需求撰寫履歷，並且有實際的工作記錄證明自己是個人才，才可能獲得面試的機會，以及有較高的薪資談判空間。</p>', 'articleImage21', 5),
(22, '<h1>台灣學經歷如何前往英國挑戰國際職涯？軟體工程師 Aaron 的英國求職策略</h1>', '<p>Aaron 出身台大生物背景，為半路出家的自學工程師，返台前在倫敦一家新創公司擔任 Engineer Team Lead，一路從天使輪走到 Series B，他將分享溫良有志的工程師如何在競爭激烈的英國職場生存下去?</p><p>原本在南港的軟體公司擔任前端，一直尋求國際機會卻苦無門路；因緣際會取得了英國簽證，自此開啟前往英國發展的軟體工程師之旅。</p><p>出國留學也許不是唯一解，Aaron 將以他個人經驗分享，如何活用自己的經歷和能力，挑戰世界舞台。</p><p>臺灣工程師進入英國公司容易嗎？</p><p>Aaron 提到，假設以一個外國招募者（Recruiter）的眼光來看，當他收到一個履歷或應徵申請，名字拼音來自外地，過去工作經驗又都在台灣，很快就會想到招募流程會遇到的簽證問題，這個無法偽裝。因此先拿到工作簽證是重點，當你擁有了工作簽證後，找工作相對會順利一點。</p><p>相較於美國一年抽一次工作簽證，英國每個月都會釋出名額，相對容易取得，打工度假簽的限制也比較少，你可以運用這個度假簽，去找任何能發揮你專長，並養活你的工作。</p><p>軟體工程師找海外工作，主要看什麼？</p><p>「兩個方面，溝通能力與基本素養。」</p><p>首要還是要看你能否順利與同事們溝通，只要敢於開口，能夠表達工作上的內容、與他人合作就沒什麼問題，基本素養指的是你的專業能力是否有一定程度，以軟體工程師來說，具體包含自己領域的語言細節、基礎的演算法、和能夠獨立實作一個專案的能力，不必非得要成為技術大神才能出國。</p><p>英國的新創、科技業氛圍？</p><p>在談到英國的新創氛圍與台灣有什麼區別時，Aaron 提到了團隊組成的多元性，英國新創的異質性遠比台灣高得多。</p><p>一、團隊族群多元，擁有相當高的異質性</p><p>「由於地緣關係，英國吸引了很多歐洲國家的人參與，在英國的新創公司中，團隊不乏來自各式各樣語言、族群和文化的外國人。加上英文是很多國家的人都能使用的共同溝通語言，跨文化交流相對容易，不同文化因此匯流與融合進一間公司的文化和血脈裡。」</p><p>由於擁有高異質性的團隊，在產品、商業模式的塑成會更加多元、廣闊，每個國家的人都會帶入自己國家的使用者行為，也理解當地的使用者會具備哪些需求和習慣，這些產品會相當多元而創新，去容納不同國家的用戶。</p><p>二、相較於美國以外的其他國家，英國新創環境不錯，有較多出場的機會</p><p>新創團隊談出場，主要有兩種方式，一是成為上市公司，這需要相當多的資金投資與支撐；二是被收購。英國新創的成功出場的案例雖然沒有像美國這麼多，但就整體環境和資金還是十分充沛。歐洲的軟體類大企業總數較少，收購型的出場案例較少，若要出場，大多是走 IPO 的路線。</p><p>﻿「在台灣就可以先練習面試流程，落地時你就不會是初生之犢。」</p><p>Aaron 當初確認取得英國的打工簽之後，預計三個月後落地，這段期間他就先試著在台灣找工作，與當地的 Recruiter、Headhunter 接觸。透過與各家公司來往的面試篩選流程、電話面試，一來可以漸漸熟悉當地的面試氛圍、習慣流程，二來可以訓練聽說的能力，並在不同的待遇和面談當中漸漸校準出自己值得擁有的工作待遇、想要的工作環境。</p><p>這個階段 Aaron 採取的是海投廣撒的策略，各種產業和規模的公司都主動嘗試，後來才針對新創公司去投遞。在英國，一站式的人力網站求職法並不適用，你必須靠自己主動去營造曝光機會、觸及你想要的目標。</p>', 'articleImage22', 4),
(23, '<h1>下班後如何透過接案、兼職，打造斜槓人生</h1>', '<p>身為 UX 設計師的軟實力：洞察能力、學會問「為什麼」</p><p>Yvon：做 UX 的思考邏輯和脈絡要很深，要去了解各方面，包含商業面的考量、工程面的可行性，還有使用者面的問題點等等。</p><p>可能有很多個問題點，但必須要去拆解哪一個才是最重要的核心問題，有效率、精準地找出 insight 的能力很重要，這是一種觀察的習慣，要好奇每件事情發生的背後原因。</p><p>在做設計的時候，不能理所當然地覺得「就是這樣」，而是要反問「為什麼要這樣做？」、「做這個功能是為了解決什麼問題？」在 Sketch 裡執行專案的時候，我也會很直接地問這些問題。</p><p>我看了 Simon Sinek 在 Ted 上的演講，提到了黃金圈法則（golden rule），提倡做任何事情都要從「why」，也就是「為什麼而做」開始。</p><p>2. 身兼多職（UX 設計師、雙胞胎媽媽、Designlab 導師、餐廳副業）的 Yvon 是怎麼時間管理、面對壓力的？</p><p>Yvon：當媽媽之後，要真的有一段不被打擾的工作時間是很難的，尤其有了小朋友之後，我就很佩服在職的媽媽，要同時工作又要陪小孩。</p><p>但我還是希望可以在他們需要我的時候陪著他們，所以我非常珍惜每一個時間，時間管理也是我後來學習很多的東西。</p><p>我開始用一個叫 Harvest 的時間和專案管理工具，每次開電腦，就可以追蹤某個專案花了多久的時間、做了哪些進度，要是知道自己已經沒那麼專注，就可以告訴自己要趕快跳走。</p><p>我知道我常常處在一種很緊繃的狀態，會很擔心自己走得比別人慢。</p><p>做科技業的人，其實都有很多資訊要吸收。尤其我在 Sketch 的工作需要做大量的研究，要知道 Figma 做了什麼、Adobe XD 又做了什麼，然後我們自己（Sketch）又要做什麼......；逛到臉書，又看到哪個設計師現在很斜槓，可能在做 podcast、在 medium 上寫文章，也會開始想，自己是不是也要這樣做。</p><p>這種時候，就會覺得我的腦袋出現好多聲音......當下了班之後，小朋友又開始吵，有時候真的會處在崩潰的邊緣。</p><p>但我會找到一些紓壓的方式，找時間去運動，透過做瑜伽、冥想，舒緩自己的焦慮。識、技能，如 HTML、JavaScript、jQuery；而廣告、文宣等平面設計接案則多會要求應徵者具備 Adobe Photoshop、Illustrator、Adobe InDesign 等繪/修圖工具。工作待遇的部分多按件計酬，薪資依經歷、技能的不同差異幅度大。</p><p>3. 如何用自身力量幫助更多設計新手？</p><p>Yvon：我希望可以幫助更多自學設計的人，跟在線的設計師有更多互動。</p><p>我目前在擔任 mentor 的 Designlab 是一個全球性的平台，需要參加四週的課程，平台會安排一個 mentor 給你，不一定是我，可能是世界各地業界的設計師；但因為有時差、要用英文學設計，我覺得可能不是每一個在台灣學設計的人都會想用這個平台。</p><p>所以我才在想，我自己可以用 mentor 的方式，跟台灣的學生互動，而不一定是透過Designlab。因為好多人都會傳訊息問我，「我想自學設計，有推薦的書可以看嗎？」或者是「你可不可以幫我看一下作品集，要怎麼樣調整才會讓面試官注意到？」</p><p>可能會安排一個類似 office hour 的時段，讓新手設計師們直接跟我聊聊，看大家在做作品集時遇到哪些問題，或者是自學的時候發現哪些需要的資源，甚至想認識其他的設計師，也可以透過這個管道。這是我還在思考，今年可能可以做的事情。</p>', 'articleImage23', 3),
(24, '<h1>設計師要有哪些軟實力？Sketch UX 設計師 Yvon：懂得問「為什麼」才是關鍵</h1>', '<p>下班後的生活，決定 5 年後的你！</p><p>根據行政院主計處統計，台灣 25 - 34 歲年齡區間的人口，低於 30% 受僱就業者的每月主要工作收入超過 40k 新台幣，在開銷偏高的台北市，要維持生活水準可以說是不容易。從另一個角度切入，檢視一下自己下班後的生活，你都做了甚麼？統計顯示，線上追劇、瀏覽社群網站是多數人於下班後消磨時間主要從事的活動。想一想，這看似充裕的 5 - 6 小時的時間，卻常常在低頭滑手機中迅速流逝，有沒有什麼兩全其美的方式可以有效率地利用下班時間，在提升自己的同時，透過網路在家賺外快？本篇文章將統整可以透過業餘時間發展的接案、兼職工作類型。不論你是正職上班族/ SOHO 接案，都值得參考！</p><p>6 大接案、兼職工作種類</p><p>1. 設計接案</p><p>設計接案可以主要分為線上設計及實體設計兩種，最熱門的為平面設計接案及室內設計接案。相關技能的部分，網站/網頁設計接案多會要求應徵者具備一些基礎的前端知識、技能，如 HTML、JavaScript、jQuery；而廣告、文宣等平面設計接案則多會要求應徵者具備 Adobe Photoshop、Illustrator、Adobe InDesign 等繪/修圖工具。工作待遇的部分多按件計酬，薪資依經歷、技能的不同差異幅度大。</p><p>2.程式接案</p><p>程式設計接案的種類較廣泛，除了常見的軟體接案、網頁/站接案，也有專注於前端接案、後端接案等等，根據職務安排有相應的技能要求。程式接案較常見到長期合作的案件 (約 2~6 個月)，也有不少提供表現優良者轉正的機會！工作待遇的部分有按件計酬、以時/月薪計算等方式，薪資依工作內容、經歷的不同差異幅度大。</p><p>3.翻譯接案</p><p>翻譯接案涵蓋多種不同的語言，形式上分為筆譯及口譯，語言部分以日文翻譯接案、英文翻譯接案、韓文翻譯接案為大宗。筆譯為較常見的翻譯接案類型，工作內容涵蓋文章、書籍、商業文件、影片字幕的翻譯；翻譯接案多會要求應徵者具備特定語言程度認證，如 TOEIC 多益 900 分以上、法文通過 C1 檢定等等；工作待遇的部分多按件計酬或以翻譯字數量計價。若想從事翻譯接案，有職缺要求的相關產業學經歷，如法律知識、醫學/生技經歷等，都非常加分。</p><p>4.藝術相關接案</p><p>插圖接案、繪圖接案：主要分為線上及實體兩種類型，線上部分多要求應徵者需熟習相關電腦繪圖工具；實體的部分則依設計風格的不同要求水彩、水墨、速寫、版畫等各式技能專長。</p><p>修圖接案：多要求應徵者須熟悉 Adobe Photoshop、Illustrator 等修圖軟體。</p><p>動畫接案、剪接接案：多要求應徵者須熟悉各類影片剪接技術及軟體，如多媒體設計 Premiere、影像處理 Adobe Effect 等等。</p><p>攝影接案：可以依照拍照主題及拍攝地點做分類，多數為室內/外活動的攝影、側拍，如婚禮攝影、公益活動側拍等等。若想從事攝影接案，須考量到早期的案源多來自於親友，需一段時間建立人脈及口碑。</p><p>5.行銷相關接案</p><p>行銷相關接案主要以文案/章撰寫、搜尋引擎優化 (SEO) 為大宗，常見的內容為廣告文案、社群媒體文案、部落格文章等等。文案接案多要求應徵者須具備寫作技巧、創意發想能力，若為 SEO 接案，則會要求具備關鍵字規劃能力、基礎網站架構知識及使用者體驗分析等。</p><p>6.行政相關接案</p><p>行政相關接案的大宗為打字/Key-in 接案，主要工作內容為聽音檔打/校對逐字稿及資料Key-in。打字接案根據音檔內容，部分會要求應徵者具特定語言能力，如台語；Key-in 接案則多會要求應徵者的打字速度。</p>', 'articleImage24', 1),
(25, '<h1>前 TSMC 工程師如何在離職後邁向財富與心靈自由？在投資小宇宙發光的 Frank</h1>', '<p>台積電（TSMC，Taiwan Semiconductor Manufacturing Company）在全球半導體產業中佔有一席之地，對於台灣自身的經濟與產業的影響力更是不容小覷。在肺炎疫情的影響下，生活幾乎不受影響的台灣使得 TSMC 在全球產業鏈中的重要性大幅提升、股價節節上升，也讓進入 TSMC 工作的機會比起以往更受歡迎。</p><p>在《科技職涯》第二季的第 35 集中，我們迎來了開播以來第一位半導體產業的來賓 － Frank。交大電機所的 Frank 在畢業後順利進入 TSMC，歷經過產品發展跟 RD 兩個角色，而在工作兩年半後的 2020 年 7 月毅然決然地選擇離職，現在他主要以投資理財作為收入來源，可以說是已經進入所謂的「財富自由」狀態。</p><p>★專訪</p><p>加入台積電半年後，開始進行未來 5-10 年的投資規劃</p><p>「離職不是裸辭也不是過渡期，心中要有五成的把握才能做。」根據馬斯洛的需求層次理論，當生理需求被滿足得越充分，就越有本錢追求心理的需求。因此 Frank 還在台積電任職時，就開始在下班後投入很多時間學習投資，以期在辭職之後也能不為財務擔心、有能力追求理想的生活樣貌。</p><p>Frank 坦言，過去他在面對內心的困惑時，常常歸咎於外部的原因，可能是社會現況，可能是工作和職場，但是後來他漸漸明白，如果可以對自己完全負責，了解所有的煩惱都能夠追根究底地從自己開始改變，就不會有那麼多的抱怨。</p><p>「我想要讓自己能夠健康地走出去，能夠接納自己、能夠坦然告訴別人自己在做什麼、是一個完全負責的狀態。」面對離職的轉變，Frank 靠的不是衝動，反而是寄予了對自己的深刻期待。Frank 並沒有真的在台積電待到五年、做好 100% 的準備才離職，而是確定了自己無法再接受那樣的生活就離開了。</p><p>雖然計畫還沒完成，但他已有 6-7 成的準備，而他也認為自己還年輕、沒有太多包袱，還是可以承受失敗、可以不斷調整。對於 Frank 來說，重點不在於避免失敗，而是的過程中對於心智的訓練，長久以來可以促使他成為心態更加健康的人。</p><p>離開台積電，追求自己的小宇宙</p><p>那麼，離開台積電，Frank 想要追求的到底是什麼呢？</p><p>箇中緣由可以從 Frank 在念碩士的時候開始說起。那時他開始發現他的「社會我」與「真實我」有些矛盾跟碰撞，開始感覺到社會的期待似乎不等於自己的期待。這樣的問題一直都讓他感到很困惑，真實我、社會我、理想我，三個「我」持續地拉扯。</p><p>Frank 觀察到，社會似乎提倡先追求財富地位，再找到自己；但是有越來越多的人卻因為先做了自己，而後財富、名聲伴隨而來，所以他開始好奇：是不是要先更認識自己，才會產生這些附加價值？</p><p>「工作不能代表我這個人，我想知道在生命結束時是否能好好了解我這個人。」Frank 開始理解到做自己跟財富不一定衝突，他也並非要遵守常態的、安全的路線才能得到一樣的回報。他很熟悉自己的工作和專業，卻好像對自己不夠了解、不確定自己的天賦何在。因此，循規蹈矩地生活了 20 餘年、擁有好文憑和好公司的工作經歷後，Frank 決定從既有的人生道路轉彎，擁抱更真實的自己。</p>', 'articleImage25', 2),
(26, '<h1>從資料科學走向產品管理！在好奇心與成本之間取捨的 PayPal 資深產品經理 Nicolas</h1>', '<p>我們邀請了目前在美國 PayPal 擔任 Senior Product Manager 的 Nicolas，來跟我們分享這 15 年的職涯經驗。Nicolas 在中央大學數學系畢業後繼續唸了交通大學的資工所，拿到碩士學位後加入了 IC 設計公司 Sunplus。在半導體產業的四年多的時間，Nicolas 接觸了很多軟體公司的專案，包括當時正在興起 Google、騰訊等，進而發現自己對軟體產業的興趣。</p><p>接著，Nicolas 先是到台灣 Yahoo 擔任軟體工程師，後來因為專注在 Scrum Master、Team Lead 等有管理職能的角色，Nicolas 又挖掘到自己對商業的興趣，所以前往美國念 MBA。商學院畢業後，Nicolas 進了 Facebook 擔任 Data Scientist，而後因為想要嘗試新的東西，再次轉換到 VISA 擔任 Product Manager。</p><p>從一開始擔任 IC 設計公司的工程師到如今在軟體產業擔任產品經理，看似有點跳躍的職涯轉換，循序漸進的每一步其實都有其邏輯。</p><p>舉例來說，雖然 IC 設計公司的待遇不錯、軟體公司當時在台灣還只是剛起步，但是因爲想要做可以直接被用戶使用、即時得到回饋的產品，Nicolas 做出了非主流的選擇，轉職到軟體產業。從工程師轉為 PM，現在看來不算是少數的選擇，但從 Nicolas 個人的職涯歷程 — 產品工程師 → 資料工程師 → 資料科學家 → 資料 PM 來看，也不是個一蹴而幾的過程，而是透過不斷反思自己的能力和興趣，所做出的逐步調整跟選擇。</p><p>最需要勇氣的選擇 — 出國念 MBA</p><p>談起生涯中的三大轉換，每個轉換都會替 Nicolas 引來很多好奇和問題，但他花最多勇氣下定決心的轉換，是花光所有積蓄到美國唸 MBA。當時工程師念 MBA 不算是主流的選擇，Nicolas 自己遇過的 MBA 學生中擁有工程背景的人比例不超過兩成，當然，一個 MBA 學位所費不貲，也是他猶豫的原因。</p><p>一直都打算出國唸書的 Nicolas，即便開始工作也沒有放棄這個念頭。他不斷在思考出國的目標會是什麼？他要如何達成這個目標？是要念 PhD、工程碩士還是商學院呢？</p><p>確認自己的興趣在軟體領域的 Nicolas，想像外商公司應有背景相關、多元的同事可以幫助他回答這些問題，因此他開始把求職方向鎖定在外商，不僅是基於職涯考量，也是為了幫助自己做出人生的大決定</p><p>從半導體工程師到軟體業產品經理的職涯</p><p>轉換維度不小的 Nicolas，認為影響職涯發展至關重要的作為是「找到自己的興趣跟 passion」。就算是要轉換領域，也可以因為擁有強烈的動機，能夠說服新的企業、主管自己可以結合過去的經驗，幫助團隊建立新的能力。</p><p>每份工作擔任的角色不同、當時累積的閱歷和能力也都不同。回頭來看自己的職涯，Nicolas 無法直接點名哪個階段對他的影響最大，因為每份經歷都帶給他重要的收穫。</p>', 'articleImage26', 5),
(27, '<h1>小代誌：以平面設計為職業，插畫為興趣的人氣插畫家</h1>', '\r\n<p>在生活中很多的小代誌(事情)，不管是有趣的、傷心的、難過的、快樂的，事後回憶起來都可以成為一種紀念。恭喜小代誌今年也即將舉辦首次個人的插畫展，非常期待她是如何記錄屬於她的小代誌，想一睹為快的粉絲們快跟著我們一起閱讀本期小代誌專訪吧！</p><p>小代誌：創作這件事從我很小的時候便在進行了，接受繪畫的專業訓練是從6歲那年開始，然後一直到19歲，縱使20歲之後沒有老師的帶領了，但仍然保持著畫畫的習慣。</p><p>2011年我成立了個人平面設計工作室，專注於書籍裝幀設計，從那時候開始，便以平面設計為職業，插畫為興趣。為了能有個放插畫作品的空間，特地開了一個部落格，小代誌其實是我部落格的名稱，這個名稱的由來，其實是源自於我創作的內容，因為作品主題多集中在日常生活的瑣碎小事，也象徵我正在記錄著「屬於我這個渺小時代的生活日誌」。</p><p>漸漸累積了一些讀者後，許多人誤以為這是我的名字而這樣呼喚我，久而久之真正的名字已經被遺忘，小代誌變成我最容易被記起的名字，從此之後也就習慣以「小代誌」的名義來發表作品。</p><p>如同一開始的目標「平面設計是職業，插畫是興趣」，將插畫當成興趣主要是希望能保有一些自由創作的純粹，所以接案的類型全部都是平面設計，而在設計案件中，我專心在書籍裝幀設計這個領域，是因為我喜歡閱讀、喜歡故事，經常在一本書的閱讀中有很多想像和延伸的畫面，因此毅然決然投入出版業的書籍設計，雖然插畫在我目前的人生規畫中是作為興趣，但偶爾也會在設計案中偷渡一些我個人的插畫在設計裡，算是工作上一種小小的樂趣。</p><p>問：小代誌請簡單介紹自己代表作品與插畫風格</p><p>小代誌：到目前為止，我覺得自己的代表作尚未出現。不過近期網友迴響比較熱烈的是我所創作的紙膠帶作品「午睡壽司店」與「裸男搬運工」，一樣是幽默詼諧的內容，製作前期在發想上花了非常多時間。「午睡壽司店」描寫的其實是我本人平常的寫照，常常整日精神不濟、昏昏欲睡；而「裸男搬運工」則是借用兩位裸體男子搬東西的樣子，來傳達我內心想要得到的一些物質和精神享受、以及期待能實現的願望。</p><p>在內容上，我偏愛擬人的手法，這是由於描繪的主題多集中在物品，除了更生動之外，將物品擬人化，完全是展現我內心那個潛藏的幽默性格。招牌的單一表情是出自於剛創作這些插畫的那一年，心情並不是非常美好，我覺得這個五官透露的情感很微妙，有點哀傷、有點淡然卻又有些愉悅，不知到底是開心還是難過，或許這個表情最能代表憂喜參半的人生吧！而從網友的意見回饋中，對於風格的具體描述則是「療癒」、「可愛」和「脫力系」。</p><p>問：您同時兼具平面設計與插畫的才能，有什麼優勢或困擾嗎？</p><p>小代誌：我想最大的優點就是兩者可以相輔相成，在好的插畫作品上添加合適的設計元素是有相乘效果的。在我個人的書籍設計案件中，若主題有需要時，我會親自為封面描繪插畫，經常在書出版後，會收到新的邀約，因為看到封面插畫而來邀約設計，覺得這種現象很奇妙，客戶多半表示「他們喜歡具備插畫能力的平面設計師」。</p><p>另一方面，這兩種才能有時也會互相牽制，因為平面設計常要有市場導向的考量，需要一部分理性的腦袋，而插畫對我而言是全然感性的，所以經常必須在理性的左腦和感性的右腦之間切換，若那段時期的生活被較多設計案給佔據時，頭腦就會變得過於理性而影響插畫創作，這時的插畫作品看起來就會比較生硬，這是我一直以來的困擾，也正在克服中。</p>', 'articleImage27', 4),
(28, '<h1>專訪灰塵魚：三年插畫接案經驗，教你兼差三大注意事項！</h1>', '<p>灰塵存在於空氣之中，易伴隨風的吹拂而四散至各處。 面對未知狀況有很多，他只想單純的畫下去，照著當下的想法去畫，放下不必要的煩惱，用灰塵般的精神...在低調塵埃裡悠游著</p><p>灰塵魚：唸了高師大美術系四年，只知道自己沒有成為當代藝術家的慾望，也沒有爭取教師鐵飯碗的意志，就只是單純地想要畫下去，不需要太多光環或是粉絲，我只要能一直畫下去就夠了；現在想來，我的生活及人生觀都濃縮在自己的筆名裡─灰塵魚，在低調塵埃裡悠游的魚。</p><p>畢業後的我開始密集練習電腦繪圖，實踐要一直畫畫的想法，每日一張小圖，且要求自己放到網路設計平台(黑秀網、StreeVoice)上的作品要完整、最少自我滿意度要80%，經過一段時間的作品累積後，便開始有設計公司及出版社主動聯繫，第一次接到案子時沒有太多狂喜，因為明白這只是一個開始，要面對的未知狀況還有許多，況且，若是真心想要一輩子創作的話，無論創作本身是否能獲利，都必須有所覺悟。</p><p>擁有插畫家的身份也快三年了，回憶我所經歷過的，發現其實最困難的事情不是”成為插畫家”，而是”應對工作室以外的世界”，台灣還不算是一個很會照顧藝術工作者的地方，整體社會對於智慧財產、創意價值方面的認知還沒有非常成熟，故會遇到不少想要剝削的客戶，甚至習慣被剝削的藝術工作者也不在少數，獨立接案者必須學著1.保護自己的尊嚴及專業，2.溝通技巧是必備的技能，3.手邊也要有一份公訂的價格表，好讓自己在報價時有所依據。</p><p>問：灰塵魚在創作時，有沒有偏愛的主題或風格?</p><p>灰塵魚：比較偏愛不自我設限，嘗試各種主題及風格。但是否應該迎合市場風格也經常是創作者要面對的問題，每個人的創作方式不一樣，有人將同一種風格表現到極致，有人喜歡嘗試各種風格，而我是屬於後者，我有迎合市場的風格，也有只想表達自我感受的時候，想要嘗試的題材跟媒材太多了，不必浪費時間拿風格的問題困擾自己，照當下的想法創作便是，無論做出了什麼，都會成為一種累積，對於生命的更深一層體會。</p><p>問：灰塵魚主要是透過什麼方式獲得創作靈感？</p><p>灰塵魚：對生活週遭的人事物保持一種敏感度，除了觀察表象之外，我認為思考很重要。</p><p>問：當遇到瓶頸時該怎麼做？</p><p>灰塵魚：個人遇到瓶頸通常是有心理因素的，必須先讓自己沉澱下來，仔細檢查自己的心理出了什麼狀況，可能是太在意市場走向，或是對未來感到焦慮等，看透自己然後放下不必要的煩惱。</p><p>問：灰塵魚投入插畫以來的樂趣與挑戰是什麼？</p><p>灰塵魚：我的創作狀態沒有稱的上”樂趣”跟”挑戰”的東西，但藝術創作對藝術家來說本就具有自我滿足的效果。</p>', 'articleImage28', 3);
INSERT INTO `blog_article` (`article_id`, `article_title`, `article_content`, `article_image`, `article_author`) VALUES
(29, '<h1>用圖畫紀錄感動的兼職插畫家-Uncle Alvin</h1>', '<p>看到Alvin的插畫，讓人感覺回到以前玩GAME BOY遊戲機，一種童心懷念的感覺，一個愛畫畫、旅行的人，發現到旅途中令人感動的事物不是壯闊的風景或雄偉的建築，而是一份美食、一個擁抱以及人與人之間最誠摯的互動。</p><p>人們每天辛苦工作所謂為何，賺錢當然是其中很大的目的，但如果只把獲取金錢當作唯一動力，久了難免就會變成為只懂得為錢工作的行屍走肉。所以不管是為了榮譽、為了理想抑或是為了讓家人有更幸福的生活，希望每個人都可以找到對工作的意義，因為這個意義可以讓我們 keep working。</p><p>我本身的工作是平面設計師，待過廣告公司和設計公司也因此接觸過很多類型的客戶。因為工作期間時常遇到很趕的案子；經年累月的加班型態使我漸漸失去對設計的熱情，甚至萌生轉行的念頭。</p><p>剛好這時候女友計畫去澳洲打工度假，我覺得這是個轉換心情的機會就決定一同前往，那一年的旅行我看到了跟台灣截然不同的生活與文化，發現到原來世界真的很大，也因為脫離了需要常常動腦構思創意的工作模式，得到很多跟自己對話的時間。</p><p>在旅行的途中發現到可以將生活中觸動人心的點滴，用圖畫記錄下來並將感動散播出去是一件很棒的事情，所以決定要善用本身的插畫專長創作更多作品，回台灣後經過一段時間的沉澱後設立了自己的粉絲專頁 Uncle Alvin 藉由這個地方抒發一個大叔的心情。</p><p>除了開設粉絲頁我還將作品放到黑秀網和Behance 等設計平台做曝光，也漸漸有人注意到我的作品並向我提出插畫和設計的需求。接案之餘如果有空閒的時間也會參加設計比賽，因為我知道自己不是特別厲害的人所以要更加的努力才行。</p><p>由於目前還有正職的工作，所以如何善用時間在正職與個人的創作間取得平衡是我很重視的環節。</p><p>問：Alvin可以分享一下你在澳洲旅行的經驗嗎？</p><p>Alvin：去澳洲打工度假對我是人生一個很大的轉變，在澳洲的前半年我是做園藝相關的工作；雖然薪資不錯，不過因為當地的物價很高，所以我們都住在背包客棧自己煮三餐，過著很簡樸的生活，雖然刻苦但是視野變得比以前開闊，心靈上也獲得很大的滿足，尤其是後半年我們到澳洲各地去做食宿交換認識了很多當地的朋友，他們爽朗率直的生活態度深深影響我，這一年即使遠離了設計的工作但是透過用心體驗異地的生活，我在創作的風格反而得到了啟發。</p><p>問：Alvin的圖，色彩都相當繽紛，那在創作時有沒有偏愛的主題或題材？</p><p>Alvin：雖然我看起來是個情緒很平的人但其實自己還想滿多的，常常需要補充正面的能量，所以看了有療癒感又能砥礪人心的圖畫，或是能給人警惕和反思的作品是我比較偏好的主題。</p><p>問：有沒有什麼特別的合作經驗？或是難忘的得獎經驗？</p><p>Alvin：學生時代起我就時常參加比賽，雖然有過一些成績不過卻沒有拿過大獎。從澳洲回來後或許是因為找到了屬於自己的風格；終於在前年和去年分別得到資訊月海報比賽第一名和 myfone 行動創作獎貼圖首獎，給了我很大的鼓勵也讓我更有動力繼續創作下去。</p>', 'articleImage29', 1),
(30, '<h1>年薪2百萬！Google提供線上課和證書，瞄準這3種開缺多又高薪的職位</h1>', '<p>不用讀大學，拿著一紙Google課程證書，就能快速找到高薪工作...這是Google最新的野心行動，試著填補現行教育和就業職能中間的斷層，更有望顛覆傳統教育市場。</p><p>去年7月，Google預告將推出新的職涯證書計畫（Google Career Certificates），日前他們釋出更多細節：Google在線上課程平台Coursera開設的3門課程將授予證書，包括專案管理、數據分析和UX用戶體驗設計。除此之外，之後還將開設一門安卓系統開發者的證書課程。</p><p>每一門課程由影片、閱讀教材和實際操作組成，理論上可以在6個月內完成。Google表示，課程由Google內部相關領域專家設計並授課，學完以後將習得找到相關工作的必備技能。</p><p>收費方面，每一門課都提供7天的免費試用期，之後每個月收費39美元（約合新台幣1,100元）；也就是說，如果你越快完成課程，花費就越少。商業雜誌《Inc.》指出，學完一門課程不到300美元，比許多美國大學生一學期花在教科書上的費用還少。除此之外，Google也提供10萬個助學金機會。</p><p>更重要的是，Google要讓拿到證書的人更容易找到相關工作。Google和130間企業合作，包括拜耳（Bayer）、德勤（Deloitte）、SAP、英特爾（Intel）等大公司，其中多間企業承諾未來幾年會聘用固定數量的取得Google證書的求職者。</p><p>Google發現就學、職能斷層，要提供落地且高薪的課程</p><p>Google執行長皮采（Sundar Pichai）指出，他們推出證書課程，是為了填補傳統教育和實際職場之間的斷層：「你不能認定下一代會自然學會需要的技能。」</p><p>身為全球頂尖企業，皮采表示「我們看見科技產業中許多職位空著，因為供需不匹配，然而仍有許多人急著想要求職。我們自問：『為什麼出現這個落差？』」</p><p>Google指出，一個原因是，出於社經或其他因素，並非所有人都能夠接受大學教育。除此之外，Google也發現，他們於2018年在Coursera推出的IT支援證書課程成為平台上最受歡迎的課程之一，其中高比例拿到證書的學員擁有弱勢背景，58%的人是黑人、拉丁美裔或女性，46%的人年收入不到3萬美元。有82%的學員表示證書在6個月內協助他們獲得升遷、找到新工作或成功創業。</p><p>這成為Google決定推出更多證書課程的契機，想要盡可能讓所有人都能負擔課程，以及教授落地、職場真正需要的技能。詳細來說，專案管理課程將讓學員學習敏捷專案管理以及實務策略性溝通技巧；數據分析課程將讓學員學習如何用Tableau工具以及R和SQL等程式語言來數據清理、數據分析和數據視覺化，進而能夠勝任初級或助理數據分析師的日常職責；UX設計課程將介紹UX基礎知識，並讓學員完成行動app、網站、跨平台體驗3個專案。</p><p>Google特意開這3門課程，瞄準的是這幾個工作不僅開缺多、入門薪水也高：專案管理工作的年薪資中位數為9萬3千美元（約合新台幣260萬4千元）；數據分析工作的年薪資中位數為6萬6千美元（約合新台幣184萬8千元）；UX設計工作的年薪資中位數為7萬5千美元（約合新台幣210萬元）。</p><p>Coursera執行長馬喬卡達（Jeff Maggioncalda）則表示，Google開的課更有另一巧妙之處，能夠面向職場中個性不同的人才：「職業IT支援證書很有價值，但它是一個需要面對顧客的工作。」而專案管理、數據分析、UX設計這些相異的課程能夠達到Google想要盡可能觸及越多求職者的目標。</p><p>Google加強搜尋引擎「找工作」功能</p><p>Google也致力於讓弱勢、難以取得大學學歷的人更容易找到工作，它在搜尋引擎的推出新功能，當人們搜尋「no degree jobs（不要求學歷的工作）」時，搜尋結果最上方會出現一個新欄位，顯示不要求學歷的工作機會，也可以依據教育程度和工作經驗篩選工作。</p><p>Google發現，疫情中上網搜尋「沒有工作經驗如何找工作」、「不要求學歷的好工作」的數量飆升750%。</p><p>藉由課程證書計畫和搜尋引擎功能更新，Google不僅展現試圖解決職場學用落差問題的決心，也代表它正式進軍廣大的教育市場。目前，Google也正在跟學習科技公司Guild Education合作，預計未來替其他企業如迪士尼、沃爾瑪提供證書課程，開始做幫其他公司「培訓」的生意。</p>', 'articleImage30', 2),
(31, '<h1>台灣首場動漫同人NFT特展「開拓NFT祭」邀您一同前進元宇宙</h1>', '<p>作為動漫圈永遠的開拓者，自Covid-19爆發後，開拓動漫祭籌備委員會就一直思考不被疫情影響、持續舉辦同人活動的辦法。在文化內容策進院支持下，開拓動漫嘗試開發虛擬世界的活動平台，並於迎接FF38復活同時推出虛擬特企「開拓NFT祭」。內容包括同人NFT特展、虛擬同人攤位、虛擬歌手舞台秀等。活動將於02/11(五)FF38前夜登場，準備好您的虛擬錢包，一起前進元宇宙吧！</p><p>本次特企邀請22位知名繪師、漫畫家、Cosplayer、Vtuber等，以「賀！FF38復活」為題繪製數位賀圖，並使用區塊鏈技術鑄造NFT（Non-Fungible Token，非同質性貨幣），為每張圖領取虛擬世界的「原版認證」憑證。賀圖上鏈後將以卡包形式限量推出，每份卡包內含一張賀圖，同時為感謝同好支持，另附贈FF38貴賓票一張，歡迎前來實體會場同樂！</p><p>「開拓NFT祭」前夜祭將在02/11(五)19:00-21:00登場！只要使用電腦下載並登入應用程式，就有機會搶先買到限量卡包。若未能在前夜祭期間登入應用程式，02/11(五)21:00之後將開放NFT交易平台「Jcard」開拓專區的販售頁面，可直接在其上購買，或進行後續轉讓交易。歡迎有興趣的同好提前註冊Jcard帳號，以加速購買程序。</p><p>開拓NFT祭</p><p>開展日期：2022/02/11 (五)19:00起<br>前夜祭時段：02/11(五)19:00-21:00（18:00即可登入應用程式，但19:00正式開展後才可進入會場）</p><p>開拓動漫官網：http://www.f-2.com.tw/<br>應用程式載點：http://ff.wowwow.tw/（目前僅支援Windows，會陸續增加可使用之作業系統與裝置）<br>NFT交易平台「Jcard」官網：https://www.jcard.io/life/tw/FrontierAnimeCoLtd</p><p>※02/11(五) 19:00-21:00 僅支援開拓動漫前夜祭應用程式導購，21:00之後將開放NFT交易平台「Jcard」開拓專區的販售頁面。</p>', 'articleImage31', 5),
(32, '<h1>除了成為藏家、走進美術館之外，還有什麼途徑可以感受藝術品呢？</h1>', '<p>【藝術銀行的軌跡】</p><p>「OPEN ART BANK -剖開藝術銀行」透過數字密碼、影音故事及動畫短片等呈現藝術銀行專業業務內容。圖/藝術銀行提供</p><p>藝術銀行2013年成立，在文化部的推動下以「只租不賣」的藝術品租賃服務，向公私立的機構推薦優質的藝術品。今（2021）年五月，體制由國立臺灣美術館代辦改制為財團法人臺灣美術基金會執行。為過去八年所建立的品牌，揭開了新階段的序幕。並立基於新制度之上，期許為台灣的藝術界提供更深層多元的支持。</p><p>回望藝術銀行一路走來。最初階段主要以舖網為主要策略，向各界推廣藝術銀行的業務。透過定期舉辦講座、說明會，為不同產業進行引導式的介紹。接著在客群和續租率穩定成長的第二階段，藝術銀行開始因應需求，為不同機構媒合藝術家、辦理員工教育、藝術工作坊等活動。到了近期的第三階段，藝術銀行團隊正著手進行品牌價值的延伸。以聯名、交流的模式，策辦不同型態的展覽。讓庫房內購藏的藝術品有機會體現出更多樣的價值。</p><p>【轉型與購藏】</p><p>隨著客群的成長，藝術銀行所接觸到的需求越來越多、越來越客製化。這也推動著團隊需要重新審視除了租賃之外，還有什麼方法可以活化長期累積的購藏資源。在這樣的情況下，曾經的制度漸漸顯得不足。為了讓更多的方案得以實踐，藝術銀行進行了約一年的討論。接著自今年五月落實改制，為更長遠的未來做好接受挑戰的準備。</p><p>「財團法人臺灣美術基金會」原也是國立台灣美術館編制下的組織。在本次改制之中，肩負起了支援藝術銀行運作的任務。也就是說，基金會和銀行兩者都從美術館的編制中獨立了出來，成為了直接由文化部監管的主體。在改制為法人體質之後，藝術銀行將漸漸從曾經的體制鬆脫。進而為新項目的擴展提供更自主、更加具有活力的空間。</p>', 'articleImage32', 4),
(33, '<h1>鼓勵使用者贊助開源專案，GitHub推出僅供贊助者使用的儲存庫</h1>', '<p>GitHub更新贊助者功能Sponsors，現在開發者可以針對不同的贊助者層級附加儲存庫，根據不同的贊助金額釋出不同版本的軟體，除此之外，GitHub Sponsors也有其他功能更新，以協助專案開發者推廣和管理贊助。</p><p>近年開源專案被企業吃豆腐案例頻傳，不少開源專案指控企業白用不回饋，包括原為開源專案的Redis模組、CockroachDB、MongoDB和Elasticsearch等，都紛紛更改授權，避免被雲端廠商濫用。近期的案例，還有在GitHub上的知名套件Faker和Colors，其作者Marak Squires因為不滿多數財星500大企業都有使用他們套件，但是開發團隊都僅收到來自開源社群和GitHub Sponsors微薄的贊助，因此一氣之下清空GitHub儲存庫，決定要對專案開始收費。</p><p>GitHub上的開源程式碼雖然可供任何人免費使用，但是多數專案維護還是需要有資金贊助，才能穩定地持續下去。GitHub在2019年的時候開始Sponsors計畫，讓贊助者可以直接在GitHub頁面上，贊助開源貢獻者。</p><p>現在GitHub進一步更新Sponsors贊助功能，或許有望讓GitHub上的開發者，能夠獲取更加公平的收入與回饋。GitHub提供僅有贊助者可以存取的儲存庫，當專案開發者啟用該功能，便可以將私有的儲存庫附加到各個贊助層級，而這授予不同金額贊助者，存取各層級儲存庫的權限，也就是說，專案開發者可以針對貢獻者捐獻的金額，發布不同版本的程式碼。</p><p>官方提到，專案開發者可以將僅限贊助者使用的儲存庫，應用在各種用途，包括提供僅限贊助者存取的專案，並且和贊助者討論與交流問題，或是在程式碼開源之前，讓贊助者搶先體驗新內容。開發者現在也可以針對每一個贊助層級，編寫一段客製化訊息，當有任何新的贊助出現時，這段訊息可以歡迎贊助者，並且指引他們執行專案的方法。</p><p>GitHub Sponsors的其他新功能，還有讓專案開發者，對自定義贊助金額擁有更多控制權，能夠設定贊助最低金額，並會在Issues頁面加入贊助訊息，提醒使用者採取行動資助開發者。開發者可以在贊助頁面URL附加後設資料，以便查看贊助來自何方，像是開發者可以在發布關於專案貼文時，於贊助網址加入特殊的後設資料，便可以在交易資料匯出時，查看收集到的後設資料。</p><p>GitHub提到，他們接下來的工作，將會使企業進一步支援他們所仰賴的開源專案，並且讓可贊助專案更容易被探索。</p>', 'articleImage33', 3),
(34, '<h1>API 到底是什麼？ 用白話文帶你認識</h1>', '<p>當你上Google搜尋 API，你會看到它解釋為 應用程式介面，也就是Application Programming Interface 的縮寫，扮演應用程式和應用程式之間的橋樑。API 就像一個介面，可以幫助開發者節省精力，並很快的達到目的。舉個例子，假日出去玩總是玩到很累，口乾舌燥，讓人很想去飲料販賣機投瓶奶茶來解渴。好，現在你面前有一台飲料販賣機，接下來你會這麼做：<br>1.你想喝一瓶奶茶<br>2.你按了飲料機上的奶茶按鈕<br>3.你從取物口拿出奶茶</br>這其中就蘊含了 API 的概念，我們更進一步思考，剛剛例子中的奶茶就是「你想取得的資料」。而飲料機上的按鈕就是 API ，按下去飲料機就收到了你的需求，並將奶茶從取物口送出，你也就得到了你想要的資料了。</p><p>用上面飲料機例子的觀點來思考另外一個範例：「店面與倉庫」；通常，一間商店店面的「商品擺設、配置」，和後面倉庫的擺設配置會是不一樣的，今天如果有一個負責把貨物從倉庫擺放到店面的員工，他必須要知道擺放的規則，可能是要配合商店的行銷企劃，可能是要擺的整整齊齊、一目了然。</p><p>在這個「店面與倉庫」的例子裡，商品就可以想成是數據，而倉庫就好比是資料庫，店面則好比是我們平常使用的網頁或是APP，而負責把商品從倉庫擺放到店面的員工就扮演著 API 的角色，依照著某種規則、協定(行銷企劃、商品的擺放規則)在運作著，而我們不必知道他是怎麼運作的。</p><p>如果一直從字面上的介面去思考，AP「I」 (Interface) ，其實有點難搞懂它的概念。簡單來說，它就像是可以讓你用的一個函式庫。呼叫你想要使用的函式，並給予相對應的參數，函式便回傳給你結果，流程大概是像這樣。</p><p>基本上，不管做什麼事情、寫什麼樣的程式都會用到 API 這個概念，除非你從頭開始編寫每一行程式碼，否則你一定會和外面的一些組件進行互動，而幫助你能夠和這些組件互動的接口就是 API。</p><p>即使你完全是從頭開始寫你的程式，一個漂亮的應用程式也會有供內部使用的 API 來幫助組織你的程式碼，除了方便維護程式碼，也能讓特定的功能重複使用性提高，增加效率。最重要的是，使用 API 的過程時，你不需要知道其內部程式運作的邏輯或演算法，你只要告訴 API 它需要知道的事，它就會把你想知道的結果帶來給你。</p>', 'articleImage34', 1),
(35, '<h1>「黏」住你的敏捷力！敏捷團隊靠便利貼強化溝通效果</h1>', '<p>敏捷開發與思維的三道心法──小增量、蒐集回饋、持續迭代，大幅提升開發團隊成員的溝通頻率，無論是與客戶或是與團隊成員的溝通。唯有為客戶創造價值、為公司帶來效益，才能肯定自己身為團隊成員、身為產品開發者的存在意義。所以開發前，開發團隊成員會仔細釐清任務內容與目的；開發中也會不斷確認開發方向是否符合期待；開發後再藉由自省會議（Retrospective）來迭代產品或製程。</p><p>團隊敏捷是否落實？觀察便利貼成撇步</p><p>因此，面對面溝通是敏捷相當強調的一件事情。走進新加坡商鈦坦科技，隨處可見「低科技高感知」（Low tech High touch）的便利貼蹤跡，辦公空間碩大的看板上，不同顏色的便利貼區分不同性質的任務；所有成員的任務及進程一覽無遺，站在看板前的夥伴看著便利貼就事論事，人與人因為這樣的實體接觸，更專注在討論的主題上。</p><p>新加坡商鈦坦科技導入敏捷開發後，密切使用便利貼來促進團隊溝通。<br>「其實鈦坦剛導入敏捷的時候，我覺得這樣到處貼便利貼很浪費紙，而且便利貼上面的字有的大、有的小、有的細、有的還用奇怪的顏色寫，閱讀起來超麻煩的！也曾經想過怎麼用電腦的方式來取代便利貼。只是隨著團隊運作、熟悉了之後，我才發現到便利貼的實質功效，不僅止於方便移動、具體可見，還附帶著促進成員溝通、互動，凝聚團隊注意力等效益。所以後來我都從便利貼的使用，來判斷團隊的敏捷是否有落實。」鈦坦戰略顧問林裕丞 Yves 分享了自己的經驗。</p><p>鈦坦科技經過反覆實驗、測試，選用特定的便利貼品牌，避免因黏性不佳造成移動脫落的困擾，並且在便利貼旁一定會放置簽字筆，方便夥伴書寫出清楚的字跡，也能因為筆畫較粗，防止同事撰寫時長篇大論，拉長了閱讀理解的時間。</p><p>隨著便利貼使用的時間一久，各種更符合人性的新功能也被開發出來。在便利貼的形狀與顏色方面，開會時可以將想法寫在正方形便利貼上，將類似的想法移動到一個區塊之後，再以長形便利貼命名該區塊的想法；又或者在人數多又希望快速針對不同議題表態時，可以直接用顏色作區隔──舉藍色便利貼表示「同意」；舉紅色便利貼表示「有顧慮」等等，便可快速篩選與會者的意向。</p><p>便利貼的內容書寫方面，鈦坦員工一般在自省會議後，會將結論或行動貼在看板旁邊，協助團隊記憶或追蹤進度；有時，也有人在心型的便利貼上書寫感謝或肯定，遞交給他人，傳達正面的訊息，收到的人可以貼在自己的座位當紀念；甚至，許多人會隨身攜帶便利貼，無論在辦公室內、辦公室外、無論在開會期間、或是外部活動，隨時拿出來做紀錄，讓大家的想法、記憶「可視化」，幫助回顧與共同學習。到最後，便利貼也在鈦坦科技裡發展出娛樂功能，在聖誕節時，將耶誕老人投影在牆面上，大家再用不同顏色的便利貼黏貼，使之呈現投影的圖案。</p><p>新加坡商鈦坦科技靈活運用便利貼，不僅採用顏色分類，更把它黏貼成聖誕老人的圖案，增添使用的溫度。新加坡商鈦坦科技靈活運用便利貼，不僅採用顏色分類，更把它黏貼成聖誕老人的圖案，增添使用的溫度。</p><p>隨著疫情變化，鈦坦開始嘗試全員遠端、混合辦公的數位管理模式，從過去崇尚實體的運作模式，投入成為 Atlassian 代理商，學習 Jira 及 Confluence 等線上敏捷專案管理工具操作。儘管開發團隊已經非常熟悉這些協作工具，不過便利貼依然是他們無法在實體辦公室割捨的必要工具之一，使用起來多元彈性，既具體可視，讓工具不只是工具，拉近了人與人之間的距離，很大程度地促進了討論與開發的品質。</p><p>便利貼幾乎與鈦坦科技的敏捷畫上等號，並不是因為便利貼多麼炫目、創新，而是它能夠最有效地提升團隊工作品質，在每一次短衝（Sprint）週期扮演非常重要的角色，幫助開發團隊成員快速釐清待辦清單的進度，更有效率達成任務目標！</p><p>對於導入敏捷的實戰步驟感到好奇？究竟這些開發方式如何套用至公司內？歡迎前往 敏捷工作術：導入實戰全解析課程，吸收來自鈦坦第一線夥伴的分享內容，在辦公室展開敏捷行動力！</p>', 'articleImage35', 2),
(36, '<h1>不懂美學也能用！Figma助團隊快速完成設計，如何讓Airbnb、Google都成客戶？</h1>', '<p>近幾年，全球越來越重視設計美學，不管是個人還是企業，是學校作業還是建築物，「設計美學」都成為重要的考量因素；美國線上介面設計工具Figma順應時代需求，推出一系列線上設計功能，不僅獲得民眾廣大的迴響，更成功打開市場知名度，快速吸引Andreessen Horowitz、Index Ventures、Greylock、Sequoia Capital、Kleiner Perkins、Durable CapitalPartners等來自世界各地的企業及投資機構投資，讓Figma成立不到4年，公司估值就突破10億美元（約277億新台幣）大關，迅速加入新創獨角獸行列。</p><p>2020年，Figma完成D輪融資後，公司估值快速翻倍，達到20億美元（約554億新台幣）；去（2021）年，Figma在最新一輪的融資中，獲得2億美元（約55億新台幣）後，公司估值大幅飆漲至100 億美元（約2770億新台幣）。</p><p>Figma的兩位創辦人迪倫·菲爾德（Dylan Field）和埃文·華萊士（Evan Wallace)在就讀布朗大學期間，就開始構思線上設計工具；2012年，華萊士從布朗大學畢業，菲爾德則選擇退學，接受泰爾獎學金（Thiel Fellowship），該獎學金提供10萬美元（約277萬新台幣），兩人因此萌生創業的念頭；隨後，兩人移居到美國舊金山，並全心投入開發線上設計平台；2015年12月，兩人採線上邀請模式，提供民眾免費預覽該平台，並根據民眾的回饋，進一步地修改該平台的功能；隔（2016）年，兩人就公開發佈Figma。<p><p>Figma是一個使用者介面/使用者體驗（User Interface/User Experience, UI/UX）的線上介面設計平台，提供使用者各種設計美學所需的工具，讓使用者可以透過該雲端平台的功能，設計出各式各樣、別具一格的使用者介面；此外，Figma還提供團隊進行「多人協同合作」開發，讓團隊成員能在平台中共同討論及繪製精美的使用者介面。</p><p>儘管市面上已有Sketch、Adobe XD、InVision等多種設計工具；不過，Figma最特別的地方在於它不僅僅是設計師的設計工具，而是一個團隊的設計工具；Figma利用簡單明瞭且容易上手的平台介面，吸引整個團隊（包含設計師和非設計師）的人才都到Figma平台上共同設計及討論各種專案，創造一種跨界的網路效應。</p><p>目前，Airbnb、Google、金百利克拉克等各行各業的大型企業皆已是Figma的客戶；紅杉資本合夥人安德鲁·里德（Andrew Reed）更曾公開表示，他認為Figma 將會是一個跨世代的公司（generational company）。</p><p>另外，Figma的創辦人兼執行長迪倫·菲爾德（Dylan Field）也在部落格上表示，「Figma 的願景是讓所有人都能設計，並且讓任何團隊都以設計優先的方式去思考、感覺和工作。」因此未來，Figma將繼續開發更多設計功能，並積極開發社群功能，以期能早日實現Figma的成立目標。</p>', 'articleImage36', 5),
(37, '<h1>匯聚台灣年輕設計力 新一代設計展6/1線上開展</h1>', '<p>台灣新銳設計年度盛事「新一代設計展」，1日線上盛大開展。今年受COVID-19疫情影響，取消往年連續4天的實體展覽，線上展則維持如期展出，匯聚全台59校、131系、約4,000件學生設計作品，並首度提供虛擬展間平台，讓參展校系發揮創意，打造專屬的沉浸式3D擬真展覽，為線上展更添精彩。</p><p>同時邀請英國倫敦皇家藝術學院、日本多摩美術大學等國際頂尖設計院校學生跨海參展，並邀請華碩電腦等知名企業短講，規劃產學合作對談、參展校系線上分享等活動，以促進更多產學互動與國際交流。線上展自即日起於新一代官方網站，不限時段免費瀏覽，歡迎設計同好、各界企業朋友共襄盛舉。</p><p>由經濟部及教育部共同指導、經濟部工業局主辦、台灣設計研究院執行的「新一代設計展」，自1981年創辦迄今，是台灣青年學子展現創意設計能量的絕佳舞台，亦為企業發掘優秀設計人才、促進產學交流的重要平台。近年新一代設計展不斷精進變革，官方網站除了作為線上展覽平台，並設有媒合功能，讓企業可直接線上洽約，協助業界發掘優秀適宜的設計人才，也幫助同學創造更多就業機會。</p><p>今年首度提供的虛擬展間平台，讓參展作品皆有專屬展示空間，以三維空間尺度展現學生作品，帶給觀眾猶如親臨實體展場般的沉浸式觀展體驗。此外，還可以欣賞到「第八屆新一代設計產學合作」計畫作品，每個企業出題皆以個別展間呈現，一次看到不同學生解題的精彩創意。</p><p>同時規劃一系列的線上講座活動，包括兩場「企業短講」，邀請華碩電腦、羅技電子、春池玻璃、必應創造、家樂福、5% DESIGN ACTION社會設計平台等國內知名企業或業界設計師，與年輕學子分享不同領域的設計服務業趨勢、未來職涯規劃等議題；三場「產學合作分享」講座，則邀請「第八屆新一代設計產學合作」計畫出題企業及獲獎作品團隊參與，透過「企業與學生對談」、「學生與學生對談」等不同角度，分享企業如何藉學生創意提案激發內部創新能量，以及學生在企業實務指導中強化專案執行能力的珍貴經驗。另規劃一場「學生短講」，邀請本次參展校系學生分享地方創生主題相關作品，讓更多人看見年輕學子以設計為地方提出解方的創意與行動力。</p><p>本屆線上展內容橫跨產品與工藝設計、視覺傳達設計、數位多媒體設計、空間與建築設計、服裝與時尚設計、跨領域整合設計等多元領域，並邀請來自印度、香港、墨西哥、泰國、英國、芬蘭、日本、馬來西亞之國際頂尖設計院校學生，與日本大阪國際學生創意獎（ISCA）2021獲獎作品跨海參展，讓台灣設計學子透過線上展平台與國際優秀青年設計師交流。</p><p>新一代設計展自2020年至今已累計展出近萬件作品，為集結台灣逾百所設計科系人才及作品的重要資料庫，不僅網站瀏覽量逾400萬次，媒合數更達4,000多筆，創下良好展覽效益。線上展不受時間、空間或參觀人數的限制，只要一鍵連結即可線上觀看。線上展自即日起開放瀏覽，歡迎對設計有興趣的民眾前往官網逛展，將好設計分享給週邊朋友，一起支持台灣年輕設計力發展。</p>', 'articleImage37', 4),
(38, '<h1>2022-2023 環境關懷設計競賽徵件開跑！高額首獎等你拿！</h1>', '<p>行政院環境保護署為鼓勵全民對於「永續發展」「跨界創新」與「創意實踐」的認同與落實，提供不同領域的專業人士一跨界交流與創意表現的舞臺，特舉辦本競賽。</p><p>*參賽資格<br>凡具有中華民國國民身分，均可以「個人」或「團體組隊」（參賽者可跨隊）方式報名參加。</p><p>*報名費用<br>免繳報名費</p><p>*競賽主題<br>凡以「永續發展」、「跨界創新」與「創意實踐」之「環 境關懷」設計提案均可參賽。作品可針對身體、家庭、工作、玩樂與學習及社區等五個 範疇進行思考，以創意、創新解決人類所面臨的「在地困難、 全球挑戰」為目標。五大範疇之設計思考面向，加以說明如下：<br><br>● 身體：解決與身體相關之設計提案，思考所面對之食物、飢餓、健康、永續生存與安全等在地與全球挑戰。<br>● 家庭：解決與家庭相關之設計提案，思考所面對之城市、住居、永續生存、水資源、衛生、能源、數位化與安全等在地與全球挑戰。<br>● 工作：解決與工作相關之設計提案，思考所面對之金錢、失業、貧窮、工作條件與數位化等在地與全球挑戰。<br>● 玩樂與學習：解決和玩樂與學習相關之設計提案，思考所面對之數位化、教育、休閒、多樣化與普及化等在地與全球挑戰。<br>● 社區：解決與社區相關之設計提案，思考所面對之不平等、能源、環境、氣候、基礎建設、交通、溝通/傳達與安全等在地與全球挑戰。</p><p>*徵件作品類型<br>歡迎與「環境關懷」相關的作品參賽，可包括：工業設計 /商品設計、建築設計、視覺傳達設計、數位媒體設計、機電工程設計、環境教育、服務設計與相關技術應用等相關類型皆可。</p><p>*徵件方式<br>請於競賽官網線上報名及繳件，報名及參賽作品繳件截止日為111年11月13日（星期日）</p><p>*頒發獎項<br>第一名：獎金新臺幣100,000 元整，獎狀一紙，1名。<br>第二名：獎金新臺幣 50,000 元整，獎狀一紙，1名。<br>第三名：獎金新臺幣 30,000 元整，獎狀一紙，1名。<br>佳 作：獎金新臺幣 5,000 元整，獎狀一紙，5名。</p><p>※獲得前三名的得獎者（得獎者若為團隊，每隊至多 補助1名）由主辦單位經費補助安排赴具有成功環保與低碳產業 經驗的丹麥，進行環境關懷設計交流活動。獎金須依臺灣地區稅法先行扣繳個人所得稅（所得稅率:10%）。</p><p>※入圍決審者需繳交模型/原型並進行口頭簡報，以為決審評選。每位決審入圍作品模型製作費用，最高補助10,000元整。</p><p>*聯絡及報名※競賽官網：http://epadesign.tw<br>※洽詢電話：886-7-3876841 李小姐<br>※電子郵件信箱：epaepa2021@gmail.com<br>※如有未盡事宜，主辦單位得隨時修正並於2022-2023環境關懷設計競賽活動官網公告之。</p>', 'articleImage38', 3),
(39, '<h1>國際設計大獎展　「旅美建築設計師莊捷婷個展」虎尾科大登場</h1>', '<p>虎尾科技大學今、明二日，於綜三館舉辦「旅美建築設計師莊捷婷個展」，展出「穿透城市」及「家中的中國城」兩件設計作品，以平面海報與實況影像呈現其空間設計。設計師莊捷婷2020年畢業於美國加州大學洛杉磯分校(UCLA)建築研究所就學間獲得「傑出獎」殊榮，並通過「美國綠建築專業人員」證照。致力融合建築和大眾媒體的表現形式，呈現永續環保議題。</p><p>「穿透城市」為莊捷婷與三個來自中國、韓國與美國的建築設計師團隊所共製，並獲得2021年洛杉磯美國建築師協會（AIA LA）2乘8展覽（2x8）的展場設計權，以及義大利A\'國際設計大獎賽(A\'Design Award & Competition)室內設計和展覽空間類優勝獎。</p><p>「穿透城市」提出了與洛杉磯不同社區對話的展覽方式，利用塑膠籃組裝後產生虛實交錯的牆面，在展覽空間中模糊了牆體的邊界。塑膠籃本身的紋理在陽光照耀下於地面投射出有趣的陰影，且其彈性能夠適應不同的展覽場地，這個熟悉的元素也能喚起大眾的共鳴，使得這個展覽裝置更為有趣。</p><p>為貫徹物質的永續利用，當地展覽結束後做到最小程度的浪費，讓所有材料都可再利用並回饋在地社區，該團隊將塑膠籃捐贈予在地機構，提供不同機構以儲藏、園藝、食物配送等功能來使用，賦予塑膠籃新生命。</p><p>另一項作品「家中的中國城」是以洛杉磯中國城作觀察延伸之設計。不少大城市都有富含在地特色的中國城，華人文化的適應性使得其在保有中式建築的特色下，依然能適應當地特殊的環境與風土民情。洛杉磯的中國城由簡單的幾何為建築基礎，加上經過簡化的裝飾，例如：扁平的中式窗稜、彩繪圖騰、簡單的屋瓦，並運用獨屬於南加州的繽紛色彩，十分具有在地特色。設計師透過物件轉化，讓家中的日常物件也呈現了中國城的有趣樣貌。</p><p>現場以平面海報展出設計師的空間設計，也透過影像呈現作品「穿透城市」於2乘8展覽的360度室內全景實況，讓觀眾可跨越時空，體驗當時的展覽空間；並播放「家中的中國城」建築遊戲影片，將其設計概念運用遊戲方式讓使用者參與設計過程，安排屬於自己「家中的中國城」。</p><p>虎尾科大校長張信良表示，大學提供給學生的養分包含內在涵養的陶冶，其中設計資源也相當重要，此次的設計展出運用日常生活媒材發揮設計創思，其中不同媒材與多媒體呈現，以及從設計展現愛惜資源的永續行動，都是學生很好的學習範本。</p>', 'articleImage39', 1),
(40, '<h1>打造虛實舞台的策展策略 －2022 臺灣國際光影藝術節 - 光‧舞弄‧影</h1>', '<p>「光‧舞弄‧影」，以「光之劇場」表演性裝置(Performative installation)，邀請每個觀眾在嬉光、舞光、弄影之間，成為「美」。是企圖在台灣各地此起彼落、競相舉辦的各種以光為題的節慶活動中，以策展建構國美館光影節的主體性與藝術深度，將夜間美術館戶外空間，轉換成為數位藝術展覽的黑盒子展場，展現台灣藝術與科技跨域創作的能量，同時討論「數位光」，成為建造數位個體的介面與所在，在線上與線下的世界中，成為個人建造虛實舞台的載體與媒介。</p><p>Marlies Wirth認為表演 (Performance)在西方現代藝術中已經確認自己的地位，不僅是一種媒體公眾的呈現方式，而且是一種“景觀藝術實踐”(scenic art practice)，企圖創造一種可能性空間，尋求發展一種美學策略來探索，再現與場景、遊戲與嚴肅、真實與想像之間，越來越微妙的界限。裝置(Installation)作為藝術、設計和建築中的一個特定作品概念，以在空間中透過感受創造體驗，建構屬於個人的感受語境。“表演性裝置”將表演的事件特徵與裝置的物質性聯繫起來，因此促進行動和體驗的同時性，亦使藝術生產（作為一個過程）的事件特徵在裝置中繼續被感受到。Nollert(2003)認為表演性裝置結合了存在和表現、短暫和永久的元素、非物質性和物質性，通過構建的情境呈現現實，為敘述和交流提供空間可見性。在“表演性裝置”中觀眾被要求，繞著陳列物件走動，或與這些作品物件相互作用，提供現場觀眾觀看，參觀展覽成為參加一次 “表演”，並且在空間中感受特別的氛圍。</p><p>由台灣、日本、澳洲、法國的10組藝術家，以藝術、科技與表演之跨域創作的精神，打造的10組表演性裝置「光之劇場」，以光、影、音，創造三種不同的展演情境，「光影劇場」、「光景舞台」、「光遊界面」，重新定義「光」在表演中的主體與客體角色，建構民眾的「觀看」與「互動」的觀展行為與感知經驗，將觀者從「觀看與參與的介入者」轉換成為「不可缺少的作品主體」的身分。作品的意義，非僅是存在於物件與光所打造的炫目的視覺美感與物件造型中，而是在作品透過所建構的程序系統、訊號轉譯與電訊再現的傳訊中，引導觀者的參與過程中，作者、作品與觀者的主客體關係是流動與多變，也是劇場的表演者、情境的創造者、故事的敘述者與訊號的再現者。</p><p>然而，「光之劇場」並非僅存於實體現場，民眾的自拍上傳分享，將實體展演擴延至虛擬社群中，在社群媒體中形成另一種競演秀(圖1)。策展人策略性邀請大尺幅的魔幻作品Atelier Sisu（澳，團隊）《轉瞬即逝》，以兒時泡泡為主題，再現為巨大可進入的劇場世界。觀眾在現場擺出各種陶醉、慵懶、隨意、可愛的姿態，再經由軟體編修創造出各種情境色彩，加入特效物件，甚或搭配觀展心得、感受小詩或回憶故事，在社群平台中建構出屬於自己的虛擬表演性裝置現場。</p><p>在數位互動藝術的作品場域中，藝術家以科技所創造視覺知覺與身體感知的空間場域，當觀者進入作品時，觀者成為參與者也成為作品，在觀看中體會影像的符碼意義，在互動參與中，創造感知經驗並與自身的知識記憶融合產生回應。10組國內外藝術家創作的表演性裝置作品中「光」是藝術家與觀眾一起創造的事件，共創出與作品的共生力量。觀眾在嬉光、舞光、弄影之間，感受光的美感，沉浸於光影所打造的魔力舞台當中，卻也成為作品中的「光」，在線上與線下，創造出屬於自己的敘事情境與舞台展演。</p>', 'articleImage40', 2),
(41, '<h1>張潔平落腳西門町開獨立書店「飛地nowhere」：我不希望這裡變成香港的墓碑</h1>', '<p>台北市西門町又多一處獨立書店，《端傳媒》前總編輯、Matters平台創辦人張潔平，日前接手位在中華路、西本願寺旁巷內的店面，取名為「飛地Nowhere」，今（23）日正式營運。張潔平接受《中央社》記者訪問時表示，這裡更像是一處小型博物館，有各種大大小小的策展，「我希望它不停地跟讀者對話，希望讀者因此被呼喚出一些熱情，讓他們有非來不可的理由」。</p><p>書店以「飛地Nowhere」為名，張潔平解釋：<br>「不管你的肉身在哪裡，不管你身處哪個主權國家，但你內心都有一種抽離出這片土地的執念，你執著於某個地方。就像許多人可能跟我一樣，不管到哪裡，都會認為自己身處在一個叫做香港的飛地」。張潔平進一步指出，「我不想讓大家覺得香港是個墓碑，我不想讓這裡變成一個靜態的香港，讓大家只是來緬懷，香港的豐富性跟複雜性，不是一次社會運動的挫敗能夠定義的，我希望香港的活力能在這裡被展現出來。」</p><p>「飛地Nowhere」的前身先是「電光影裡書店」，後是「意念書店」，老闆都是香港人，張潔平說，去年底得「意念書店」確定要結束營業，她特別趕在最後一週前去光顧，卻發現現金沒帶夠，還差500元，正要放回兩本書，老闆羅良君跟她說：「沒事，書你先帶走，下次來，再給我錢就可以了」。張潔平頗為感動，又覺得這家書店收了很可惜，於是打電話向房東打聽店租行情，又問是否有人要接手？聽到房東說有一家美甲店、一家塔羅牌店來問過，張潔平大驚失色，她不希望習慣來這裡看到書店的香港朋友失望，瞬間決定要把書店接下來。</p><p>張潔平說，雖然她從未開過任何一家實體的店，但她小時候就非常愛逛書店，幾乎沒有空手從書店離開過。此外，不管是到哪個城市，張潔平只要去旅遊，一定不會放過任何一家獨立書店，「我是一個獨立書店的瘋狂愛好者」。張潔平說，這家店會有各種展覽的呈現，「我希望用辦展覽跟辦雜誌的方式來開店，書在這裡不會是圖書館式的陳列，而是個展覽，裡面有強烈的訊息要告訴來逛書店的人。」</p><p>張潔平說：「我希望即使我庫存有2000本書，但我架上只要擺500本，它的主題會是很強烈的，它要真的跟來的人對話。而不是說這家店在這裡，你想來就來，你不想來就不來，最後撐不下去了，結束了，你在網路上說好可惜啊，就沒了，這對書店而言是不健康的事。」飛地書店4月17日試營運時就先舉辦了一場小型展覽，展出10名離散在世界各地的香港攝影家的作品，這些照片都在他們各自署名的香港護照上呈現，翻開護照即能欣賞作品，「這個展覽本身就很『飛地』」。正試營運之後，預計在6月舉辦一場以香港粵語歌為主題的展覽，展出潘源良、黃霑、林夕、黃耀明的出版品或唱片，另將邀請近年定居台灣的潘源良舉辦講座。</p>', 'articleImage41', 5),
(42, '<h1>忠泰美術館五週年展《生生LIVES：生命、生存、生活》：將藝術帶出美術館，融入於城市、市民與生活</h1>', '<p>COVID-19（嚴重特殊傳染性肺炎、新冠肺炎、武漢肺炎）從2019年底肆虐至今，已從例外變成日常，現在／未來如何與「病毒共存」成了各界思考的首要議題。而忠泰美術館將於3月19日推出的五週年展《生生LIVES：生命、生存、生活》，便是在COVID-19時代下萌發出的策展方向，試圖透過此展，省思與探問最根本卻也最基進的主題：「生命」、「生存」與「生活」。</p><p>忠泰美術館五週年展《生生LIVES：生命、生存、生活》，主題與架構設定，源自於2019年開始，忠泰美術館內部團隊持續定期的研究會議，而共同摸索與凝聚出議題，定為名詞「生／LIFE」與動詞「生／LIVE」的結合《生生LIVES》──聚焦於「生」的複層解讀之後，便邀請蔡宏賢與鄭慧華擔任本展共同策展人，李明璁、洪廣冀及鄭陸霖擔任策展顧問，聯手多位跨領域專家，企圖以跨領域的對話與思考，探討在科技與人文交織的當代，面對未來，我們將何去何從？</p><p>此展籌以「未來」為主軸，籌備備過程從2019跨至2022年，涵蓋「生物藝術」、「人工生命」、「基因工程」、「科技倫理」、「人與環境」、「跨物種與性別階級」等多元議題探索。更邀請來自德國、加拿大、美國、英國、中國、丹麥、台灣等共12組藝術家參與展出，包含Charlotte Jarvis、dividual inc.、Ed Atkins、Lynn Hershman Leeson、Nicholas Bussmann、Peter Sasowsky、SUPERFLEX、何采柔、張欣、鄭波、魏廷宇、顧廣毅，透過聲音、影像、裝置等作品型態，探問各種生命形式的可能性、生存哲學及倫理、科技發展與社會生活型態。</p><p>本次展出作品皆涵蓋「生」的多重意涵與多重角度，以跨領域，跨學科的方式，從策展過程到每件作品之間，皆蘊含複雜且豐富的對話關係。忠泰美術館則選在今（17）日舉辦開幕記者會，李彥良執行長表示：「忠泰美術館有幸得到來自各方的支持與協助，感謝本展的兩位策展人蔡宏賢及鄭慧華老師、策展顧問李明璁老師、洪廣冀老師及鄭陸霖老師及參展藝術家，另外也感謝歌德學院台北德國文化中心，共同促進國際間的文化交流，讓我們在這樣受到疫情影響的動盪的全球局勢下，共同呈現了這樣國際性的當代藝術展《生生LIVES》。」</p><p>歌德學院（台北）德國文化中心，藝文活動組專員崔延蕙表示：「歌德學院在文化工作上的重點，不只是企圖舉辦好的展覽，而是更著重在文化之間實質上的溝通，進而建構一個長期（永續）的緊密關係，因此在這次的整個活動中，歌德學院主要與忠泰美術館一起籌劃藝術家Nicholas Bussmann的交流與座談活動。歌德學院在此感謝忠泰美術館在全球疫情肆虐期間，依然克服萬難，舉行這場深具時代意義的當代藝術展。」</p><p>雖然在開幕記者會上，許多藝術家因故無法到場，但兩位策展人蔡宏賢、鄭慧華仍鉅細彌遺地介紹所有展品，其中不難發現，《生生LIVES：生命、生存、生活》展出的作品相對活潑，有數個「互動式裝置」邀請觀者一同進行互動體驗，包含聲音、觸覺、視覺等五官感知。如展場一開始，藝術家張欣在田野調查時，偶然聽到公園人們談話，進而創作的全新聲景作品《一千七百步》，此互動作品能從美術館一樓大廳延伸至鄰近的瑠公圳公園，以聲音作引子，將觀眾從美術館遷移至戶外，進一步透過聲音探索台北城市的地景，並感受美術館周遭的「日常」況味與疫情下的「非常」狀態。</p><p>在這件作品中，觀眾須先開啟手機GPS定位，並掃描作品上的QR Code，並戴上耳機、點擊「Open」後進而開始旅程。藝術家張欣描述這是一場以聲音來引導的實驗性漫步計畫，她期望通過聲音來引發觀眾對環境生態的重新閱讀並與之對話。隨著展覽動線持續往下探索，仍能發現藝術家們積極透過作品邀請觀眾進行互動。德國作曲家暨藝術家尼古拉斯布斯曼（Nicholas Bussmann）的全新創作《未來逝者的口述檔案》就試圖從聲音與觀眾進行交流。</p><p>作品裝置懸浮於展場，如有機物、隱約透光並微微發出呼吸聲，根據展方所言，這些代表生命的「頻率」與「能量」能在靜謐的氛圍中與你我產生共鳴，並轉化為一場與個人內在的對話。雖然作品無法動手觸碰，但在此漆黑的方形場域中，觀眾得以靜下心「聽見」自我與環境的聲音，不靠觸覺，形成另一種與作品的敘事互動。</p>', 'articleImage42', 4);

