--
-- 傾印資料表的資料 `forum_reply(q1)`
--

INSERT INTO `forum_reply(q1)` (`id`, `content`, `replier`, `date`) VALUES
(1, '降低成本免費上架服務平台：哈利熊\r\n市⾯上許多接案平台都會需要你購買曝光費，也就是\r\n希望你能夠儲值⼀筆錢。每提案⼀次就會扣裡⾯的\r\n錢，不論你這個案⼦是否成交都還是會扣，這對初期\r\n不穩定案⼦的接案者來說是非常不符合成本的，於是\r\n我找到了哈利熊！他是⼀個免費上架服務的平台，只\r\n會抽取成交費的12％。\r\n初期我只有把⾃⼰的Podcast⾳頻剪輯放上去，但遲\r\n遲沒有在這個平台上接到案⼦，不過，就在我已經幾\r\n乎忘記這件事時，有天《女⼈想聽的事》主持⼈就透\r\n過哈利熊找到我了。', '趙筠榆', '2022-04-15 00:00:00'),
(3, '利⽤免費資源加入接案社團現在臉書上有許多接案、\r\nSoho社團，你可以在上⾯尋找你可以提供服務內容\r\n的相對應社團加入。⽬前和Podcast⾳頻剪輯接案的\r\n需求還不多，於是我就先加入⼀個相關社團。雖然看\r\n似沒有幫助，但我在眾多求案貼⽂裡讓我找到Hoost\r\n平台正在徵求⾳頻接案剪輯師，於是我立刻回信並且\r\n成功應徵上了他們官網的⾳頻剪輯師其中⼀員', '卓逸朗', '2022-04-15 00:00:00'),
(4, '不要害怕⽑遂⾃薦\r\n初期我找不到案主，等待案主的同時我專⼼剪輯⾃⼰\r\n的Podcast，讓⾃⼰的技術可以再成熟⼀點，同時觀\r\n望市場上是否有這樣的需求？就在這時，讓我看到了\r\nYale正在應徵⾳頻剪輯師\r\n於是我便⽑遂⾃薦寫了⼀封應徵Email投遞履歷，也\r\n很順利的接到了第⼀個案主。', '費鵬旭 ', '2022-04-15 00:00:00');

