--

INSERT INTO `forum_reply(q2)` (`id`, `content`, `replier`, `date`) VALUES
(1, '⼀般來說，⼈類輕聲細語的⾳量約10分⾙，在正常\r\n的環境裡，對話交談約60分⾙，獅⼦可達114分⾙，\r\n⼤象可達到118分⾙。我們得承認，⼈類和動物有不\r\n少相似之處，獅⼦和⼤象會⽤吼叫聲來展現氣勢，⽤\r\n肢體和聲⾳來恫嚇敵⼈，以鞏固⾃⼰的地盤，彰顯⾃\r\n⼰的勢⼒，⼈類也不遑多讓。切記！對⽅越是張牙舞\r\n爪，疾聲厲⾊，你越要穩住內⼼。尤其內向者平時講\r\n話比較⼩聲，但⾯對強勢的⼈，⾳量變得微弱，對⽅\r\n更會覺得⾃⼰有理，便失去站在平等對話的基準點。', '許晞彤', '2022-05-01 00:00:00'),
(2, '聲調越沉穩，越有⼒量。⼈在壓⼒情境下，呼吸會變\r\n得短淺，講話也因此變快。遇到態度不友善的對象，\r\n做幾個深呼吸，對控制⾳量和說話速度會很有幫助。\r\n在任何情況都能掌握⾃⼰的⾳量和說話速度，你會發\r\n現⾃⼰原來那麼有⼒量！等累積更多經驗與⾃信，散\r\n發出更穩固的氣場，就能夠反過來影響對⽅，引導對\r\n⽅的⾳量和語速，不⾃覺調整到與你相似的頻率，達\r\n到更和諧的對話。', '霍諾軒', '2022-05-02 00:00:00'),
(5, '勇敢直視對⽅的眼睛，確認他所想要表達的訊息內\r\n容。在對⽅說完後，以你理解的⽅式重述⼀遍：「陳\r\n副理，請問您剛剛是這個意思嗎？有沒有需要補充的\r\n地⽅？」詳實核對雙⽅認知是否⼀致。拿出理性專業\r\n的態度，不卑不亢，會獲得對⽅更多尊重。\r\n⼼態上，不要把對⽅過度「放⼤」為⼀個很巨⼤的存\r\n在，不必賦予對⽅更⾼的地位，你的恐懼就會縮⼩，\r\n⼒量就會拿回來。\r\n最後，⾯對不舒服的對話情境，我們永遠可以喊暫\r\n停，另約時間溝通，或⽤⽂字溝通。\r\n', '趙筠榆', '2022-05-01 00:00:00'),
(6, '所有對話，都是為了讓彼此更了解⾃⼰，更接近想要\r\n的⽬標。三國時期的諸葛亮有句名⾔：「以柔克\r\n剛。」越不友善的溝通對象，越需要時間和耐⼼去卸\r\n下他的武裝，消弭彼此的隔閡。害羞內向的你，也需\r\n要給⾃⼰時間，強化⾃信。請繼續保持⾔語的善意，\r\n把每次對話都當作提升⾃我的機會，將使你從內⽽外\r\n變得更優雅、更堅強。', '向柏賢', '2022-05-01 00:00:00');

