INSERT INTO `product_items` (`ID`, `author_name`, `product_name`, `product_copy`, `price`, `pic_path`, `sell_count`, `type_id`, `create_time`) VALUES
(1, 'Leanne Graham', '設計一個獨特的商業公司徽標', '嘿！！！\r\n我是斯里蘭卡的平面設計師（徽標設計師），有更多的經驗。我只有一件事可以提供。\r\n最優質的服務\r\n\r\n        我確信你用完我的服務後不會離開我。\r\n\r\n專業徽標設計的演出特點：\r\n\r\n豪華和專業設計\r\n商業和簡單型別\r\n向量檔案\r\n高解析度\r\n創意標誌\r\n100%滿意度保證\r\n獨特的徽標設計\r\n模型設計\r\n原始檔，PNG，PSD，PDF，JPG，AI\r\n3D豪華徽標模型', 500, 'logo1-1.jpeg logo1-2.jpeg logo1-3.webp logo1-4.webp', 3, 104, '2022-05-18 00:00:00'),
(2, 'Leanne Graham', '提供定製的多邊形徽標和文具設計', '感謝您訪問我們的多邊形徽標演出！\r\n\r\n為您的公司或企業尋找現代多邊形或幾何標誌，那麼您來對地方了......！！！\r\n為什麼要選擇多邊形設計？\r\n\r\n這是一種新的和流行的設計型別，將為您的企業/公司帶來獨特而有吸引力的外觀。\r\n\r\n為什麼選擇我們？\r\n✔多個徽標設計和文具設計\r\n✔多色變化\r\n✔無限修訂\r\n✔100%滿意保證\r\n✔及時回覆\r\n \r\n格式包括：\r\n✔PDF\r\n✔ EPS\r\n✔SVG\r\n✔JPG\r\n✔PNG\r\n✔Favicon\r\n✔PSD\r\n✔艾\r\n \r\n所有徽標都以向量格式設計，因此您可以根據需要調整其大小，而不會失去徽標品質。', 3000, 'logo2-1.webp logo2-2.webp logo2-3.webp logo2-4.webp logo2-5.jpeg', 0, 104, '2022-05-23 00:00:00'),
(4, 'Leanne Graham', '繪製一個獨特的徽標', 'WebSutra是一個專門的團隊，專注於根據您的品牌要求提供獨特的圖形和徽標設計。 我們專門從事最小的徽標設計和品牌專案，為企業和個人提供完整的視覺身份開發。\r\n\r\n你在尋找一個獨特的徽標嗎？\r\n\r\n我們將確保，我們獨特的品牌圖形和徽標設計將透過設計高品質的現代徽標和配色方案，清楚地傳達您的企業形象。\r\n\r\n你會得到什麼？\r\n\r\n獨特的定製徽標將代表您的業務\r\n社交媒體個人資料的個人資料圖片和標題\r\n名片、信箋和信封等文具設計\r\n3D模型，幫助您在現實生活中視覺化您的文具\r\n為您的企業提供品牌手冊\r\n版權轉讓協議\r\n\r\n請檢查我們所有的套餐，並選擇最適合您預算和要求的套餐。 如果您有任何疑問，請隨時給我們傳送訊息。\r\n\r\n謝謝你！', 15000, 'logo3-1.webp logo3-2.webp logo3-3.jpeg logo3-4.webp logo3-5.webp', 2, 104, '2022-05-23 00:00:00'),
(5, 'Clementine Bauch', '建立專業的徽標設計', '我提議採用乾淨、簡單和巧妙設計的高品質專業徽標。\r\n\r\n首先，我需要客戶的創意簡報，我這邊的創意過程繼續進行研究、情緒板、草圖、圖形概念、顏色、字型。\r\n\r\n我將展示徽標圖示、文字標記、標語（如果有的話）的彩色和單色版本，作為徽標設計的一部分。\r\n\r\n在決賽中，您將有-向量檔案Ai，EPS；透明背景的PNG；彩色和黑白版本。', 9000, 'logo5-1.webp logo5-2.webp logo5-3.webp logo5-4.jpeg', 9, 104, '2022-05-23 00:00:00'),
(6, 'Leanne Graham', '線框搞，並設計你的移動應用程式和網站', '找人來設計與您的移動應用程式、網站或兩者相關的線框和UI/UX設計？\r\n\r\n非常歡迎！ 你來對地方了。\r\n\r\n我是Saba UI/UX設計師和Adobe XD，Illustrator專家。 讓我使用Adobe XD線框和設計您的移動應用程式和網站想法。\r\n\r\n這場演出包括什麼：\r\n\r\n線框設計\r\nUI/UX設計\r\n在Adobe XD中設計帶有原型和動畫的可點選移動應用程式和網站螢幕。\r\n開發目的所需的材料\r\n使用者介面圖示\r\n原始檔\r\n100%滿意度\r\n快速響應和交付\r\n\r\n我將使用的工具：\r\n\r\n土坯XD\r\nAdobe插畫家\r\nAdobe後效（用於動畫目的）\r\n\r\n-----請在訂購前給我發郵箱，以避免任何混淆-----\r\n\r\n很高興能完成你的專案！！！\r\n', 450, 'uiux1-1.webp uiux1-2.webp uiux1-3.webp uiux1-4.jpeg uiux1-5.webp', 1, 102, '2022-05-23 00:00:00'),
(7, 'Leanne Graham', '為移動應用程式設計專業的ui ux', '你夢想著它，我設計它。 您的應用程式需要專業的ui ux設計嗎？ 把你的原始線框/草框/要求發給我，我会把它變成數字傑作。\r\n\r\n我是評分最高的賣家和ui ux設計師，曾與來自45多個國家的客戶合作進行個人、業務和企業級專案。 我專門為iOS和Android平臺提供ui ux，這些平臺不僅漂亮，而且有用。\r\n\r\n⭐️工作流程\r\n瞭解需求、商業模式和目標受眾。\r\n製作專業的ui ux設計，將使用者放在其中的核心。\r\n獲取您的反饋。\r\n反饋後重申，直到拋光的ui ux準備就緒。\r\n交付最終的畫素完美ui ux設計源檔案。\r\n\r\n\r\n🙋🏻‍♂️我需要你提供什\r\n\r\n需求檔案/粗略草圖/線框等。\r\n業務描述，目標受眾。\r\n徽標（非必不可少）\r\n任何應用程式設計靈感和顏色偏好。\r\n\r\n🛠 Tools I use\r\n\r\nFigma\r\nAdobe XD\r\n', 400, 'uiux2-1.webp uiux2-2.webp uiux2-3.webp uiux2-4.webp uiux2-5.webp', 7, 102, '2022-05-23 00:00:00'),
(10, 'Chelsey Dietrich', 'ui ux設計、應用程式設計和網站設計', '自2016年以來，我是一名專業的使用者介面和使用者體驗設計師，我利用我的技能和經驗為您的企業構建了突破性的使用者介面設計。\r\n\r\n在21世紀的網站和移動應用程式時代，使用者體驗是企業最重要的事情。 這是您的USP對抗類似的競爭對手，並透過為您的使用者提供高度可用和測試的介面來幫助您獲得市場份額。\r\n\r\n✦我為以下用例工作：\r\n響應式網站設計\r\niOS和Android應用程式設計\r\n登陸頁面、擠壓頁面和引線索頁面\r\n網路橫幅\r\n電子郵件模板\r\n徽標和品牌套件\r\n\r\n✦我使用以下工具和軟體：\r\nAdobe XD\r\nFigma\r\nSketch\r\nAdobe Photoshop\r\nAdobe Illustrator\r\n\r\n如果你感到困惑、害怕或只是不知道從哪裡開始，請給我發個“你好”，我會幫你的。 無論如何，我都會引導你朝著正確的方向前進。\r\n\r\n期待為您推出您夢想中的產品。', 500, 'uiux4-1.webp uiux4-2.webp uiux4-3.webp uiux4-4.webp uiux4-5.webp', 3, 102, '2022-05-23 00:00:00'),
(13, 'Ervin Howell', '建立一個專業的極簡主義徽標設計', 'copy text2歡迎來到我的專業極簡主義徽標設計工作！\r\n\r\n您是否正在為您的公司或組織尋找出色的專業徽標？\r\n\r\n您獲得專業令人難忘和有吸引力的徽標設計的想法只有一步之遙。 \r\n\r\n因此，讓我們討論並選擇適合您業務的最佳設計。\r\n\r\n\r\n為什麼是我？\r\n\r\n-獨特的極簡主義概念\r\n-高解析度JPG和PNG\r\n-可用的向量/源檔案\r\n-標準和高階套餐的3D模型\r\n- 高階套餐的無限修訂\r\n- 出色的客戶支援\r\n-全天候服務\r\n-100%退款保證\r\n\r\n我的專業知識：\r\n\r\n極簡主義徽標 | 極簡 | 專業 | 現代 | 復古 | 徽章 | 手繪 | 女性 | 簽名 | 定製設計 | 房地產徽標 | 企業\r\n\r\n注意：\r\n我的顯示工作屬於標準或高階套餐。 請根據您的品質要求訂購合適的包裝。\r\n\r\n唯一阻止您的品牌在人群中脫穎而出的是“立即訂購”按鈕。人工智能\r\nJPG\r\nPDF\r\nPNG\r\nPSD\r\nEPS\r\nCDR\r\nSVG', 700, 'logo4-1.webp logo4-2.webp logo4-3.webp logo4-4.jpeg logo4-5.webp', 20, 104, '2022-05-23 00:00:00'),
(14, 'Chelsey Dietrich', '設計網站或移動應用程式的ui ux', '*經證明有能力為您的網路和移動應用程式快速推出令人驚歎的UI.UX設計的賣家*\r\n\r\n請注意，演出套餐的當前價格適用於移動螢幕。 如果您有網頁應用程式或網頁設計專案。 請透過給我發訊息獲得自定義報價。\r\n\r\n你腦海中對你的神奇產品有初步的想法或草圖嗎？ 請與我分享，我會把你的想法變成下一個實現層次，並實現它。\r\n\r\n你點選移動螢幕，滾動瀏覽網站，發生了一些事情，我設計了發生的事情。\r\n\r\n工作流程：\r\n\r\n1-分析和構建使用者體驗\r\n\r\n1.1-需求分析\r\n1.2-業務領域理解\r\n1.3-瞭解目標受眾和商業模式\r\n1.4-構建使用者體驗-UX\r\n1.5-建立視覺設計-PSD\r\n\r\n2-視覺設計釋出-（PSD/XD/草圖到響應式HTML）\r\n\r\n（訂購前請聯絡我，這不是當前演出的一部分）\r\n\r\n2.1-PSD/草圖/XD到響應式HTML轉換-從圖形翻譯到計算機可讀語言，如Html、Javascript/Jquery-Css/Bootstrap。\r\n', 1500, 'uiux5-1.jpeg uiux5-2.webp uiux5-3.webp uiux5-4.webp uiux5-5.webp', 5, 102, '2022-05-24 00:00:00'),
(15, 'Chelsey Dietrich', '用非凡的情節寫獨特的短篇小說', '~一定要聯絡我打折。 ～\r\n\r\n一個磁性故事可以創造一個從第一句話開始就能吸引任何人的世界。 我可以為您提供這樣的故事：迷人而獨特。 我可以提出有趣的概念，並把你的想法帶入生活。\r\n\r\n我可以提供：\r\n短篇小說、書籍、電子書、兒童故事、小說、中篇小說、劇本、劇本等。\r\n任何型別：浪漫、戲劇、幻想、恐怖、心理、驚悚、兒童讀物、年輕人等。\r\n500-100 000字或更多。\r\n100%原創內容。\r\n非凡的人物和非凡的情節。\r\n你只要告訴我，我很快就會做到的。\r\n我的故事樣本在演出中。 點選圖片檢視它們。', 600, 'book1-1.webp book1-2.webp book1-3.webp', 0, 103, '2022-05-24 00:00:00'),
(16, 'Chelsey Dietrich', '代寫你的小說', '我喜歡寫作，我把這種激情帶到我所有的工作中。\r\n我是一名專業的代笔人。 我寫過幾十本關於Fiverr的小說，其中一些是由我的客戶專業出版的。 寫作是我的激情，也是我一生練習和磨練的技能。 這是我的愛好，我也投入了很多時間和興趣來使它成為我的職業。\r\n\r\n我在興趣、知識、文化和心血來潮創造有趣世界的能力方面旅行得很好！\r\n\r\n我最大的靈感來自於我觀看、閱讀和播放的所有東西。 我高度關注許多流派的主題、流派慣例和角色弧線。 我更喜歡從故事的開始就工作，根據你的大綱、想法和指導自己製作整個事情。 請允許我為你發揮我的創造力。\r\n\r\n我有最多的幻想工作經驗，但可以透過一些研究和說明，我可以以任何語氣或心情為任何流派寫作。 你給我的及時和指導越快，我就能越好，越快。\r\n\r\n直接給我發訊息，瞭解更長、更涉及的專案或系列版本。', 3750, 'book2-1.webp book2-2.webp book2-3.webp', 2, 103, '2022-05-24 00:00:00'),
(19, 'Patricia Lebsack', '代寫獨一無二的書籍和電子書', '你好，我的朋友！！\r\n歡迎來到Ebook_Planet，“一個思想變成文字的地方”。\r\n在Ebook_Planet，您將在每個利基點播中獲得各種寫作材料。 透過考慮清晰、簡潔、一致和迷人，我在這個領域服務了3年多。 我會把你的想法變成現實，並會給你一些非凡的作為最終產品。 我的指揮利基是：\r\n1：小說（包括）\r\n小說\r\n講故事\r\n故事情節開發\r\n促銷指令碼\r\n促銷影片指令碼\r\n遊戲情節開發\r\n遊戲寫作\r\n部落格和文章\r\n電子書描述\r\n內容寫作&更多！！\r\n2. 非圖語（包括）\r\n商業\r\n營銷\r\n傳記\r\n烹飪書\r\n自助\r\n歷史\r\n研究論文\r\n兒童書籍\r\n情色\r\n健康與健身\r\n動物書等等！！\r\n除了這些服務外，我還提供：\r\n無編碼\r\n無剽竊\r\n端到端的工作轉移\r\n客戶的友好環境\r\n合理的費率\r\n格式良好\r\n書籍封面&\r\n有效的溝通\r\n您的滿意是我的第一要任務。 立即與我聯絡，獲取我驚人的包裹，並將您的想象力轉化為現實。 祝你好運！', 150, 'book5-1.webp book5-2.jpeg book5-3.webp book5-4.webp', 5, 103, '2022-05-24 00:00:00'),
(21, 'Patricia Lebsack', '獨特生成nft藝術收藏', 'NFT風靡市場。 2020年第一季度，NFT的支出超過20億美元，買家是賣家的兩倍。\r\n\r\nNFT可能已經存在了很長時間，但有些已經以數千萬美元的價格出售。 它們當然可以有利可圖，但問題是，你是否能夠創造這樣的藝術，並抓住NFT市場目前的趨勢。\r\n\r\n將包括的特徵：\r\n\r\n身體底座\r\n眼睛\r\n配件\r\n嘴巴\r\n髮型\r\n衣服\r\n耳朵\r\n眼鏡\r\n帽子\r\n\r\n請在訂購前閱讀此內容\r\n\r\n請清楚地描述你的想法，並上傳你的圖片參考資料\r\n如果你有批次訂單，就给我发訊息，這樣我們可以先討論一下', 1500, 'nft1-1.jpeg nft1-2.webp nft1-3.webp nft1-4.webp nft1-5.webp', 15, 101, '2022-05-24 00:00:00'),
(22, 'Ervin Howell', '為加密朋克NFT藝術設計肖像藝術', '嗨，我是ADE。\r\n\r\n你只有9秒鐘的時間來捕捉觀眾，從長遠來來來，你真的能幫助你賺取一些真正的錢。\r\n\r\n\r\nNFT藝術品的祕密：\r\n\r\n藝術本身的獨創性和獨特的表現力。\r\n風格和顏色起著重要作用\r\n最後但並非最不重要的是你的想法！\r\n\r\n沒有更聪明的了。 NFT的品質比NFT的數量重要得多\r\n\r\n...這是關於我的一點\r\n\r\n您將在您的肖像傑作上獲得國際獲獎的藝術家作品。\r\n\r\n我的作品在世界各地的主要藝術畫廊展出&我曾與一些頂級品牌和名人合作\r\n\r\n我完全知道什麼有效！ 我總是深深地熱愛透過藝術和色彩來表達我的想法和想法。\r\n\r\n這是我的原創藝術風格，在Fiverr Pro上獨家提供。\r\n\r\n\r\n我可以設計任何東西，你選擇的任何風格\r\n\r\n立即聯絡我，我將建立您選擇的自定義訂單。\r\n\r\n儲存演出/書籤\r\n\r\n你的藝術家，\r\n阿德\r\n\r\n這可能是肖像藝術、NFT收藏/NFT生成器、NFT藝術、NFT設計或加密藝術、加密朋克的傑作創意', 3600, 'nft2-1.webp nft2-2.webp nft2-3.jpeg nft2-4.jpeg nft2-5.webp', 3, 101, '2022-05-24 00:00:00'),
(23, 'Clementine Bauch', '為NFT角色創造獨特的藝術', '-請先給我留言，以便先討論專案，以避免誤解\r\n\r\n我在這裡幫助和解決你關於尋找NFT角色、特徵或任何加密藝術概念的想法。\r\n\r\n我還開放NFT專案的自定義請求（遊戲、插圖、角色或任何與藝術相關的產品）\r\n\r\n期待與您一起創作傑出的作品！', 1250, 'nft3-1.webp nft3-2.webp nft3-3.webp nft3-4.webp nft3-5.webp', 0, 101, '2022-05-24 00:00:00'),
(24, 'Clementine Bauch', '加密藝術NFT影像，你可以出售', '請在下訂單前私信我。\r\n\r\n\r\nNFT現在就是它！！ 如果你想賣一些藝術品，但沒有這樣做的技能，我在這裡等你！！！ 我會以優惠的價格為你說明，甚至照片操作影象，之後你可以把它作為NFT出售！！！', 1800, 'nft4-1.webp nft4-2.webp nft4-3.webp nft4-4.webp nft4-5.jpeg', 0, 101, '2022-05-24 00:00:00'),
(26, 'Chelsey Dietrich', '建立原創的兒童書籍插圖和封面', '你好，我是兒童圖書插畫家Nardin。\r\n我創作了明亮而充滿活力的插圖，吸引了孩子們的注意力。 我有三年多的經驗，我的許多書已經在全球範圍內出版，並在亞馬遜、Kindle和KDP上出版。 我將為您的書創作可愛、明亮、令人敬畏和令人驚歎的插圖，這些插圖將吸引孩子們的注意力，他們會喜歡閱讀您的書，並喜歡看它的插圖。\r\n我為兒童故事書、工作簿、著色書等畫插圖。\r\n\r\n請按照以下步驟操作：\r\n\r\n1. 給我留言，告訴我你的書或頁面，提供參考照片、影象......\r\n2.我們討論價格和交貨時間，然後我會給你發一份定製報價。\r\n3. 開始訂購。\r\n4。 首先，我會畫黑白粗略素描，並讓你明白一切都適合你，你可以對粗略素描進行無限的更改。\r\n5 我用它襯線和上色，然後送你。\r\n\r\n期待與您合作。', 150, 'illustration1-1.jpeg illustration1-2.webp illustration1-3.jpeg illustration1-4.webp', 6, 105, '2022-05-24 00:00:00'),
(31, 'Ervin Howell', '畫chibi藝術插圖', '請在訂購前閱讀\r\n\r\n購買前先給我發一條資訊，我會告訴你我能不能畫它\r\n價格僅供個人使用\r\n每張圖/角色的商業用途價格為+65美元（額外）（這包括圖紙是否將用於Twitch、Youtube或任何用於促銷或廣告目的的公共頁面）\r\n\r\n我有權將所有佣金用作我投資組合的一部分，或將其展示給其他客戶作為我工作的例子。\r\n \r\n私人佣金？：（我不會在我的社交網路上顯示此佣金，也不會將其作為我工作的例子向其他客戶展示）[+75美元]\r\n\r\n我不會改變或修改你角色的設計。 從描述和未完成的參考影象中工作將收取75美元的字元設計費\r\n\r\n價格是每個角色的，如果你想要一對夫婦，你必須支付雙倍的價格\r\n\r\n背景、盔甲、詳細圖案、大調色盤、詳細人物將需要額外費用。\r\ni can draw:\r\nArmors\r\nSimple Backgrounds\r\nOc (Original characters)\r\nFanart\r\nReal people\r\nYuri and Yaoi\r\n\r\ni don\'t draw:\r\nR/18\r\nHard Gore\r\nSENSITIVE / CONTROVERSIAL TOPICS\r\nComplex perspectives', 780, 'illustration2-1.webp illustration2-2.webp illustration2-3.webp illustration2-4.webp illustration2-5.webp', 2, 105, '2022-05-24 00:00:00'),
(32, 'Chelsey Dietrich', '畫一隻可愛的動物', '我可以畫可愛的動物插圖，非常適合兒童書籍、筆記本印刷品等。 我可以在一天內送貨。我可以用jpg或png的高解析度給你。', 3000, 'illustration3-1.webp illustration3-2.webp illustration3-3.webp illustration3-4.jpeg illustration3-5.jpeg', 0, 105, '2022-05-24 00:00:00'),
(33, 'Chelsey Dietrich', '設計你的廣告或時尚插圖', '我將根據您的願望和需求製作令人驚歎的編輯或廣告插圖。\r\n我總是專注於我的工作品質，並擁有為世界各地的不同客戶工作的經驗。 我很樂意想象你的想法，並以最好的方式呈現它們。\r\n\r\n有三個套餐選項：\r\n基本包括白色背景的簡單黑白插圖\r\n標準包括背景簡單的彩色插圖\r\n和高階套餐-用於複雜和非常詳細的插圖。\r\n\r\n為了開始工作，我需要對你的專案有一個簡要的描述。 請附上一些參考圖片以及您對樣式、影象大小和格式、預期交貨時間的要求。 提前討論所有細節很重要——我很樂意回答你的問題。\r\n\r\n我使用不同的技術工作：鉛筆繪圖、水彩、墨水、數字繪畫或混合媒體。 在我們討論了您的專案後，我將開始工作，並向您傳送第一個結果，以確保它符合您的要求。 在您批准後，我將完成工作。\r\n\r\n我將交付一個準備列印的高解析度檔案（300 dpi）。\r\n\r\n注意：請在下訂單前與我聯絡', 6000, 'illustration4-1.webp illustration4-2.jpeg illustration4-3.webp', 0, 105, '2022-05-24 00:00:00'),
(34, 'Ervin Howell', '為你的商業包裝畫植物', '這次演出是用於商業包裝插圖的。 主題是關於植物和花卉。 賣家將用黑色墨水畫出買家想要的東西。\r\n\r\n尺寸：最大尺寸為A4\r\n材料：微米豬圈，水彩紙\r\n手繪\r\n300dpi JPG/TIF/PSD格式的數字檔案\r\n\r\n買家應該讓賣家知道他們想要哪種植物，他們打算在哪裡使用圖形，尺寸是多少，等等。 買家需要向賣家提供一些參考圖片。 然後，賣方將提出草稿併發送給買方。 在這次演出中，初稿後有1次免費修訂。 修訂獲得批准後，賣方將進行最終抽獎。\r\n\r\n由於這是一張手繪圖，賣家只能透過掃描來提供點陣圖。 此檔案可以在Photoshop中修改限量版。\r\n\r\n這種圖紙適用於美容產品（手工肥皂、護手霜、香水、蠟燭、精油等）、有機產品或絲綢圍巾、手袋等配件的包裝。', 3000, 'illustration5-1.webp illustration5-2.webp illustration5-3.webp illustration5-4.webp illustration5-5.jpeg', 3, 105, '2022-05-24 00:00:00'),
(82, 'Mrs. Dennis Schulist', '我將繪製並生成 nft 藝術收藏品', '<h2>關於本次演出</h2><p><strong>NFT 市場</strong>&nbsp;現在正在蓬勃發展，每天都會創建大量新的藝術收藏品要<strong>&nbsp;獲得關注並在 NFT 上賺取收益，</strong>&nbsp;您需要由專業人士完成的<strong>獨特和定制的藝術收藏品&nbsp;。</strong></p><p><br></p><p>我在這次演出中提供的內容：</p><ul><li><strong>自定義基礎設計並為您在OpenSea</strong>&nbsp;或任何其他市場上的商店&nbsp;<strong>生成 100 個（大約 10 個不同的特徵）、1000 個（大約 32 個不同的特徵）或 10 000 個（大約 100 個不同的特徵）NFT&nbsp;。</strong></li></ul><p><br></p><ul><li><strong>精心繪製的高品質定製藝術品</strong>&nbsp;，我知道您的客戶需要喜愛這些藝術品才能使它們暢銷，這一點非常重要。</li></ul><p><br></p><ul><li><strong>經驗</strong>：我曾在<strong>&nbsp;幾個流行的 NFT 項目&nbsp;</strong>中工作，過去幾年我與加密貨幣利基密切相關。</li></ul><p><br></p><p>此優惠可根據您在截止日期、價格和藝術風格方面的需求量身定制。&nbsp;<strong>這就是為什麼我鼓勵你自由地談論你的期望。我希望我們能一起做一個驚人的藝術收藏！</strong></p><p><br></p><p><br></p><p><strong>重要提示：</strong>我不做像素藝術風格和 3D</p><p><strong>重要提示：</strong>&nbsp;這是 1 個系列的報價：1 件基礎藝術品加上 100、1000 或 10000 個具有不同帽子、牙齒、眼鏡、顏色或其他特徵的 NFT。</p>', 550, '16552175302791.jpg 1655217530283.webp 1655217530284.webp', 0, 101, '2022-06-14 22:38:50'),
(83, 'Mrs. Dennis Schulist', '我將以任何風格創作數字藝術、概念藝術和 nft', '<h1>關於本次演出</h1><p><br></p><p><strong> 在下訂單之前先與我討論</strong></p><p><br></p><p>我是一名插畫師和概念藝術家。我的特別興趣是繪畫和設計幻想主題的環境和風景。我可以為您的遊戲/書籍/棋盤遊戲/紙牌遊戲/CD封面繪製風景和環境。</p><p><br></p><p>我通常以半寫實風格工作。我專注於幻想和歷史主題，但我很樂意繪製其他主題。</p><p><br></p><p><strong>PS：在大多數情況下，在沒有先聯繫我的情況下下訂單會導致雙方的體驗都不令人滿意。因此，請先與我聯繫並提出您的要求。&nbsp;</strong></p>', 300, '16552176936721.jpg 1655217693673.webp 1655217693673.webp', 0, 101, '2022-06-14 22:41:33'),
(84, 'Mrs. Dennis Schulist', '我將創建自定義 nft 藝術', '<h2>關於本次演出</h2><p><strong>你好！</strong></p><p>我會畫出你的自定義 NFT 藝術作品。已經有想法了嗎？沒有的話可以給我留言，我們一起討論一下這個概念^^</p><p><br></p><p><strong>你得到什麼：</strong></p><ul><li><strong>高質量</strong>的 NFTart</li><li>分層 PSD 中的源文件</li><li>PNG 分離文件</li><li>1500x1500 像素，300dpi</li></ul><p><br></p><p><strong style=\"background-color: rgb(54, 23, 0);\">注意：如果您不了解 NFT 是如何工作的，請在下單前給我留言，我們將先討論細節，或者您可以閱讀 Fiverr 提供的有關 NFT 的文章。而且我還可以將 NFT 生成到許多集合中。</strong></p><p><strong>不能急於求成，質量優先！！﻿</strong></p><p><br></p><p>那你還在等什麼！:D</p><p>謝謝！</p>', 2000, '1655217790969.jpeg 1655217790970.jpeg 1655217790972.jpeg 1655217790972.jpeg', 0, 101, '2022-06-14 22:43:10'),
(85, 'Mrs. Dennis Schulist', '我會為你畫出可愛、酷、有創意的nft藝術', '<h2>關於本次演出</h2><p>你好！我是拉米。</p><p>我會給你做一些很酷的 NFT 藝術！</p><p>讓我解釋一下，這樣就很容易了。</p><p><br></p><p>1 . 給 我 發消息簡要討論你的 NFT 藝術。</p><p>&nbsp;&nbsp;&nbsp;（這很重要，因為通過討論一切都會變得清晰）</p><p><br></p><p>2.對象越簡單，效果越好。禁止攝影</p><p>&nbsp;&nbsp;&nbsp;&nbsp;背景，僅純色背景</p><p><br></p><p>3. 與服裝、頭飾、配飾等相關的物品，</p><p>&nbsp;&nbsp;&nbsp;&nbsp;為簡單起見，我將根據一組屬性計算它。</p><p><br></p><p>一組屬性中的示例，包括服裝、頭飾、眼鏡、配飾。</p><p>&nbsp;&nbsp;&nbsp;10套屬性（10種不同的服裝，10種不同的眼鏡，10種不同的頭飾，10種不同的配飾）</p><p><br></p><p>&nbsp;&nbsp;&nbsp;每組屬性：$20</p><p><br></p><p><br></p><p>就是這樣！如果不清楚，請立即聯繫我，我很熱心！</p><p><br></p><p>謝謝你</p>', 300, '1655217902189.webp 1655217902189.webp 1655217902189.webp', 0, 101, '2022-06-14 22:45:02'),
(86, 'Mrs. Dennis Schulist', '我將開發和設計 2d 遊戲和 nft 遊戲', '<h2>關於本次演出</h2><p><br></p><p>2D遊戲專家，可以根據您的要求創建任何類型的遊戲。製作流行遊戲克隆的專家，</p><p>如 Flappy Bird 等。我可以根據您的需要創建任何 2D 遊戲，只需聯繫我討論詳細信息，我們就可以開始了。我也可以製作超休閒遊戲、兒童遊戲和教育遊戲</p><p>*<strong>請在訂購 GIG 之前與我聯繫以了解可用性並避免取消</strong>*，&nbsp;</p><p>我想與您討論有關遊戲的詳細信息，以便為您提供合適的演出。&nbsp;</p>', 1500, '1655218020530.webp 1655218020531).jpg 1655218020532s.jpg', 0, 101, '2022-06-14 22:47:00'),
(87, 'Mrs. Dennis Schulist', '我會做移動或網絡用戶體驗和原型或線框', '<h2>關於本次演出</h2><p><strong>你好呀親愛的，</strong></p><p>每次您的客戶瀏覽您的 Android 或 Iphone 應用程序和網站時，他們都會決定是否要在您的產品上花費時間和金錢。您的 UI/UX 設計是您的第一個接觸點，也是您轉換的最佳機會 - 不要浪費它！</p><p>我叫艾哈邁德，很高興認識你！我是一名專業的 UI/UX 設計師，隨時準備以卓越的外觀和感覺將您的移動應用程序和網站提升到一個新的水平。無論您是設置用於開發的線框原型 UX，還是需要一個可以上市的 UI，我都可以從頭開始提供幫助。</p><p>我的設計總是引人注目、用戶友好，並且符合 Apple 和 Google 的無憂實施和推廣指南。</p><p><strong>主要特點：</strong></p><ul><li>專業創意設計</li><li>超清晰和乾淨的佈局</li><li>完美像素</li><li>附帶專業字體</li><li>包括有用的設計元素/圖標</li><li>全力支持</li><li>100% 滿意</li></ul>', 2050, '1655218114973.webp 1655218114974.webp 1655218114974.webp', 0, 102, '2022-06-14 22:48:34'),
(88, 'Mrs. Dennis Schulist', '我將設計您的創意網站佈局，可在 xd 和 PSD 中編輯', '<h2>關於本次演出</h2><p><strong>需要為您的網站進行創意設計？</strong>你在理想的地方。憑藉我的宣傳和廣告學士學位，我完全有資格幫助您確保一個精心策劃的網站。我目前是一名 UI/UX 設計師，從事網站設計工作。</p><p><br></p><p>我專注於為有效傳達您的服務的網站創建設計。如果您需要一種新的佈局設計來更有效地傳達您為客戶提供的內容，我可以為您做到。如果您有任何問題，請隨時與我聯繫。</p><p><br></p><p><strong>文件夾：</strong></p><p>Fiverr-res.cloudinary.com/video/upload/t_fiverr_hd/izrtg5k5oodcx9iw7f8t</p><p>Fiverr-res.cloudinary.com/video/upload/t_fiverr_hd/oiowvmtvtio21lwscsfx</p><p><br></p><p><strong>過程：</strong></p><p>聯繫&gt;簡報&gt;創建&gt;更改&gt;批准&gt;接收：</p><p>可編輯的 Adob​​e XD、PSD 或 FIGMA、視頻預覽、圖標等</p><p><br></p><p><strong>你會得到什麼：</strong></p><p>- 一個新的現代和乾淨的設計。</p><p>- 一個交互式和可點擊的原型。</p><p>- 改進佈局的溝通。</p><p>- 顯示佈局如何工作的獎勵視頻預覽。</p><p><br></p><p><strong>我不做什麼：</strong></p><p>- 我不創建徽標或做品牌。</p><p>- 我不從事開發工作——沒有代碼。</p><p><br></p><p><strong>在下訂單之前聯繫我，讓我們討論您的項目</strong></p>', 2000, '1655218157890.webp 1655218157890.webp 1655218157890.webp', 0, 102, '2022-06-14 22:49:17'),
(89, 'Mrs. Dennis Schulist', '我將為移動和網絡設計 uiux 或原型線框', '<h2>關於本次演出</h2><p><strong>你好！我是 aamirsehar，</strong><strong style=\"background-color: rgb(54, 23, 0);\">請在訂購前收件箱以避免任何混淆。</strong>需要為您的企業打造乾淨現代的界面？與我聯繫您的想法，以便我可以幫助您將它們變為現實！我專注於為功能強大且易於使用的移動應用程序和網站創建漂亮的界面。<strong>主要特徵</strong></p><ul><li>專業創意設計</li><li>超清晰和乾淨的佈局</li><li>完美像素</li><li>附帶專業字體</li><li>包括有用的設計元素/圖標</li><li>全力支持</li><li>100% 滿意</li></ul><p><span style=\"background-color: rgb(54, 23, 0);\">如果您對本次演出有任何疑問，請隨時與我聯繫。</span></p>', 3470, '1655218221699.webp 1655218221699.webp 1655218221700.webp', 0, 102, '2022-06-14 22:50:21'),
(90, 'Mrs. Dennis Schulist', '我將為移動應用程序和平板電腦應用程序設計定制的 UI UX 設計', '<h2><br></h2><p><span style=\"background-color: rgb(54, 23, 0);\">📩 下單&nbsp;</span><strong>前請聯繫我。&nbsp;</strong></p><p>💪<strong>關於我？</strong></p><p>我是 Subash，我是產品設計師和 UX 研究員。我不僅製作 UI UX 設計，而且在創建以用戶為中心的產品/服務時解決用戶問題，我從這裡獲得動機。</p><p><br></p><p><strong>我總是願意簽署 NDA。</strong></p><p><br></p><p>👉🏻<strong>&nbsp;我會幫助你的方式：</strong></p><ul><li>闡明並討論您的業務目標、目標和挑戰</li><li>研究 + 競爭對手分析 + 用戶流/路線圖 + 信息架構</li><li>線框 + 視覺情緒板</li><li>交互式原型</li><li>創建以用戶為中心的視覺設計</li><li>開發風格指南</li><li>你發評論，我提供迭代，你開心，我會完成項目</li></ul><p><br></p><p>👉🏻&nbsp;<strong>我需要你什麼來開始你的移動應用程序/UI UX 設計？</strong></p><ul><li>簡介/故事/規格要求</li><li>您的一些競爭對手的移動應用程序。（如果有）</li><li>用戶是誰？他們的職業、痛苦和收穫是什麼？（如果有）</li><li>您能否分享您喜歡的移動應用程序設計示例？（如果有）</li><li>以 AI/EPS 和 PSD 格式提供您的風格指南和徽標？（如果有）</li></ul><p><br></p><p>👉🏻&nbsp;<strong>移動應用程序/UI UX 設計的最終交付文件：</strong></p><p>&nbsp;Figma、Adobe XD 和帶有開發資產的&nbsp;<strong style=\"background-color: rgb(54, 23, 0);\">Sketch源文件</strong></p>', 2400, '1655218277185.webp 1655218277186.webp 1655218277186.webp', 0, 102, '2022-06-14 22:51:17'),
(91, 'Mrs. Dennis Schulist', '我將設計線框、用戶界面設計和原型', '<p>你好！精英團隊在這裡。<strong>我們將為您製作線框圖、Ux Ui 設計和原型。</strong>在過去的 3 年裡，我們一直擔任 Ui Ux 設計師。我們為當地客戶提供服務。現在，我們決定將我們的服務擴展到像 Fiverr 這樣的在線平台。</p><p>如果您喜歡，請首先<strong>訪問我們的投資組合</strong>，然後請給我們留言：</p><p>www.behance.net/team_elite</p><p><br></p><p><strong>我們的服務包括</strong></p><ul><li>移動和網頁 UI 設計</li><li>完全完美的原型</li><li>線框用戶體驗設計</li></ul><p><br></p><p><strong>為什麼選擇我們？</strong></p><ul><li>有UI Ux設計經驗</li><li>更新了最新的設計趨勢&nbsp;</li><li>24/7 可用性</li><li>無限修改直到您滿意</li><li>獨特而現代</li></ul><p><br></p><p>請<strong>給我們留言，以獲取</strong>有關您的 Ui 設計項目的查詢和詳細信息。</p>', 500, '1655218395870.webp 1655218395871.webp 1655218395871.webp', 0, 102, '2022-06-14 22:53:15'),
(92, 'Mrs. Dennis Schulist', '我會創作獨一無二的奇幻書封面插畫', '<p><strong>***Fiverr 上超過 1,000 條正面評價***</strong></p><p>您好作者和讀者 - 歡迎來到我們的幻想世界！</p><p>我們是 Bobooks：擁有超過 6 年行業經驗的專業設計師（雙胞胎兄弟！）。</p><p>我們將為您打造完美的奇幻書籍封面，吸引讀者的注意力並將他們傳送到另一個世界！我們所有製作精美的書籍封面都是定制的並且完全獨一無二。</p><p><strong>我們提供什麼：</strong></p><p><strong>書籍封面（全封面：電子書和可打印的文件）</strong></p><p><strong>用於 Amazon、CreateSpace、Lulu、Nook、Kobo 和許多其他公司的封面</strong></p><p><strong>插圖</strong></p><p><strong>都市奇幻、愛情、超自然、科幻等</strong></p><p><strong>營銷材料（橫幅、書籤和視頻）</strong></p><p><strong>你會得到什麼：</strong></p><p><strong>獨特而令人驚嘆的書籍封面</strong></p><p><strong>定制插圖</strong></p><p><strong>100% 滿意和退款保證</strong></p><p><strong>提供 24 小時送貨服務（額外收費）</strong></p><p><strong>我們需要您提供的：</strong></p><p><strong> 書 名</strong></p><p><strong> 字 幕</strong></p><p><strong> 作 者 姓 名</strong></p><p><strong> 書 籍 說 明</strong></p><p><strong>我們創建的每個訂單都是完全個性化的，因此請在訂購前與我們聯繫</strong></p>', 600, '1655218524379.webp 1655218524379.webp 1655218524379.webp 1655218524379h.jpg', 0, 103, '2022-06-14 22:55:24'),
(93, 'Mrs. Dennis Schulist', '我將為KDP平裝書，kindle格式電子書預定格式和佈局設計', '<h2>關於本次演出</h2><p><strong>親愛的作者！我了解您正在為您的圖書格式和佈局設計尋找經驗豐富且可靠的圖書管理員。</strong></p><p><br></p><p>我是 Saqib，<strong>KDP、Ingramspark、Lulu、BookBaby、Barnes &amp; Noble、平裝本、精裝本和電子書設計師專家，能夠管理所有語言的書籍</strong>。我曾與 2500 位作者合作，並幫助他們出版書籍。我有信心可以將書籍內容轉化為吸引人、專業且引人入勝的書籍佈局。</p><p><br></p><p><strong><em>我相信書籍版面設計的完美、準確和一致性對決定它們的適銷性有很大的幫助。</em></strong></p><p><br></p><p>我始終專注於<strong>以快速的周轉時間提供專業且具有成本效益的服務，</strong>同時確保我的客戶對最終產品 100% 滿意，如果需要，我總是樂於加倍努力。</p><p><br></p><p><strong>服務包括：</strong></p><ul><li>無縫的書籍佈局設計和排版</li><li>最多可格式化 100K 字的書籍</li><li>可點擊的目錄</li><li>精心設計的章節</li><li>無限修訂</li></ul><p><br></p><p><strong>我會交付什麼？</strong></p><ol><li>打印就緒 PDF</li><li>電子書 EPUB</li><li>源文件</li></ol>', 700, '1655218568304.webp 1655218568304.webp 1655218568305k.jpg', 0, 103, '2022-06-14 22:56:08'),
(94, 'Patricia Lebsack', '我將設計帶有書背和書脊的書籍封面或電子書封面', '<p><strong style=\"background-color: rgb(54, 23, 0);\">全職 FIVERR 平面設計師！完成 2500 多本書。所有圖形均採用 HD 300 DPI 圖像。</strong></p><p><span style=\"background-color: rgb(54, 23, 0);\">&nbsp;</span></p><p><strong>這個演出既適用於電子書，也適用於印刷/平裝本。</strong></p><p>在這次演出中，我將為您製作專業且具有吸引力的書籍封面。我的目標是讓您的封面引人注目，符合當前的設計趨勢，以吸引潛在買家的注意。</p><p><br></p><p><strong>我為所有出版平台製作封面，包括：</strong></p><p># 點燃/KDP</p><p># 創建空間</p><p># ACX</p><p># 粉碎詞&nbsp;</p><p># 閃電源，</p><p># 英格拉姆火花，</p><p># lulu.com</p><p>#Goodreads</p><p><strong>您需要提供：</strong></p><p>1. 標題、副標題、作者姓名和類型。</p><p><strong>2. 封底內容：關於書、關於作者、作者照片、任何標誌、推薦/評論等。</strong></p><p><strong>3. 剩下的交給我 :)</strong></p><p>&nbsp;</p><p><strong><em>為什麼選擇我？</em></strong></p><p><br></p><p><em># 專業和創造性的概念。</em></p><p><em># 跟隨當前的設計趨勢。</em></p><p><em># 能夠創建多個概念。&nbsp;</em></p><p><em># 設計師全職在 Fiverr 工作。</em></p><p><em># 帶有我所有包裹的高級庫存照片。&nbsp;</em></p><p><em># 有吸引力的 3D 模型</em></p><p><em># 獲取多個平台的封面。&nbsp;</em></p><p><em># 成功完成 2500 多個封面。&nbsp;</em></p><p><em># 無限修訂。</em></p>', 300, '1655219018695).jpg 1655219018697).jpg 1655219018698k.jpg 1655219018698a.jpg', 0, 103, '2022-06-14 23:03:38'),
(95, 'Patricia Lebsack', '我將在 24 小時內完成非小說類書籍封面設計', '<p><strong>再會！</strong></p><p><strong>&nbsp;</strong></p><p>您是否期望為您的出版商設計一&nbsp;<strong style=\"background-color: rgb(54, 23, 0);\">本您想像的創意書籍封面/電子書</strong><strong>&nbsp;</strong>？那時，您處於最佳位置。</p><p><br></p><p>我對書籍封面設計有很好的了解，我會為您製作任何風格的書籍封面。我非常確定你會 100% 開心，我會努力讓你滿意。</p><p><br></p><p><strong>你會得到什麼？</strong></p><p><br></p><p><strong>✅ 高品質書籍封面設計</strong></p><p><strong>✅ VIP文件包</strong></p><p><strong>✅ 3D 模型</strong></p><p><strong>✅ 100% 獨特的封面</strong></p><p><strong>✅ 無限修改*</strong></p><p><strong>✅友好溝通</strong></p><p><br></p><p><strong>為什麼選擇我？</strong></p><p><br></p><p><strong>✅ 專業設計師</strong></p><p><strong>✅ 20 年以上圖形設計經驗</strong></p><p><strong>✅ 很好的傾聽者，對反饋的反應很好</strong></p><p><strong>✅ 快速交貨</strong></p><p><strong>✅ 100% 滿意</strong></p><p><strong>✅ 貴賓支持</strong></p><p><br></p><p><strong>要求：</strong></p><p>請在下&nbsp;訂單時<strong style=\"background-color: rgb(54, 23, 0);\">填寫要求。</strong><strong>&nbsp;</strong></p><p><br></p><p><strong style=\"background-color: rgb(54, 23, 0);\">現在下單！！在接下來的幾個小時內查看您的圖書封面*。</strong></p><p><br></p><p>*無限修訂僅包含在 Plus Pack 中。最初，我將提交封面設計選項，&nbsp;<strong>當您完成封面設計時，將製作封底和書脊。</strong></p>', 600, '1655219069164).jpg 1655219069165).jpg 1655219069165).jpg 1655219069165n.jpg', 0, 103, '2022-06-14 23:04:29'),
(96, 'Patricia Lebsack', '我會設計一個引人注目的封面和完整的排版和排版', '<h2>關於本次演出</h2><p>你好！</p><p><br></p><p>我的名字是 Barbara，自 2013 年以來，我是一名平面設計師和藝術總監，在設計領域工作。我曾與來自世界各地的多家大小企業合作。&nbsp;</p><p><br></p><p><strong>我將設計一個吸引人的封面和佈局，幫助您在市場中脫穎而出。&nbsp;</strong>我將從頭設計一個獨特的佈局和封面（我不使用模板）。您將收到的文件具有完整的商業用途！&nbsp;</p><p><br></p><p>一旦我收到內容，我就可以開始處理您的佈局和封面。</p><p>對於超過 100 頁的書籍，我需要大約 60 天的時間來創建佈局並插入內容。&nbsp;</p><p><br></p><p>請給我文字內容，圖片。</p><p><strong>重要提示：</strong>&nbsp;我不會對您的內容進行拼寫/語法檢查。</p>', 4000, '1655219108313.webp 1655219108313.webp 1655219108313.webp 1655219108314.webp', 0, 103, '2022-06-14 23:05:08'),
(97, 'Patricia Lebsack', '我會定制豪華數字迎賓書、房屋手冊、airbnb租賃指南', '<h2>關於本次演出</h2><p>對於房客來說，愛彼迎留言簿是查找他們在愛彼迎酒店住宿所需的所有信息的理想場所。由於每次租賃都不同，客人需要在抵達後了解所有詳細信息，您的留言簿是他們可能首先查看的地方。</p><p><br></p><p><strong>基本：僅模板</strong></p><ul><li>DIY</li><li>您有多個模板可供選擇</li><li>您插入自己的寫作內容</li><li>你插入自己的圖片</li><li>你可以改變顏色</li><li>使用 Canva 編輯平台</li></ul><p><br></p><p><strong>標準：定製書</strong></p><ul><li>沒有研究</li><li>房東提供所有信息</li><li>獨特的 Wifi 二維碼</li></ul><p><br></p><p><strong>高級版：定製書籍 + 研究 + 免費印刷供應商</strong></p><ul><li>包 2 中包含的所有內容</li><li>研究 3-4 景點/要做的事情</li><li>研究 3-4 家餐廳</li><li>包括多個供應商，您可以使用這些供應商來專業印刷您的書</li></ul><p><br></p><p><strong>滿意保證！</strong></p><p><br></p><p><strong>包括的部分：</strong></p><ul><li>WIFI二維碼讓客人可以輕鬆連接手機！</li><li>入住</li><li>關於首頁</li><li>家庭規則</li><li>電子/電器</li><li>設施/游泳池/熱水浴缸</li><li>食物和飲料</li><li>要做的事情</li><li>退房說明</li><li>緊急電話號碼</li></ul><p>Ps 這真的會打動你的客人！</p>', 400, '1655219159725.webp 1655219159725.webp 1655219159726b.jpg', 0, 103, '2022-06-14 23:05:59'),
(98, 'Patricia Lebsack', '我會做派對、活動、教堂、商業、圖書發行傳單設計', '<h2>關於本次演出</h2><p><strong>你好！歡迎來到 GRAPHIZ_HUB</strong>，一個令人驚嘆的圖形設計世界。尋找引人注目的創意平面設計？</p><p>別再猶豫了，我們是一支由高度專業的平面設計師組成的團隊，我們在這里以迅速的響應和快速的周轉時間來滿足您的需求。只是一個試驗會說服你。我們在這里為您服務，是的，您！</p><p><br></p><p><strong>我的服務包括</strong></p><ul><li>打印就緒活動傳單&nbsp;</li><li>在線，社交媒體傳單</li><li>商務/活動明信片或邀請函</li><li>海報大小和小冊子佈局設計&nbsp;</li><li>用於社交媒體或電子郵件的傳單/海報</li><li>任何尺寸和類型的橫幅</li><li>A6 - A1 大小的傳單或您指定的任何自定義尺寸。&nbsp;</li></ul><p><br></p><p><strong>放心！</strong></p><ul><li>100% 滿意&nbsp;</li><li>12 - 24 小時交貨，請指定（如果您希望早於 12 小時）</li><li>專業的客戶服務&nbsp;</li></ul><p><br></p><p><strong>不再浪費時間，立即訂購！</strong></p>', 300, '1655219216279.webp 1655219216279n.jpg 1655219216280.webp', 0, 103, '2022-06-14 23:06:56'),
(99, 'Patricia Lebsack', '我會專業地設計雜誌、書籍排版和排版', '<p><strong>大家好，</strong></p><p><strong>歡迎來到我的演出！</strong></p><p>如果您正在尋找雜誌設計、書籍格式和版式設計，那麼您來對地方了。我是創建高質量獨特雜誌等方面的專業平面設計師專家。我將為您解決有關雜誌和書籍的所有問題。我的創意設計將獨一無二且引人注目，這將幫助您銷售和提升您的業務。</p><p><strong>我的服務是：</strong></p><ol><li><strong>雜誌和書籍設計</strong></li><li><strong>格式和佈局</strong></li><li><strong>可編輯的源文件</strong></li><li><strong>打印就緒文件</strong></li><li><strong>3D模型</strong></li><li><strong>JPG和PNG</strong></li><li><strong>二維碼生成</strong></li></ol><p><strong>為什麼選擇我？</strong></p><ol><li><strong>專業平面設計師</strong></li><li><strong>無限修訂</strong></li><li><strong>100% 退款保證</strong></li><li><strong>交貨快</strong></li><li><strong>100% 質量工作和滿意度</strong></li></ol><p>如果您有任何疑問，請隨時與我聯繫。</p><p><br></p><p>謝謝。</p>', 200, '1655219263277.webp 1655219263278.webp 1655219263278.webp 1655219263278.webp', 0, 103, '2022-06-14 23:07:43'),
(100, 'Patricia Lebsack', '我會為你設計一個很棒的書皮', '<h2>關於本次演出</h2><p>所有類型的定製書籍封面！所有封面都是 100% 獨一無二的，永遠不會再出售。沒有太大的要求，如果您有任何問題，請給我留言，我會盡快回复您。</p><p><br></p><p><strong>超過 10,000 名滿意的 Fiverr 客戶！</strong></p><p><br></p><p>我對你的要求是：</p><p>•<strong>標題</strong>、副標題和<strong>作者姓名</strong>。</p><p>•您正在尋找的<strong>示例</strong>，可能是您喜歡的文字，您認為適合的封面，如果您有特定的想法，請提供草圖。</p><p>• 瀏覽Shutterstock 以獲取您認為合適的<strong>圖像。</strong></p><p><br></p><p>我提供的所有圖像都已獲得完全許可，可複制多達 500,000 次，因此絕對不用擔心侵犯版權</p><p><br></p><p><strong>基本</strong>：高分辨率電子書封面，包括一張圖片和免費 3D 模型</p><p><br></p><p><strong>標準</strong>：高分辨率電子書封面，最多包含 3 張圖像和免費 3D 模型</p><p><br></p><p><strong>高級版</strong>：完整的印刷封面和電子書，最多包含 3 張圖像和免費的 3D 模型</p><p><br></p><p><span style=\"background-color: rgb(54, 23, 0);\">非加急訂單在</span><strong>3天內交付</strong></p><p><br></p><p>加！！** 在您的訂單中包含您的社交媒體鏈接，<strong>我將幫助您宣傳您的書籍</strong>**</p>', 3000, '1655219358154.webp 1655219358154v.jpg 1655219358155).jpg 1655219358156).jpg 1655219358157r.jpg', 0, 103, '2022-06-14 23:09:18'),
(101, 'Patricia Lebsack', '我會做書籍封面設計', '<h2>關於本次演出</h2><p><strong>一個合適的 GIG 為您設計專業的電子書封面！！</strong></p><p><br></p><p>我叫沙燕。具有豐富設計經驗的專業書籍/電子書封面設計師，可以製作吸引大量觀眾的電子書/書籍封面。</p><p><br></p><p><strong>在這裡查看我的書籍封面設計：</strong>&nbsp;https</p><p><br></p><p><strong>我的演出服務包括：</strong>&nbsp;Amazon KDP（Kindle 封面）、印刷封面、書籍/電子書封面、有聲讀物（有聲讀物）、平裝本</p><p><br></p><p>在這次演出中，您將獲得：</p><ul><li>專業的電子書/書籍封面設計</li><li>免費的 3D 模型</li><li>一流的客戶服務</li><li>超快速交貨</li><li>無限修改</li></ul><p><br></p><p>如果您有任何問題，請給我留言。如果您不知道要訂購什麼，請給我留言，我將非常樂意為您提供幫助並為您的項目提供建議</p><p><br></p><p>你在等什麼？？繼續下訂單，讓您大吃一驚！！</p>', 300, '1655219395877.webp 1655219395878.webp 1655219395878.webp 1655219395878.webp', 0, 103, '2022-06-14 23:09:55'),
(102, 'Patricia Lebsack', '我會將您的書籍封面轉換為 acx 有聲讀物封面', '<p>這個關於將您的書籍封面轉換為 ACX 有聲讀物封面的演出。</p><p><br></p><p><strong style=\"color: rgb(135, 128, 118);\">我們為您提供保險</strong></p><p><br></p><ul><li>JPG 文件格式。</li><li>2400 x 2400 像素。</li><li>300 dpi 分辨率。</li><li>最低 24 位（真彩色）。&nbsp;</li><li>RGB 顏色&nbsp;</li></ul><p><br></p><p><strong style=\"color: rgb(135, 128, 118);\">這將滿足所有 ACX 要求</strong></p>', 200, '1655219442446.webp 1655219442447.webp 1655219442447.webp 1655219442447r.jpg', 0, 103, '2022-06-14 23:10:42'),
(103, 'Patricia Lebsack', '我將設計汽車運輸交付物流和卡車運輸標誌', '<p>你好，</p><p><strong style=\"background-color: rgb(54, 23, 0);\">歡迎來到這個設計汽車運輸交付物流和貨運標誌</strong>的演出</p><p><br></p><p>作為一名設計師對我來說不僅僅是一份工作，更是一種激情。從過去 6 年開始，我一直是一名自由設計師，並一直在為我提供有價值的服務。&nbsp;</p><p><strong>我會給你一個專業和逼真的標誌，這將增加你公司的聲譽，讓你開心。我會努力滿足你的願望..！</strong></p><p><br></p><p><br></p><p><br></p><p><strong>為什麼是我？</strong></p><ul><li>100% 原創LOGO設計</li><li>專業的現代和獨特的概念</li><li><strong>無限修改</strong></li><li>高分辨率可打印文件</li><li>免費 3D 模型</li><li>24小時按需快遞</li><li>反應快</li><li>引人注目的創新理念</li><li>原始 Photoshop/Adobe Illustrator 文件</li><li>來自 gig extras 的社交媒體工具包和固定設計</li></ul><p>&nbsp;</p><p><strong>卡車/卡車公司/物流業務/物流公司/運輸/汽車運輸/汽車美容/洗車/洗車業務/汽車/汽車/租車/汽車經銷商/搬家服務/汽車服務/汽車美容/汽車修理/交付貨車 / 送貨卡車 / 自行車 / 汽車修理 / 洗車服務</strong></p>', 150, '1655219762140.webp 1655219762140).jpg 1655219762142s.jpg', 0, 104, '2022-06-14 23:16:02'),
(104, 'Patricia Lebsack', '我將為任何企業設計原創標誌', '<h2>關於本次演出</h2><p>100% 原創設計，沒有剪貼畫或任何類似的東西。</p><p>我想提供一些讓你快樂並為你工作的東西。</p>', 300, '1655219800856.webp 1655219800856.webp 1655219800856.webp 1655219800856s.jpg', 0, 104, '2022-06-14 23:16:40'),
(105, 'Patricia Lebsack', '我將創建一個扁線標誌設計', '<h2>關於本次演出</h2><p>歡迎來到我的平面標誌設計演出！</p><p><br></p><p>儘管是該平台的新成員，但我們&nbsp;<strong>在平面設計方面擁有 16 年以上的經驗，並且在全球擁有數以千計的滿意客戶！</strong>&nbsp;我們的團隊曾與高級品牌、小公司和個人合作。我們很高興有機會讓您獲得我們的技能，無論您是小型企業還是大型組織。</p><p><br></p><p>通過購買我的服務，您將獲得：</p><ul><li>2-4 種不同的平面標誌設計概念（取決於您選擇的包裝）</li><li>高級包的無限修訂、VIP 支持和迷你品牌</li><li>快速支持</li><li>準時交貨</li></ul><p><br></p><p><strong>我們也這樣做：</strong></p><p><br></p><p>最小 |&nbsp;現代 |&nbsp;正文 |&nbsp;復古 |&nbsp;徽章 |&nbsp;手繪 |&nbsp;女性 |&nbsp;簽名 |&nbsp;會標 |&nbsp;奢華 |&nbsp;平面標誌設計 |&nbsp;品牌推廣</p><p><br></p><p><br></p><p>如果您有任何問題，請隨時給我發消息，我期待盡快答复。</p>', 500, '1655219839276.webp 1655219839276.webp 1655219839277.webp', 0, 104, '2022-06-14 23:17:19'),
(106, 'Clementine Bauch', '我將設計有創意的現代簡約標誌', '<h2>關於本次演出</h2><p>“探索終極體驗……！”</p><p><br></p><p>為了滿足您的設計需求，<strong>讓我們以圖形方式成為您的……！！</strong></p><p><br></p><p><strong>看看我們的藝術作品集：</strong></p><p><br></p><p><strong>現代時尚藝術品</strong>：https://bit.ly/3s2Lfxk</p><p><strong>吉祥物和定製藝術品</strong>：https://bit.ly/31T5ymk</p><p><br></p><p><strong>為什麼選擇StrideInIt 團隊？</strong></p><ul><li>我們相信我們的買家和他們的設計願景。</li><li>與我們的買家進行值得信賴的合作。</li><li>我們是一個親身實踐所有設計風格的團隊。一個“<strong>多才多藝</strong>”的團隊。&nbsp;&nbsp;</li></ul><p><br></p><p><br></p><p><strong>項目指南和退款政策：</strong></p><ul><li>設計質量取決於您使用的包裝類型。請聯繫我們進行任何包裝諮詢。</li><li>我們的產品組合包含高級/標準/定制設計。下訂單前直接聯繫我們定製藝術品。</li><li>我們將根據您的共同要求製作您的徽標。您始終可以根據項目範圍要求任何類型的修改/重做。</li></ul><p><br></p><p><strong>聽起來不錯？</strong></p><p><br></p><p>抓住我們作為您的設計合作夥伴，看看我們的團隊創造奇蹟......！！&nbsp;</p><p>如有任何疑問，請留言。</p><p><br></p><p>我們在周日進行設計休息..！</p><p><br></p><p><strong>快樂的 Fiverring... :)</strong></p>', 500, '1655219935766.webp 1655219935766.webp 1655219935766.webp 1655219935767g.jpg', 0, 104, '2022-06-14 23:18:55'),
(107, 'Clementine Bauch', '我會做獨特、創意和現代的 3d 商業標誌設計', '<h2>關於本次演出</h2><p><strong>歡迎使用我們的服務</strong></p><p><br></p><p>您是否正在尋找獨特、​​創意和現代的 3D 商業標誌設計？您是所有類型的創意和現代標誌設計的理想場所。我們了解您的徽標的價值，並一定會根據您的要求從頭開始創建獨特的設計。</p><p><br></p><p>我們是擁有超過 8 年專業經驗的專業平面設計師團隊。</p><p><br></p><p><strong>為什麼是我們？</strong></p><p><br></p><p>✔ 高效的專業和創意設計。</p><p>✔ 獲取源文件 - Ai、Eps、Psd、Pdf 和高質量的 Jpg、Png。</p><p>✔ 版權歸客戶所有。</p><p>✔ 可靠和快速的溝通。</p><p>✔ 終身客戶支持。</p><p>✔ 專業快捷的客戶服務。</p><p>✔100% 原始矢量標誌</p><p><br></p><p><strong>我們的專長</strong>&nbsp;：</p><p><br></p><p>創意標誌 |&nbsp;多才多藝 |&nbsp;平 |&nbsp;現代 |&nbsp;獨一無二 |&nbsp;奢華 |&nbsp;排版 |&nbsp;女性 |&nbsp;簽名 |&nbsp;3d 模型 |&nbsp;自定義徽標</p><p><br></p><p>我們也接受定制訂單和超快速交貨訂單，請給我留言以獲得最優惠的價格！</p><p><br></p><p><strong>看起來令人印象深刻？</strong></p><p><br></p><p>只需單擊一下即可獲得令人驚嘆的設計。</p><p>我們隨時為您提供幫助。</p><p>立即訂購演出 :)</p><p><br></p><p>筆記：</p><p>- 我的展示/投資組合徽標屬於標准或高級套餐。請訂購合適的包裹</p>', 500, '1655219972168).jpg 1655219972169).jpg 1655219972170y.jpg', 0, 104, '2022-06-14 23:19:32'),
(108, 'Clementine Bauch', '我將為彩虹主題的 lgbtq、gay、lesbian 等創建或重新設計驕傲標誌', '<h2>關於本次演出</h2><p>為了表達您對 LGBTQ+、男同性戀、女同性戀、雙性戀變性者、酷兒等社區的支持，我將設計、改造或重新製作您的企業徽標，使其成為驕傲月主題顏色或彩虹色。</p><p><br></p><p>在這次演出中，我將為您提供廣泛的驕傲月標誌概念，您可以從中輕鬆選擇，並且我將進行無限的修改，直到您完全滿意為止。</p><p><br></p><p>我總是創造獨一無二且引人注目的創意驕傲標誌。</p><p>另外，如果您有任何設計想法或想要添加的任何元素，請在我的收件箱中告訴我，我將在我的設計中實現它們。</p><p><br></p><p>我總是樂於接受建議。</p><p><br></p><p><strong>在從頭開始訂購全新徽標或新徽標之前，請在我的收件箱中給我發消息，因為我需要向您詢問一些細節。</strong></p><p><br></p><p>我全天候 24/7 有空，所以請隨時給我發消息！！！</p><p><br></p><p><strong><em>最後但並非最不重要的一點是，我很高興地通知您，在每個月底，我會將總訂單收入的 1% 捐贈給 LGBTQ+ 社區。</em></strong></p><p><br></p><p>客戶滿意度對我來說是必須的，否則我將退還您的錢！</p><p><br></p><p>再次感謝您聯繫我的演出。</p>', 400, '1655220013991.webp 1655220013992.webp 1655220013992.webp 1655220013992.webp', 0, 104, '2022-06-14 23:20:14'),
(109, 'Clementine Bauch', '我們的工作室將為您的企業提供優質的標誌設計', '<h2>關於本次演出</h2><p><strong>尋找專業/企業/定制/現代/抽象/創意/網絡和高品質標誌？我是經驗豐富的設計師。請與我聯繫。</strong></p><p><br></p><p>我正在提供具有無與倫比的質量和出色的交貨時間的現代高品質商業標誌設計服務。</p><p><br></p><p>這是我們以 120 美元“推薦”提供的產品</p><p><br></p><ul><li>我將為您提供 3000 像素 X 2000 像素 JPG 和透明 PNG 格式的徽標的極簡主義 3 選項。</li><li>所選選項的源文件和矢量文件</li><li>3D模型</li><li>對一個選定的標誌設計進行無限修改。</li><li>出色的客戶支持。</li><li>每個徽標都將從頭開始製作，以滿足您的確切需求和最佳輸出。如果您對標誌設計有任何問題，我會盡力解決。</li></ul><p><br></p><ol><li>請檢查我的 Higher Packages 和 EXTRAS，了解我提供的徽標設計更有價值的選項，例如更快的周轉時間、矢量文件和 PSD 文件等。</li></ol>', 1200, '1655220049800.webp 1655220049800.webp 1655220049801.webp 1655220049801.webp', 0, 104, '2022-06-14 23:20:49'),
(110, 'Clementine Bauch', '我將為您的品牌做生意獨特的極簡標誌', '<p><strong><em>為您的品牌設計獨特的商業標誌</em></strong></p><p><br></p><p>這是 Ahsan，擁有 5 年以上的經驗，350 多個客戶，1500 多個完成的創意作品，各種複雜的項目。詳細和獨特的標誌設計包裝和品牌只提供高品質。</p><p>不僅是設計，還有網頁設計/插圖/徽標/UI-UX/星期三開發，移動應用程序桌面應用程序等等。我保證您 100% 滿意。</p><p><br></p><p>我的服務：</p><p><br></p><p>- 獨特的 2、3 和 5 標誌設計</p><p>- 源文件。</p><p>- 矢量格式。</p><p>- 高分辨率 jpeg 和透明背景 png。</p><p>- 無限修改，直到您 100% 滿意。</p><p><br></p><p><strong>關於工作的屬性</strong></p><p>創意、獨特、現代、簡約、專業、難忘、定制和商業標誌</p><p><br></p><p><strong>你在等什麼！立即下訂單並擁有出色的徽標</strong>！</p><p><br></p><p>有關該項目的任何說明，請與我聯繫。我很樂意為您提供幫助並更多地了解您的項目。</p><p><br></p><p><strong>太感謝了！</strong></p>', 1000, '1655220094273.webp 1655220094274.webp 1655220094274.webp', 0, 104, '2022-06-14 23:21:34'),
(111, 'Clementine Bauch', '我將設計您的專業標誌和品牌標識', '<p><strong>關於本次演出</strong></p><p><br></p><p><strong>為什麼你需要偉大的身份品牌？</strong></p><p>良好的品牌形象使您脫穎而出並推動業務增長。您的品牌是反映您企業核心價值觀和願景的體驗的起點。我為您提供獨特的 Identity 品牌設計，您的品牌將在競爭中脫穎而出並擁有自己的視覺個性。我將創建一個一致的視覺標識，為您的信息提供正確的基調來呈現自己，以一種有吸引力的方式傳遞您的品牌價值。</p><p><br></p><p><strong>工作過程：</strong></p><p>了解需求</p><p>簡要階段</p><p>設計的概念化</p><p>最終交付</p>', 550, '1655220147584.webp 1655220147584.webp 1655220147585.webp', 0, 104, '2022-06-14 23:22:27'),
(112, 'Clementine Bauch', '我將創建簡單的設計手繪和復古標誌', '<p>你在尋找手繪標誌設計嗎</p><p><br></p><p>在這裡，我將設計引人注目、獨特而優雅的手繪/簽名/復古/復古標誌，代表您的品牌。&nbsp;</p><p>如果您正在尋找與我的投資組合中顯示的相同質量的手繪結果，請選擇 PREMIUM PACKAGE</p><p>如果您有任何不同的要求或您有任何其他想法，請在下訂單前先與我聯繫。</p><p><br></p><p>如果客戶需要，我可能會使用股票藝術/圖像或其中的一部分</p><p>請繼續請求修改，直到您交付所有最終文件。</p><p>收件箱消息回复可能需要較長時間，請在送達後及時回复。因此，任何損失將不是賣方的責任。</p><p>您只需要選擇一個徽標作為最終徽標</p>', 1000, '1655220225240.webp 1655220225241.webp 1655220225241.webp 1655220225241.webp', 0, 104, '2022-06-14 23:23:45'),
(113, 'Clementine Bauch', '我將在 24 小時內完成優質獨特的簡約商業標誌設計', '<h2>關於本次演出</h2><p>歡迎來到我的<strong>優質獨特</strong>&nbsp;<strong>創意現代簡約商業標誌設計&nbsp;</strong>服務。</p><p><br></p><p>我將製作一個乾淨獨特、扁平、現代、簡約、商務和奢侈品牌的標誌設計。</p><p><br></p><p><strong>重要的！</strong></p><p><br></p><p>厭倦了獲取通用徽標/模板並需要真正<strong>獨特的</strong>東西？沒有得到快速響應？你是在正確的地方。<strong>現代優質</strong>&nbsp;標誌設計定義了您的品牌價值。我將指導您完成並讓您的設計過程變得超級簡單。（徽標將有資格打印、在網絡和任何社交媒體上以及在文具上使用）</p><p><br></p><p><strong>有關於我的一些：</strong></p><p><br></p><p>我是一名專業的平面設計師，擁有 10 年的“真實”市場經驗，專注於質量，相信客戶的滿意度。我提供完全可編輯和多功能的設計。</p><p><br></p><p><strong>我會為你做什麼？</strong></p><p><strong>&nbsp;</strong></p><p>✔️現代標誌設計理念&nbsp;&nbsp;</p><p>✔️完整的品牌風格指南</p><p>✔️調色板</p><p>✔️排版&nbsp;</p><p>✔️使用指南</p><p>✔️任何其他所需資產</p><p>✔️可交付格式 - AI（矢量）、EPS、PDF、SVG、PSD、JPG、PNG（透明）</p><p>&nbsp;</p><p>如果您有任何問題，請不要猶豫，甚至在您訂購之前，我都會盡可能地幫助您，期待與您合作。</p>', 500, '1655220285356.webp 1655220285357).jpg 1655220285357n.jpg', 0, 104, '2022-06-14 23:24:45'),
(114, 'Clementine Bauch', '我將為您繪製獨特的插圖或印刷設計', '<h2>關於本次演出</h2><p>嘿，我是安娜！我將創建一個可用於任何需求的超高質量繪圖。</p><p>您可以將其打印在 T 卹或紙上，可以作為不錯的禮物或投資。</p><p><br></p><p>我的目標是讓您 100% 滿意並成功實現您的業務或想法。我知道，要找到合適的人來完成這項任務並不容易，但我會盡力而為，我會一直在你身邊，讓你發光！</p><p><br></p><p>讓我們為您創造一個永恆的設計/插圖！</p><p><br></p><p>如果您有任何問題，請隨時與我聯繫 - 我會盡快回复您。</p><p><br></p><p>我期待為您和您的企業創造獨特的藝術品！</p><p>帶著愛和尊重安娜</p>', 4000, '1655220461762.webp 1655220461765).jpg 1655220461766).jpg 1655220461767u.jpg', 0, 105, '2022-06-14 23:27:41'),
(115, 'Clementine Bauch', '我會畫一個複古的 80 年代 90 年代動漫插畫', '<p><strong><em>重要的：</em></strong></p><ul><li><strong>請先發送消息了解我的可用性，並在下訂單前確保一切準備就緒。</strong></li><li><strong>沒有NSFW。</strong></li><li><strong>不接受 NFT 的訂單。</strong></li><li><strong>不接受來自第三方作品的痕跡或 100% 類似的重繪。</strong></li><li><strong>交貨後不接受重大修改。</strong></li><li><strong>喜歡純色或簡單的背景，因為我不是背景專家。但是，如果您需要詳細的背景，請給我留言討論。</strong></li></ul><p><br></p><p><strong>免責聲明：我所有的插圖都是純手繪（位圖格式），不是矢量圖，沒有描摹，沒有即時應用，沒有素描背景！因此，您將獲得任何人都無法擁有的獨特且非常定制的藝術品。:) Ps：您將獲得的最終格式是 JPG 和 PNG 透明背景。可索取PSD格式的源文件（需額外收費40美元）。</strong></p><p><br></p><p>90 年代插畫風格！難得在這一天見面。</p>', 450, '1655220503443.webp 1655220503445).jpg 1655220503446e.jpg 1655220503447.webp', 0, 105, '2022-06-14 23:28:23'),
(116, 'Clementine Bauch', '我會創作兒童插畫', '<h2>關於本次演出</h2><p>我叫瑪利亞。我喜歡畫畫，尤其是兒童讀物。我會為你創作一本兒童讀物插圖或繪本。</p><p>&nbsp;<strong>請在訂購前給我留言。</strong></p><p>這就是我們的工作方式：</p><p>1.你簡要地告訴我要畫什麼。更多細節=更好的插畫師。</p><p>2. 我給你發一張黑白素描。</p><p>3. 如果您需要更改，請隨時告訴我。</p><p>4. 草圖審核通過後，我會將完成的插圖發給您。&nbsp;</p>', 100, '1655220534939.webp 1655220534939.webp 1655220534939.webp', 0, 105, '2022-06-14 23:28:54'),
(119, 'josh0616', '專業徽標設計', '<p><span class=\"ql-font-helvetica ql-size-large\">豪華和專業設計</span></p><p><span class=\"ql-font-helvetica ql-size-large\">商業和簡單型別</span></p><p><span class=\"ql-size-large\">向量檔案</span></p><p><span class=\"ql-size-large\">高解析度</span></p><p><strong class=\"ql-size-large\">創意標誌 100%滿意度保證</strong></p><p><strong class=\"ql-size-large\">獨特的徽標設計</strong></p><p><strong class=\"ql-size-large\">模型設計</strong></p><p><strong class=\"ql-size-large\">原始檔，PNG，PSD，PDF，JPG，AI 3D豪華徽標模型</strong></p>', 452, '1655344489152.webp 1655344489153.webp 1655344489153.webp', 0, 101, '2022-06-16 09:53:53');

